INSERT INTO `tbfaq` (`faq_id`, `faq_source`, `faq_subject`, `faq_subject_id`, `faq_errata_title`, `faq_errata_text`, `faq_question`, `faq_answer`, `faq_exp_id`) VALUES
(1, 'official', 'monster', NULL, 'Rulebook, Page 16, ''Large Monsters''', 'Add, ''When interrupting a large monster’s movement to perform an action, the overlord must be able to declare the action that the large monster will perform before placing the monster’s figure on the map.'' ', NULL, NULL, 0),
(2, 'official', 'terrain', NULL, 'Rulebook, Page 18, ''Pit''', 'This section should read, ''Pit spaces are defined by a green line surrounding them. Each time a figure enters a pit space, that figure suffers two damage. A figure in a pit space cannot spend movement points. Other game effects that move a figure a number of spaces or place a figure in a different space without spending movement points can be used to exit a pit space. A figure in a pit space only has line of sight to adjacent figures, and only figures adjacent to a pit space have line of sight to a figure in that pit space. As an action, a figure in a pit space may remove his figure from the map and place it in an adjacent empty space; if there is no adjacent empty space, the figure cannot perform this action. Large monsters suffer the effects of entering and being in a pit space only if their movement ends or is interrupted so that each space they occupy is a pit space.''', NULL, NULL, 0),
(3, 'official', 'general', NULL, 'Rulebook, Page 18, ''The Golden Rules''', 'The first bullet point should read, ''Some cards and abilities come in direct conflict with the rules found in this rulebook. Cards and abilities take precedence over the rules in this rulebook. Furthermore, many quest rules listed in the Quest Guides come in direct conflict with cards, abilities, and the rules found in this rulebook. The quest rules listed in the Quest Guides take precedence over cards, abilities, and the rulebook.''\n', NULL, NULL, 0),
(4, 'official', 'two-hero', NULL, 'Rulebook, Page 18', 'Add “Two-Hero Game” section: When playing with two heroes, the heroes receive an additional advantage. Once during each hero’s turn, that hero may perform one attack that does not require an action. This attack cannot be a special action that includes an attack (“Rage” or “Exploding Rune” for example); the attack must be a regular attack action. This attack can only be performed during the “Perform Actions” step of the hero turn and can be performed before or after either of his actions. At the end of each hero’s turn, if that hero did not or could not perform the free attack during his turn, he may instead recover 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', NULL, NULL, 0),
(5, 'official', 'general', NULL, 'Rulebook, Page 20 and 24, ''The Campaign Phase''', 'The ''Shopping'' step should occur before the ''Spend Experience Points'' step; ''Shopping'' is step 4, and ''Spend Experience Points'' is step 5.', NULL, NULL, 0),
(6, 'official', 'shopping', NULL, 'Rulebook, Page 21, ''Shopping'' third paragraph', 'The second sentence should read, ''Shuffle the Shop Item cards and reveal five Shop Item cards.''', NULL, NULL, 0),
(7, 'official', 'interlude', NULL, 'Rulebook, Page 22, ''Act II'' transition steps', 'These steps should read:\n1. Perform steps 1-3 of the campaign phase found on page 20.\n2. Instead of performing a normal shopping step, the heroes can now purchase any Act I Shop cards. Deal out all remaining Act I Shop Item cards faceup. The hero players may purchase any number of Act I Shop Item cards.\n3. Return all unpurchased Act I Shop Item cards, Act I Monster cards, and Act I Lieutenant cards to the box. Retrieve the Act II Shop Item cards, Act II Monster cards, and Act II Lieutenant cards from the box. From now on, all monsters and lieutenants use their Act II characteristics. Act I Shop Item cards currently in possession of the\nheroes are unaffected. Any Act I Shop Item card sold by the heroes during Act II is returned to the box. \n4. Complete the campaign phase by performing steps 5-8 of the campaign phase found on page 20.', NULL, NULL, 0),
(8, 'official', 'skill', '173', 'Unholy Ritual', 'The card should read, ''Play this card at the start of your turn. Choose one of your monster groups and draw Overlord cards equal to the number of figures from that group on the map. Choose and keep 2 cards and discard the rest. Each monster in that group performs 1 less action during this turn.''', NULL, NULL, 0),
(9, 'official', 'skill', '162', 'Bloodlust', 'The card should read, ''Play this card when a hero is knocked out. Draw 2 Overlord cards. This is in addition to your normal 1 Overlord card drawn for defeating a hero.''', NULL, NULL, 0),
(10, 'official', 'skill', '199', 'Reinforce', 'The card should read, ''Play this card at the end of your turn and choose a master monster on the map. Place minion monsters of that monster’s group in empty spaces adjacent to that monster, up to the group limit. These monsters may not be placed within 3 spaces of any hero, but may otherwise be placed in any empty space.''', NULL, NULL, 0),
(11, 'official', 'monster', '12', 'Elemental, Act I and II', 'The Air ability should read, ''Until the start of your next turn, this monster can only be affected by attacks from adjacent figures.''', NULL, NULL, 0),
(12, 'official', 'hero', '4', 'Grisban the Thirsty, Hero Sheet', 'Grisban’s hero ability should read, ''Each time you perform a rest action, you may immediately discard 1 Condition card from yourself.''', NULL, NULL, 0),
(13, 'official', 'skill', '104', 'Runemaster, ''Break the Rune''', 'This card should read, ''Perform an attack with a Rune weapon. This attack ignores range and targets each other figure within 3 spaces and in your line of sight. Each figure rolls defense dice separately.''', NULL, NULL, 0),
(14, 'official', 'skill', '158', 'Knight, ''Guard''', 'This card should read, ''When a monster moves into an\nempty space adjacent to you, exhaust this card to interrupt that monster’s activation and perform an attack with a Melee weapon. After this attack is resolved, if the monster was not defeated, it may continue its activation.''', NULL, NULL, 0),
(15, 'official', 'skill', '11', 'Necromancer, ''Raise Dead''', 'The card should read, ''Place your Reanimate familiar token in an empty space adjacent to you.''', NULL, NULL, 0),
(16, 'official', 'skill', '50', 'Necromancer, ''Dying Command''', 'This card should read, ''Exhaust this card after you or your Reanimate resolves an attack. Choose 1 monster defeated by that attack and test Knowledge. If you fail, recover 1 Fatigue. If you pass, perform the following in order: return that monster to the map, move it up to its Speed, perform 1 attack with it, and remove it from the map.''', NULL, NULL, 0),
(17, 'official', 'skill', '76', 'Spirit Speaker, ''Ancestor Spirits''', 'This card should read, ''Exhaust this card when 1 or more monsters suffer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> from 1 of your class skills. Each of those monsters is Poisoned. Exhaust this card when 1 or more heroes recover <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or Fatigue from 1 of your class skills. Each of those heroes recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.''', NULL, NULL, 0),
(18, 'official', 'skill', '31', 'Wildlander, ''Running Shot''', 'This card should read, ''Each time you perform an attack with a Bow, you may move up to 2 spaces either before declaring a target or after the attack resolves. If you have Heavy Armor\nequipped, you may only move 1 space.''', NULL, NULL, 0),
(19, 'official', 'quest', '4', 'Questbook, Page 6, ''Castle Daerion,'' Special Rules', 'Villager Health should be 8 instead of 6.', NULL, NULL, 0),
(20, 'official', 'quest', '4', 'Questbook, Page 7, ''Castle Daerion.'' Setup', 'Should read, ''Any surviving villagers\nfrom Encounter 1 are placed on the Entrance tile or the closest available\nempty spaces at the end of the last hero''s first turn.''', NULL, NULL, 0),
(21, 'official', 'quest', '4', 'Questbook, Page 7, ''Castle Daerion,'' Special Rules', 'Add, ''After testing to marshal defenders, Sir Palamon may perform 1 move action.''\n<br />In addition, the brown defense die listed for Sir Palamon''s Defense should\nbe a gray defense die instead, and instead of 0, his listed Speed should be 4.', NULL, NULL, 0),
(22, 'official', 'quest', '7', 'Questbook, Page 9, ''The Cardinal’s Plight,'' Special Rules', '''When a hero ends his turn adjacent to Cardinal Koth,'' should be changed to ''When a hero first opens the door to the Library,''', NULL, NULL, 0),
(23, 'official', 'quest', '10', 'Questbook, Page 10, ''The Masquerade Ball,'' Victory', 'Change 3rd line to, ''The heroes roll a die (depending on the number of heroes) to determine whether Lord Theodir is among the guests they have rescued; roll a brown defense die for a 2-hero game, a gray defense die for a 3-hero game, or a black defense die for a 4-hero game. If the heroes did not rescue at least 1 guest, they did not rescue Lord Theodir regardless of the result.''', NULL, NULL, 0),
(24, 'official', 'quest', '19', 'Questbook, Page 40, ''The Man Who Would Be King''', 'Splig should start the quest in the adjacent space on the opposite side of the door. ', NULL, NULL, 0),
(25, 'official', 'general', NULL, 'Overlord Turn Summary, ''1. Start of turn''', 'Should read, <br />\r\nI. Draw 1 Overlord card and start of turn abilities.<br />\r\nII. Refresh cards.', NULL, NULL, 0),
(26, 'official', 'general', NULL, NULL, NULL, 'Do hero players have to agree on their turn order before the first hero acts?', 'Hero players do not have to determine the exact order in which each player takes his turn at the start of the round. They only need to decide who is going to take their turn first. After each hero player takes his turn, they can decide who takes their turn next.', 0),
(27, 'official', 'general', NULL, NULL, NULL, 'In the Epic Play Variant, can heroes sell back their starting equipment for 25 gold each before the game begins like they can in Campaign mode?', 'Yes, hero players may sell back any starting equipment before the game. Starting equipment is sold for 25 gold each.', 0),
(28, 'official', 'general', NULL, NULL, NULL, 'When exactly can cards with a timing of ''during your turn'' be used?', 'Any skill or ability with a timing of ''during your turn'' can only be used during the Perform Actions step of a hero’s turn for the heroes and during the Activate Monsters step of the overlord’s turn for the overlord. A player cannot use these skills or abilities at the start of his turn or at the end of his turn.', 0),
(29, 'official', 'general', NULL, NULL, NULL, 'What abilities affect ''figures treated as hero figures?''', 'Hero abilities, monster abilities, monster attacks, and Overlord cards that can target a hero can also target a figure that is treated as a hero figure. Figures treated as hero figures may be given conditions and are affected by terrain. Nothing else affect figures treated as hero figures unless specifically stated (for example, quest rules and Plot cards).', 0),
(30, 'official', 'general-los', NULL, NULL, NULL, 'When tracing line of sight to the corner of a space containing a figure, does\r\nthe figure occupying the target space block line of sight?', 'Yes, if the line passes through any blocked space (a space containing a\r\nfigure or obstacle) the target space is not in line of sight. This includes the\r\ntarget space itself.', 0),
(31, 'official', 'general-los', NULL, NULL, NULL, 'Are spaces that are separated by a wall (edge of a map tile) adjacent to each other?', 'No, spaces that are separated by a wall (the black edge of a map tile) are not adjacent nor are they in line of sight to each other. Although the two spaces technically share a corner, the wall blocks both movement and line of sight between the two spaces on either side.', 0),
(32, 'official', 'general-los', NULL, NULL, NULL, 'When counting spaces for skills and abilities, such as the Thief skill\r\n“Greedy,” do other figures block the path? How about doors?', 'When counting spaces like this, players ignore all other figures on the path. Unless line of sight is specifically stated as a requirement, figures only need to be in range for these skills or abilities to work. However, doors do block this path. A Thief cannot use “Greedy” through a door because he cannot count spaces through the door.', 0),
(33, 'official', 'skill', '116', NULL, NULL, 'When counting spaces for skills and abilities, such as the Thief skill “Greedy,” do other figures block the path? How about doors?', 'When counting spaces like this, players ignore all other figures on the path. Unless line of sight is specifically stated as a requirement, figures only need to be in range for these skills or abilities to work. However, doors do block this path. A Thief cannot use “Greedy” through a door because he cannot count spaces through the door.', 0),
(34, 'official', 'general-los', NULL, NULL, NULL, 'Should gaps in a map (areas where there are no tiles) be defined as blocked spaces when considering other rules, such as line of sight?', 'Areas between map tiles do not contain any spaces because they are not on map tiles. In addition, the black borders found on the edge of map tiles represent impassable walls that block line of sight, movement, and any path when counting spaces.', 0),
(35, 'official', 'skill', '154', NULL, NULL, 'Can the Knight use ''Advance'' to move without performing the attack?', 'Yes.', 0),
(36, 'official', 'skill', '14', NULL, NULL, 'Does the Disciple’s ''Prayer of Healing'' require an action?', 'No. Any skill or ability that requires an action to perform is denoted with a <span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>.', 0),
(37, 'official', 'general-condition', NULL, NULL, NULL, 'Does the Stunned condition take away a figure’s entire turn?', 'No, the Stunned condition causes a figure to use its first action to discard the Condition card. After a Stunned card or token is discarded, the figure is free to perform a second action. If a figure becomes Stunned during its turn after performing its first action, its second action must be used to discard the Stunned card or token.', 0),
(38, 'official', 'general-condition', NULL, NULL, NULL, 'What happens when a figure is Immobilized during a move action?', 'That figure’s move action immediately ends, and that figure’s remaining movement points are reduced to 0.', 0),
(39, 'official', 'general-condition', NULL, NULL, NULL, 'When Immobilized, can a figure use skills and abilities that allow movement not related to a move action?', 'Yes. Any skill or ability that does not refer to performing a move action may be used while a figure is Immobilized. This includes skills or abilities that remove a figure from the map and place it in another\r\nspace, skills or abilities that allow a figure to move an amount of spaces based upon its Speed, and skills and abilities by which a figure can gain movement points.', 0),
(40, 'official', 'skill', '154', NULL, NULL, 'When Immobilized, can a figure use skills and abilities that allow movement not related to a move action?', 'Yes. Any skill or ability that does not refer to performing a move action may be used while a figure is Immobilized. This includes skills or abilities that remove a figure from the map and place it in another\r\nspace, skills or abilities that allow a figure to move an amount of spaces based upon its Speed, and skills and abilities by which a figure can gain movement points.', 0),
(41, 'official', 'general-condition', NULL, NULL, NULL, 'If a condition is applied to an attack that uses Blast, do all figures affected\r\nby the attack suffer the condition?', 'Yes, but each figure affected by the attack still needs to be dealt at least\r\n1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after its own defense roll) in order to suffer the condition', 0),
(42, 'official', 'skill', '43,80,84,98,427', NULL, NULL, 'If a condition is applied to an attack that uses Blast, do all figures affected\r\nby the attack suffer the condition?', 'Yes, but each figure affected by the attack still needs to be dealt at least\r\n1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after its own defense roll) in order to suffer the condition', 0),
(43, 'official', 'item', '89,133,140,151', NULL, NULL, 'If a condition is applied to an attack that uses Blast, do all figures affected\r\nby the attack suffer the condition?', 'Yes, but each figure affected by the attack still needs to be dealt at least\r\n1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after its own defense roll) in order to suffer the condition', 0),
(44, 'official', 'monster', NULL, NULL, NULL, 'If a condition is applied to an attack that uses Blast, do all figures affected\r\nby the attack suffer the condition?', 'Yes, but each figure affected by the attack still needs to be dealt at least\r\n1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after its own defense roll) in order to suffer the condition', 0),
(45, 'official', 'general-knockout', NULL, NULL, NULL, 'What happens when a hero is defeated during his turn?', 'If a hero is defeated during his own turn, his turn immediately ends.', 0),
(46, 'official', 'general-knockout', NULL, NULL, NULL, 'Can a knocked out hero do anything after standing up during his turn?', 'After performing a stand up action, the hero’s turn immediately ends. This means the hero cannot suffer any fatigue to gain movement points or use any other skills or abilities.', 0),
(47, 'official', 'general-knockout', NULL, NULL, NULL, 'If a hero is knocked out, does he have to stand up during his turn?', 'No. A hero is not required to perform any actions on his turn.', 0),
(48, 'official', 'general-movement', NULL, NULL, NULL, 'Q: Can a figure interrupt its move action to perform another move action, and if so, how are the spaces moved through during the first and second move action differentiated (and what happens if a card instructs you to ''end your move action'')? How do the players differentiate between spaces that were moved through due to an action and spaces that were moved through due to suffering fatigue?', 'When a figure performs a move action, that figure receives a number of movement points equal to his Speed. A figure can interrupt its move action to perform an additional move action, which gives that figure additional movement points. There is no need to differentiate the two move actions because they are both move actions. If a card instructs you to end your move action and that figure performed two move actions, then both actions end and that figure loses all unspent movement points. However, if a hero player wishes to suffer fatigue to gain movement points in the middle of a move action, he must declare exactly when he is suffering the fatigue within the move action and which spaces he moves into with those additional movement points.', 0),
(49, 'official', 'general-movement', NULL, NULL, NULL, 'If a figure interrupts a move action to perform another action, does the figure have to be in an empty space?', 'Yes, a figure must be in an empty space when ending or interrupting its movement.', 0),
(50, 'official', 'general-movement', NULL, NULL, NULL, 'If a skill or ability allows a figure to gain movement points during another player’s turn, when can those movement points be used?', 'Any movement points gained during another player’s turn, such as if the Wildlander uses the First Strike skill with the Running Shot skill during the overlord’s turn, must be used immediately. If these movement points not used before the active player resumes his turn, the movement points are lost.', 0),
(51, 'official', 'skill', '31', NULL, NULL, 'If a skill or ability allows a figure to gain movement points during another player’s turn, when can those movement points be used?', 'Any movement points gained during another player’s turn, such as if the Wildlander uses the First Strike skill with the Running Shot skill during the overlord’s turn, must be used immediately. If these movement points not used before the active player resumes his turn, the movement points are lost.', 0),
(52, 'official', 'general-movement', NULL, NULL, NULL, 'Does a large monster suffer damage when ''expanding'' into spaces containing lava?', 'No. A figure only suffers damage when entering a space containing lava. When ending its movement, the large monster is only considered to have entered the one space in which it ended its movement.', 0),
(53, 'official', 'monsters', NULL, NULL, NULL, 'Does a large monster suffer damage when ''expanding'' into spaces containing lava?', 'No. A figure only suffers damage when entering a space containing lava. When ending its movement, the large monster is only considered to have entered the one space in which it ended its movement.', 0),
(54, 'official', 'skill', '323', NULL, NULL, 'Does ''Word of Misery'' cause a hero to suffer 1 fatigue for each damage\r\nsuffered?', 'No, ''Word of Misery'' causes a hero to suffer 1 fatigue each time he would suffer any amount of damage. For example, if a hero suffers 3 damage, he would suffer 1 fatigue in addition to the 3 damage he suffered.', 0),
(55, 'official', 'skill', '323', NULL, NULL, 'If a hero has suffered fatigue equal to his Stamina and is affected by ''Word of Misery,'' would the damage he suffers in place of the fatigue trigger the effect again?\r\n', 'No.', 0),
(56, 'official', 'skill', '318', NULL, '', 'Can a hero suffer fatigue to gain a movement point in response to a ''Pit Trap'' in order to avoid being Stunned?', 'No, the effects of “Pit Trap” are applied immediately.', 0),
(57, 'official', 'skill', '316,317', NULL, NULL, 'Can ''Frenzy'' be used to perform actions that include attacks, such as the\r\nelemental’s ''Fire'' ability?', 'No. ''Frenzy'' provides the monster’s basic attack and cannot be used\r\nfor other abilities.', 0),
(58, 'official', 'quest', '1', NULL, NULL, 'In Encounter 2 of ''A Fat Goblin,'' if the heroes manage to kill all the goblins before Splig finds Frederick, is this an automatic win for the Heroes? Can Splig go fetch/interrogate the remaining prisoners?', 'During Encounter 2 of ''A Fat Goblin,'' Splig can pick up and carry prisoners just like goblin archers. However, Splig must be in the Torture Chamber to interrogate the prisoner.', 0),
(59, 'official', 'quest', '10', NULL, NULL, 'Does ''The Masquerade Ball'' end if only cultists are left unmasked?', 'No, the encounter cannot end before all guests are unmasked. After all guests are unmasked, if there are no guests or monsters remaining, the encounter ends. ', 0),
(60, 'official', 'quest', '16', NULL, NULL, 'In ''The Shadow Vault,'' when Zachareth is defeated and placed on the Entrance, does he come back with full Health?', 'Yes, Zachareth fully recovers all damage and is placed on the Entrance.', 0),
(61, 'official', 'quest', '9', NULL, NULL, 'In Encounter 1 of ''The Ritual of Shadows,'' what happens if Lord Merick Farrow is defeated without a hero dealing at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to him, such as if the overlord plays the ''Blood Rage'' Overlord card?', 'The heroes win the encounter.', 0),
(62, 'official', 'quest', '13', NULL, NULL, 'In Encounter 1 of ''Death on the Wing,'' what happens to the overlord victory condition if players have incorporated an expansion that contains additional objective tokens?', 'Ignore any objective tokens added from other expansions. If all 10 objective tokens from the base game are on the map at the same time, the overlord wins the encounter.', 0),
(63, 'official', 'skill', '81', 'Geomancer, ''Quaking Word''', 'This card should read, ''<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon. This attack gains: <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>:: Each monster within 2 spaces of a Summoned Stone tests Awareness. Each figure that fails is Stunned.''', NULL, NULL, 1),
(64, 'official', 'secretroom', NULL, 'Rulebook, Page 5, ''Exploring a Secret Room”', 'Add, ''A hero cannot explore a secret room if there is already a Secret Room card in play.''', NULL, NULL, 1),
(65, 'official', 'rumors', NULL, 'Rulebook, Page 7, ''Act Specific Quest Cards''', 'This section should read, Some Rumor cards are restricted to particular acts. This is designated by the act icon on the upper left of the Rumor card. The overlord can only play Rumor cards during the act that corresponds with this icon. At the start of Act II, the overlord must discard all Rumor cards that have the Act I restriction from his hand. Any Rumor cards that are in play that have the Act I restriction are also discarded. He does not draw additional Rumor cards to replace the discarded cards.', NULL, NULL, 1),
(66, 'official', 'secretrooms', NULL, 'Hidden Stash', 'The card should read, ''Then discard this Secret Room card and the secret room entrance token.''', NULL, NULL, 1),
(67, 'official', 'rumors', NULL, NULL, NULL, 'If an Act I Rumor card with an available quest is in play, are the heroes and overlord forced to play it before the Interlude?', 'No, but that quest will no longer be an eligible choice after the Interlude has been completed.', 1),
(68, 'official', 'class', 'Champion', NULL, NULL, 'Does a hero discard valor tokens from his Hero sheet when he is defeated?\r\n', 'No.', 1),
(69, 'official', 'monster', '18', NULL, NULL, 'How does the hybrid sentinel’s ''Prey on the Weak'' ability affect a figure that is treated as a hero but does not have attribute values, such as a familiar?', 'It has no effect on that figure.', 1),
(70, 'official', 'familiar', NULL, NULL, NULL, 'How does the hybrid sentinel’s ''Prey on the Weak'' ability affect a figure that is treated as a hero but does not have attribute values, such as a familiar?', 'It has no effect on that figure.', 1),
(71, 'official', 'quest', '24', NULL, NULL, 'In Encounter 2 of ''Armed to the Teeth,'' can each hybrid sentinel perform the special action to equip the troops each round?\r\n', 'Yes.', 1),
(72, 'official', 'general', NULL, 'Rulebook, Page 4, ''Elixir Tokens''', 'Add, ''Allies and familiars treated as hero figures can also gain elixir tokens. Each time an ally or familiar gains one elixir\r\ntoken, place it on their card. Allies and familiars treated as hero figures can discard elixir tokens to recover damage just like heroes. Allies and familiars treated as hero figures discard all elixir tokens on their card when they are defeated, when they are summoned, and at the end of each encounter.''', NULL, NULL, 2),
(73, 'official', 'class', 'Apothecary', 'Rulebook, Page 4, ''Elixir Tokens''', 'Add, ''Allies and familiars treated as hero figures can also gain elixir tokens. Each time an ally or familiar gains one elixir\r\ntoken, place it on their card. Allies and familiars treated as hero figures can discard elixir tokens to recover damage just like heroes. Allies and familiars treated as hero figures discard all elixir tokens on their card when they are defeated, when they are summoned, and at the end of each encounter.''', NULL, NULL, 2),
(74, 'official', 'skill', '68', 'Apothecary, ''Potent Remedies''', 'This card should read, ''When a hero discards an elixir token from his Hero sheet, he may roll 1 additional green power die and recover Fatigue equal to the <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> rolled, in addition to any <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> recovered (even if this card is exhausted). You may exhaust this card to revive an adjacent hero without using an action.”', NULL, NULL, 2),
(75, 'official', 'quest', '28', 'Rulebook, Page 14, ''Reclamation,'' Special Rules, first sentence', 'Should read, ''The overgrowth in this encounter is extremely dense and difficult to move through.''', NULL, NULL, 2),
(76, 'official', 'quest', '29', 'Rulebook, Page 16, ''Through the Mist,'' Special Rules, second paragraph:', '''If a lost hero or ally ever has line of sight to the wisp or is within 3 spaces of a\r\nhero or ally that can measure line of sight to the wisp, the lost hero or ally is no longer lost.''', NULL, NULL, 2),
(77, 'official', 'quest', '33', 'Rulebook, Page 25, ''Back from the Dead,'' Special Rules, first paragraph', 'Add, ''Figures cannot remove overgrowth as normal.''', NULL, NULL, 2),
(78, 'official', 'quest', '35', 'Rulebook, Page 29, ''Fortune and Glory,'' The Hidden Passage', 'Add, ''Doors cannot be opened or closed normally.''', NULL, NULL, 2),
(79, 'official', 'quest', '35', 'Rulebook, Page 28, ''Fortune and Glory,'' Victory, first sentence', 'Should read, ''If the hero carrying the prisoner moves off the map through the Exit, read the following aloud: ...''', NULL, NULL, 2),
(80, 'official', 'quest', '36', 'Rulebook, Page 31, ''Heart of the Wilds,'' Defiled Ground, first sentence', 'Should read, ''As an action, while on the Wild Garden, a monster with the Cursed monster trait may sacrifice itself.''', NULL, NULL, 2),
(81, 'official', 'quest', '37', 'Rulebook, Page 32, ''Let the Truth be Buried,'' Special Rules, The Chain, first\r\nsentence of the second paragraph', 'Should read, ''Chain links do not block line of sight; each time a figure other than Splig enters a space containing a chain link, that figure’s turn immediately ends.''', NULL, NULL, 2),
(82, 'official', 'quest', '37', 'Page 33, ''Let the Truth be Buried,'' Special Rules', 'Add, ''While Splig is under the overlord’s control, he cannot suffer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or be defeated.', NULL, NULL, 2),
(83, 'official', 'quest', '37', 'Rulebook, Page 33, ''Let the Truth be Buried,'' Special Rules, last sentence of the\r\nthird paragraph', 'Should read, ''While controlled by the heroes, Splig may move off the map through the Exit at any time. While controlled by the overlord, Splig may move off the map through the Exit if he has 3 objective tokens on his Lieutenant card.''', NULL, NULL, 2),
(84, 'official', 'quest', '38', 'Rulebook, Page 34, ''Fountain of Insight,'' Possessing Allies, last sentence of\r\nsecond paragraph', 'Should read, ''The overlord can only possess 1 ally and cannot possess an ally that has been cleansed.''', NULL, NULL, 2),
(85, 'official', 'quest', '39', 'Rulebook, Page 36, ''Tipping the Scales,'' Special Rules', 'Should read, ''As an action, while adjacent to a faceup objective token, a hero may pick it up. Each hero can only carry 1 weight at a time. As an action, a hero carrying\r\na weight may…''', NULL, NULL, 2),
(86, 'official', 'quest', '39', 'Rulebook, Page 36, “Tipping the Scales,” Reinforcements, last sentence of third\r\nparagraph', 'Should read, ''The overlord may reinforce up to 2 monsters, respecting group limits.''', NULL, NULL, 2),
(87, 'official', 'quest', '40', 'Rulebook, Page 38, ''Web of Power,'' Special Rules, first sentence of third\r\nparagraph', 'Should read, ''While Ariad has at least 1 fatigue token on her Lieutenant card, she cannot move, be moved, or be activated.''', NULL, NULL, 2),
(88, 'official', 'quest', '43', 'Rulebook, Page 44, ''A Glimmer of Hope,'' Monsters', 'Should read, ''Ariad. Lord Merick Farrow. Splig. Serena or Raythen. Zombies. 4 open groups.''', NULL, NULL, 2),
(89, 'official', 'quest', '43', 'Rulebook, Page 44, ''A Glimmer of Hope,'' Setup, fourth paragraph', 'Should read, ''Gather 1 red, 1 blue, 1 green, and 1 white objective token. Place 1 objective token faceup on each open monster group’s Monster card.''\r\n', NULL, NULL, 2),
(90, 'official', 'quest', '43', 'Rulebook, Page 44, ''A Glimmer of Hope,'' Magical Wards, third paragraph', 'Should read, “At the end of each overlord turn, if there are no objective tokens on the map, place 1 fatigue token in the overlord’s play area. ', NULL, NULL, 2),
(91, 'official', 'relic', '11', NULL, NULL, 'What happens if a hero with the sun stone is defeated and the sun stone token is not picked up before the end of the encounter?', 'The sun stone is returned to that hero.', 2),
(92, 'official', 'terrain', NULL, NULL, NULL, 'When a hero climbs out of a pit, can his figure be placed on the opposite\r\nside of an elevation line?', 'No.', 2),
(93, 'official', 'skill', '337', NULL, NULL, 'If the overlord plays ''Reflective Ward'' and the hero cannot suffer the Fatigue or chooses not to, how does a hero determine the amount of damage he suffers?', 'The attacking hero adds up all of the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> results, including any additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> the attack gains from <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results. Then, he rolls his defense pool, canceling 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each Shield result and suffering the rest of the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. No other effects from the attack, such as a condition, will apply to the hero.', 2),
(94, 'official', 'hero', '15', NULL, NULL, 'Can Logan Lashley use his Hero Ability if the attack he performs is a miss?', 'Yes.', 2),
(95, 'official', 'skill', '96', NULL, NULL, 'When the Hexer uses “Plague Cloud,” are the monsters hexed by the card’s effect then also targeted by the card’s attack?', 'Yes.', 2),
(96, 'official', 'skill', '88', NULL, NULL, 'Can the Hexer use the <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> ability from ''Enfeebling Hex'' to hex the target monster?', 'Yes.', 2),
(97, 'official', 'skill', '141', NULL, NULL, 'If the Beastmaster performs the special attack with the Wolf using ''Shadow Hunter,'' does that count as the Wolf''s activation?', 'No.', 2),
(98, 'official', 'quest', '27', NULL, NULL, 'During Encounter 2 of ''Honor Among Thieves,'' what happens if Raythen is present as an ally and reveals a green objective token?', 'The hero closest to Raythen on the map draws and keeps the Search card.', 2),
(99, 'official', 'quest', '43', NULL, NULL, 'During setup of ''A Glimmer of Hope,'' where is the ally placed if playing with four heroes?', 'Place the ally in the closest empty space to the entrance, on the other side of the door.', 2),
(100, 'official', 'secretroom', NULL, 'Page 5, ''Exploring a Secret Room''', 'Add, ''A hero cannot explore a secret room if there is already a Secret Room card in play.''', NULL, NULL, 3),
(101, 'official', 'rumors', NULL, 'Rulebook, Page 7, ''Act Specific Quest Cards''', 'This section should read,<br />\r\nSome Rumor cards are restricted to particular acts. This is designated by the act icon on the upper left of the Rumor card. The overlord can only play Rumor cards during the act that corresponds with this icon. At the start of Act II, the overlord must discard all Rumor cards that have the Act I restriction from his hand. Any Rumor cards that are in play that have the Act I restriction are also discarded. He does not\r\ndraw additional Rumor cards to replace the discarded cards.', NULL, NULL, 3),
(102, 'official', 'skill', '51', NULL, NULL, 'Can the Prophet use “Soothing Insight” to place the insight token on a hero who is knocked-out?', 'No.', 3),
(103, 'official', 'skill', '115', NULL, NULL, 'When he performs an attack, does the Stalker gain the +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> from ''Set Trap'' for each trap token he is adjacent to?', 'No. If the Stalker is adjacent to multiple trap tokens, he gains only +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on each attack.', 3),
(104, 'official', 'skill', '169', NULL, NULL, 'When a hero is under the effects of ''Dark Host,'' is he treated as a monster for the entire overlord turn?', 'No. That hero is treated as a monster only when the overlord chooses to perform the move and attack action with that hero. Before and after those actions, the hero is still treated as a hero.', 3),
(105, 'official', 'skill', '169', NULL, NULL, 'If a hero is under the effects of ''Dark Host,'' can the overlord play ''Dash'' or ''Frenzy'' on him?', 'No. ''Dash'' and ''Frenzy'' are played when the overlord is activating a monster. Though the overlord receives a move and attack action with the hero affected by ''Dark Host,'' it is not considered to be an activation.', 3),
(106, 'official', 'quest', '50', 'Rulebook, Page 12, “Civil War,” Quest map', 'When placing villager tokens and search tokens during setup, one villager token and one search token should be placed on Tile 61A as indicated in the image found in the FAQ.', NULL, NULL, 4),
(107, 'official', 'quest', '61', 'Rulebook, Page 35, ''Arise My Friends,'' Quest map', '''Rocky Passage'' should be identified as tile 20A, not tile 6A.', NULL, NULL, 4),
(108, 'official', 'skill', '381', 'Conjurer, ''Mirror Image''', 'This card should read, ''Use this card during your turn and suffer Fatigue equal to the number of image tokens on the map.''', NULL, NULL, 4),
(109, 'official', 'skill', '411', 'Diverse Means', 'This card should read, ''Play this card when a monster is attacked, after dice are rolled.''', NULL, NULL, 4),
(110, 'official', 'rumors', NULL, NULL, NULL, 'Which cards are used for traveling if the players choose a quest on a Quest card while playing the Shadow of Nerekhall campaign?', 'Travel Event cards are used.', 4),
(111, 'official', 'skill', '391', NULL, NULL, 'Can the Skirmisher use “Dual Strike” when performing a Ranged attack if he has two Melee weapons with 1 hand icon equipped, such as with the “Fire Flask” from the Search deck?', 'No.', 4),
(112, 'official', 'skill', '400', NULL, NULL, 'When the Shadow Walker uses ''Soul Bound,'' when exactly is the Shadow Soul placed?', 'The Shadow Soul is placed after resolving all the steps of combat that may cause the attack to be a miss. This is usually after the Shadow Walker rolls dice and checks range, but may happen during a later point of the attack if it is still not determined if the attack is a miss or not (such as\r\nneeding to spend 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> for the shadow dragon’s ''Shadow'' ability).', 4),
(113, 'official', 'class', 'Shadow Walker', NULL, NULL, 'What happens if the Shadow Soul is on the map when the Shadow Walker uses a skill that instructs him to place the Shadow Soul on the map?', 'The Shadow Soul is removed from its current location and placed as instructed.', 4),
(114, 'official', 'hero', '26', 'Thaiden Mistpeak, Hero Sheet', 'Thaiden''s hero ability should read, "Each time you perform an attack, after dice are rolled, you may cancel the attack and\nimmediately search a search token within 3 spaces of you."', NULL, NULL, 5),
(115, 'official', 'quest', '69', 'Rulebook, Page 14, ''Finders and Keepers''', 'Replace both occurrences of ''hero’s\r\nplay area'' with ''heroes’ play area.''\r\n', NULL, NULL, 5),
(116, 'official', 'quest', '70', 'Rulebook, Page 16, ''My House, My Rules,'' Rewards, third paragraph', 'Should read, ''If Skarn was not knocked unconscious, the overlord receives the\r\n''Endless Supply'' Overlord card.''', NULL, NULL, 5),
(117, 'official', 'quest', '71', 'Rulebook, Page 18, ''Where the Heart Is,'' Reinforcements, second paragraph', 'Should read, ''At the end of each overlord turn, if Skarn is not on the map and 1 or more master monsters are on the Basement...''', NULL, NULL, 5),
(118, 'official', 'quest', NULL, 'Rulebook, Page 22, “Beneath the Manor,” Victory, first paragraph', 'Replace ''...if Skarn moves off the map and there are no objective tokens...'' with ''...if Skarn moves off the map and there are no blue objective tokens...''', NULL, NULL, 5),
(119, 'official', 'skill', '490', NULL, NULL, 'When the overlord exhausts ''Call of the Ravens,'' can he choose the Raven\r\nFlock to suffer the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and then place it adjacent to its original space?', 'No.', 5),
(120, 'official', 'class', 'Unstable Forces', 'Tristayne Olliven, Act II', 'Attack type icon should be a Ranged icon, not a Melee icon. ', NULL, NULL, 23),
(121, 'official', 'lieutenantpack', NULL, NULL, NULL, 'Are threat tokens limited by the supply?', 'No.', 0),
(122, 'official', 'lieutenantpack', NULL, NULL, NULL, 'Can Plot cards target allies, familiars, or other figures ''treated as heroes?''', 'No.', 0),
(123, 'official', 'lieutenantpack', NULL, NULL, NULL, 'Do agents use the traits of their open monster group?', 'Yes.', 0),
(124, 'official', 'monster', '49', 'Crown of Destiny, ''Giant'' Monster card', '''Sweep'' should read, ''Perform an attack. This attack affects each other figure within 2 spaces and line of sight of this monster. Each figure rolls defense dice separately...''', NULL, NULL, 8),
(125, 'official', 'monster', '79', 'Visions of Dawn, ''Troll'' Monster card', '''Sweep'' should read, ''Perform an attack. This attack affects each other figure within 2 spaces and line of sight of this monster. Each figure rolls defense dice separately...''', NULL, NULL, 27),
(126, 'official', 'monster', '48', NULL, NULL, 'While using the ''Morph'' ability, does the Chaos Beast use the dice that the chosen figure gains from skills or other abilities, like the additional yellow power die the Reanimate gains from “Vampiric Blood” or the additional yellow power die the Raven Flock gains during Act II?', 'The “Morph” ability only uses the dice printed on the chosen figure’s card or weapon. Any game effects that add dice to the chosen figure’s attack pool do not add dice to the Chaos Beast’s attack pool.', 8);
