INSERT INTO `tbquests` (`quest_id`, `quest_name`, `quest_description`, `quest_type`, `quest_act`, `quest_req_type`, `quest_req`, `quest_rew_ol`, `quest_rew_h`, `quest_rew_relic_id`, `quest_travel`, `quest_enc1_monsters`, `quest_enc1_traits`, `quest_enc2_monsters`, `quest_enc2_traits`, `quest_enc3_monsters`, `quest_enc3_traits`, `quest_errata`, `quest_order`, `quest_expansion_id`) VALUES
(0, 'First Blood', 'An ambushed traveling caravan draws the attention of the heroes on their way to Arhynn. An ettin named Mauler, and his minions need to be stopped, lest they reach Arhynn before the heroes do.', 'Quest', 'Introduction', 'All', NULL, NULL, NULL, NULL, NULL, '7,8', 'wilderness,mountain', NULL, NULL, NULL, NULL, NULL, 2, 0),
(1, 'A Fat Goblin', 'Goblins have kidnapped some villagers during a raid on the farmlands north of Arhynn. Splig, King of All Goblins, means to find out who among them is the Shadow Binder, and he doesn''t plan on asking nicely.', 'Quest', 'Act 1', 'All', NULL, 'xp,1', 'goldhero,25', NULL, 'road,road,plains', '7,open', 'wilderness,civilized', '2,7,9,open', 'building,cave', NULL, NULL, '<strong>Q:</strong> In Encounter 2 of ''A Fat Goblin,'' if the heroes manage to kill all the goblins before Splig finds Frederick, is this an automatic win for the Heroes? Can Splig go fetch/interrogate the remaining prisoners?<br /><strong>A:</strong> During Encounter 2 of ''A Fat Goblin,'' Splig can pick up and carry prisoners just like goblin archers. However, Splig must be in the Torture Chamber to interrogate the prisoner.', 3, 0),
(2, 'The Monster''s Hoard', 'In return for saving him from the King of All Goblins, Frederick offers to take the heroes to the location of a bow called Trueshot. They just need to manage wresting it out of the Overlord''s minions'' hands.', 'Quest', 'Act 2', 'Heroes', '1', NULL, NULL, 6, 'road,water,mountains,plains,forest,mountains', '13,opennomassive', 'wilderness,mountain,water', '7,open,open', 'cave,hot,mountain', NULL, NULL, NULL, 6, 0),
(3, 'The Frozen Spire', 'Fredrick, one of the Shadow Binders, is being held prisoner in the Frozen Spire. He would be a valuable asset if the heroes managed to save him, but for that, they must first climb up the mountains slopes and face Ruin, the dragon that inhabits them.', 'Quest', 'Act 2', 'Overlord', '1', 'xp,2', 'xp,1', NULL, 'road,water,mountains,plains,forest,mountains', '14,open,open', 'water,cold,mountain', 'open,open,open', 'cave,cold,mountain', NULL, NULL, NULL, 6, 0),
(4, 'Castle Daerion', 'Sir Alric has launched a nighttime raid on Castle Daerion and a nearby town. Can the heroes save the towns villagers and rally them to the defence of the Shadow Binder know as Sir Palamon?', 'Quest', 'Act 1', 'All', NULL, 'xp,1', 'goldhero,25', NULL, 'road,road', 'open,open', 'civilized,water,dark', '3,8,10,open', 'civilized,building', NULL, NULL, '<strong>Special Rules:</strong> Villager Health should be 8\ninstead of 6. (page 6)<br /><br /><strong>Setup:</strong> Should read, ''Any surviving villagers from Encounter 1 are placed on the Entrance tile or the closest available empty spaces at the end of the last hero’s first turn.'' (page 7)<br /><br /><strong>Special Rules:</strong> Add, ''After testing to marshal defenders, Sir Palamon may perform 1 move action.'' (page 7)<br />In addition, the brown defense die listed for Sir Palamon’s Defense should be a gray defense die instead, and instead of 0, his listed Speed should be 4.', 3, 0),
(5, 'The Dawnblade', 'Believing the Dawnblade will play an essential role in the events to follow, Sir Palamon tasks you with retreiving it from it''s resting place in the tomb of Sir Arcite. But can the heroes keep it out of Sir Alric Farrow''s hands?', 'Quest', 'Act 2', 'Heroes', '4', NULL, '', 1, 'road,road,forest', 'open,open,open', 'water,cave', '3,14,open,open', 'cave,mountain,dark', NULL, NULL, NULL, 6, 0),
(6, 'The Desecrated Tomb', 'Still reeling from the death of Sir Palamon, Baron Greigory asks the heroes to prevent Sir Palamons'' old sword, the Dawnblade, from falling into the hands of Sir Alric Farrow.', 'Quest', 'Act 2', 'Overlord', '4', 'addmonster,14', '', 1, 'road,road,forest', '10,open', 'civilized,building,dark,cursed', '3,14,open', 'cave,dark,wilderness,cold', NULL, NULL, NULL, 6, 0),
(7, 'The Cardinal''s Plight', 'Lord Merrick Farrow is raising an army of Zombies in order to kill Cardinal Koth, one of the Shadow Binders. Unless stopped Lord Merrick will surely succeed, and a powerful relic called the Staff of Light falls into his hands.', 'Quest', 'Act 1', 'All', NULL, NULL, NULL, 4, 'road,water,plains,mountains', '4,11,10,open', 'dark,cursed,wilderness,civilized', '4,10,open,open,open', 'civilized,cursed,building,dark', NULL, NULL, '<strong>Special Rules:</strong> ''When a hero ends his turn adjacent to Cardinal Koth,'' should be changed to ''When a hero first opens the door to the Library,'' (page 9)', 3, 0),
(8, 'Enduring the Elements', 'The wards protecting the temple housing the powerful elemental artifacts known as the Four Storms are fading and Lord Merrick Farrow has discovered it''s location. ', 'Quest', 'Act 2', 'Heroes', '7', 'xp,1;addmonster,12', 'goldhero,25', NULL, 'road,water,plains,water', 'open,open', 'cold,hot,cave', '4,12,open', 'cave,hot,cold,building', NULL, NULL, NULL, 6, 0),
(9, 'The Ritual of Shadows', 'Lord Merrick Farrow is using the Staff of Shadows in an attempt to perform a dire ritual. Putting a halt to this ritual would thwart the Overlord''s plans and could give the heroes another chance at obtaining the Staff of Light.', 'Quest', 'Act 2', 'Overlord', '7', 'xp,1;special,returncards', 'goldhero,25;special,4', NULL, 'road,water,plains,road', '4,11,open,open', 'dark,cursed,cave', '4,11', 'cave,cursed,dark', NULL, NULL, '<strong>Q:</strong> In Encounter 1 of ''The Ritual of Shadows,'' what happens if Lord Merick Farrow is defeated without a hero dealing at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to him, such as if the overlord plays the ''Blood Rage'' Overlord card?<br /><strong>A:</strong> The heroes win the encounter.', 6, 0),
(10, 'The Masquerade Ball', 'The masquerade ball at Lord Theodir''s estate provides a perfect opportunity for Lady Eliza and her minions to mingle among the guests. Too late to warn the Shadow Binder, can the heroes save him instead?', 'Quest', 'Act 1', 'All', NULL, NULL, NULL, 2, 'road,road,plains', '5,11,open,open', 'cursed,building,civilized', '5,9,open,open', 'civilized,cursed,cave,dark', NULL, NULL, '<strong>Victory:</strong> Change 3rd line to, ''The heroes roll a die (depending on the number of heroes) to determine whether Lord Theodir is among the guests they have rescued; roll a brown defense die for a 2-hero game, a gray defense die for a 3-hero game, or a black defense die for a 4-hero game. If the heroes did not rescue at least 1 guest, they did not rescue Lord Theodir regardless of the result.'' (Page 10)<br /><br /><strong>Q:</strong> Does ''The Masquerade Ball'' end if only cultists are left unmasked?<br />\n<strong>A:</strong> No, the encounter cannot end before all guests are unmasked. After\nall guests are unmasked, if there are no guests or monsters remaining, the\nencounter ends.', 3, 0),
(11, 'Blood of Heroes', 'Baron Zachareth''s old steward might provide invaluable information about Zachareth''s fortress. Reaching the man''s cabin, however, they find him being held by Lady Eliza. Can the exiled steward still be saved?', 'Quest', 'Act 2', 'Heroes', '10', 'xp,2', 'xp,1', NULL, 'road,water,plains,road', '7,open', 'wilderness,building,mountain', '5,11', 'cave,cursed,dark', NULL, NULL, NULL, 6, 0),
(12, 'The Twin Idols', NULL, 'Quest', 'Act 2', 'Overlord', '10', 'xp,2', 'xp,1', NULL, 'road,water,plains,road,forest,mountains', '8,open', 'dark,mountain,cave', '5,10,open', 'mountain,cursed', NULL, NULL, NULL, 6, 0),
(13, 'Death on the Wing', 'Shipments have ceased arriving from the silver mines, putting severe strain on the treasury of Arhynn. The Greystone watchtower overlooking the mines might be a good place to start investigating.', 'Quest', 'Act 1', 'All', NULL, NULL, NULL, 3, 'road,road,water', '9,open', 'wilderness,mountain,civilized', '6,12,open', 'mountain,civilized,wilderness,building', NULL, NULL, '<strong>Q:</strong> In Encounter 1 of ''Death on the Wing,'' what happens to the overlord victory condition if players have incorporated an expansion that contains additional objective tokens?<br /><strong>A:</strong> Ignore any objective tokens added from other expansions. If all 10\nobjective tokens from the base game are on the map at the same time, the overlord wins the encounter.', 3, 0),
(14, 'The Wyrm Turns', NULL, 'Quest', 'Act 2', 'Heroes', '13', 'xp,2', 'xp,1', NULL, 'road,water,plains,mountains,plains,mountains', '9,open,open', 'hot,dark', '6,open,open,open', 'mountain,hot,wilderness', NULL, NULL, NULL, 6, 0),
(15, 'The Wyrm Rises', NULL, 'Quest', 'Act 2', 'Overlord', '13', 'xp,1', 'goldhero,25', NULL, 'road,water,plains,mountains,plains,mountains', 'openhero', 'cursed,mountain,cave', '6,14,open', 'cave,cursed', NULL, NULL, NULL, 6, 0),
(16, 'The Shadow Vault', 'The heroes manage to locate one half of The Shadow Rune, a runestone used to bind a being called Gryvorn. Can the heroes retreive it safely from the Shadow Vault, now that an unexpected foe has arrived?', 'Quest', 'Interlude', 'Heroes', NULL, NULL, NULL, 5, 'road,road,plains,forest', '1,open,open,open', 'cursed,dark,wilderness,water,cave', NULL, NULL, NULL, NULL, '<strong>Q:</strong> In ''The Shadow Vault,'' when Zachareth is defeated and placed on the Entrance, does he come back with full Health?<br /><strong>A:<strong> Yes, Zachareth fully recovers all damage and is placed on the Entrance.', 4, 0),
(17, 'The Overlord Revealed', 'Baron Zachareth has set off to find The Shadow Rune, a runestone used to bind a being called Gryvorn. Sent out to assist Zachareth''s soldiers at the Shadow Vault, the heroes arrive to find only minions of the Overlord awaiting them. ', 'Quest', 'Interlude', 'Overlord', NULL, NULL, NULL, 5, 'road,road,plains,forest', '1,open,open,open', 'dark,cursed,building,cave', NULL, NULL, NULL, NULL, NULL, 5, 0),
(18, 'Gryvorn Unleashed', NULL, 'Quest', 'Finale', 'Heroes', NULL, NULL, NULL, NULL, 'road,water,mountains,plains', '3,6,2;replace,3,5-6,open;replace,6,14-15,open', 'all', '1,14', 'all', NULL, NULL, NULL, 7, 0),
(19, 'The Man Who Would Be King', NULL, 'Quest', 'Finale', 'Overlord', NULL, NULL, NULL, NULL, 'road,water,mountains,plains', '3,6,2,open;replace,3,5-6,10;replace,6,14-15,7', 'all', '1,4,5,10,open', 'all', NULL, NULL, '<strong>''The Man Who Would Be King'':</strong> Splig should start the quest in the adjacent space on the opposite side of the door. (page 40)', 8, 0),
