(27, 'Honor Among Thieves', NULL, 'Quest', 'Act 1', 'All', '25', 'xp,1', 'goldall,100;excess,1', NULL, 'road,plains,forest', '23,24,open', 'water,building', '4,24,open', 'wilderness,water', NULL, NULL, '<strong>Q:</strong> During Encounter 2 of ''Honor Among Thieves,'' what happens if Raythen is present as an ally and reveals a green objective token?<br /><strong>A:</strong> The hero closest to Raythen on the map draws and keeps the Search card.', 3, 2),
