(36, 'Heart of the Wilds', NULL, 'Quest', 'Act 2', 'All', NULL, NULL, NULL, 10, 'road,forest,plains,mountains', '10,26', 'building,water,cave', '7,11,open', 'water,cursed,wilderness', NULL, NULL, '<strong>Defiled Ground, first sentence:</strong> Should read, ''As an action, while on the Wild Garden, a monster with the Cursed monster trait may sacrifice itself.'' (page 31)', 5, 2),
(37, 'Let the Truth be Buried', NULL, 'Quest', 'Act 2', 'All', NULL, 'xp,1', 'goldall,150;blockmonster,2', NULL, 'road,forest,plains,mountains', '2,7,10,open', 'mountain,cave', '2,9,26,25', 'cave,mountain', NULL, NULL, '<strong>Special Rules:</strong> Add, ''While Splig is under the overlord’s control, he cannot suffer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or be defeated.'' (page 33)', 5, 2),
(38, 'Fountain of Insight', NULL, 'Quest', 'Act 2', 'All', NULL, 'xp,1', 'serena,368;raythen,371', NULL, 'road,plains,mountains', '24,open', 'civilized,building', 'ally,23,open', 'building,civilized', NULL, NULL, '<strong>Possessing Allies, last sentence of second paragraph:</strong> Should read, ''The overlord can only possess 1 ally and cannot possess an ally that has been cleansed.'' (page 34)', 5, 2),
(39, 'Tipping the Scales', NULL, 'Quest', 'Act 2', 'All', NULL, NULL, 'goldall,100', NULL, 'road,forest,plains,mountains', '20,open,open;replace,20,40,19', 'water,cold,hot,cursed', NULL, NULL, NULL, NULL, '<strong>Special Rules, first sentence:</strong> Should read, ''As an action, while adjacent to a faceup objective token, a hero that is not carrying an objective token may pick it up.'' (page 36)', 5, 2),
