(43, 'A Glimmer of Hope', NULL, 'Quest', 'Finale', 'Heroes', '39', NULL, NULL, NULL, 'road,forest,plains,mountains', '19,4,2,ally,10,open,open,open,open;replace,19,40,20;replace,2,37,999', 'mountain,cold,hot,water', NULL, NULL, NULL, NULL, '<strong>Monsters:</strong> Should read, ''Ariad. Lord Merick Farrow. Splig. Serena or Raythen. Zombies. 4 open groups.''<br /><br /><strong>Setup, fourth paragraph:</strong> Should read, ''Gather 1 red, 1 blue, 1 green, and 1 white objective token. Place 1 objective token faceup on each open monster group’s Monster card.''<br /><br /><strong>Magical Wards, third paragraph:</strong> Should read, ''At the end of each overlord turn, if there are no objective tokens on the map, place 1 fatigue token in the overlord’s play area.''<br /><br /><strong>Q:</strong> During setup of ''A Glimmer of Hope,'' where is the ally placed if playing with four heroes?<br /><strong>A:</strong> Place the ally in the closest empty space to the entrance, on the other side of the door.', 6, 2),
