(85, 'Acolyte of Saradyn', 'Goblins and barghests swarm a near-defenseless group of travelers. The heroes must cut off the monster reinforcements and break their morale before the beasts lay waste to the entire caravan.', 'Quest', 'Introduction', 'All', NULL, 'xp,1', 'special,25', NULL, NULL, '7,15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 29),
(86, 'Rellegar''s Rest', 'An enemy camp is positioned above the ancient tomb of Rellegar. Age-old knowledge and forgotten artifacts are hidden below, but can the heroes extract them before the ruins crumble away?', 'Quest', 'Act 1', 'All', '85', 'xp,1;specialrelic,4;relic,3', 'goldhero,25', NULL, 'road,road', '2,7,open', 'wilderness,water,building', '4,7,open', 'dark,building', NULL, NULL, NULL, NULL, 29),
(87, 'Siege of Skytower', 'The ancient bastion of Skytower overlooks the southern pass with unparalleled vigilance. However, when an enemy sabotages its gates, the almighty fortification provides little advantage over the invaders.', 'Quest', 'Act 1', 'All', '85', 'xp,1;specialrelic,3;relic,4', 'goldhero,25;special,25', NULL, 'road,forest,mountains', '4,6,7,9,open,opensmall', 'mountain,building,civilized', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(88, 'Blood Will Tell', 'The heroes rush to stop Lady Eliza''s dark ritual. Can they overcome the defensive wards and hordes of undying clambering from the ground before she finishes her spell?', 'Quest', 'Act 1', 'Unique1', '86', 'xp,1\r\n', 'goldhero,25;special,25', NULL, 'road,forest', '5,11,10,open,open,open', 'cursed,dark,cave', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(89, 'The Baron Returns', 'Baron Zachareth returns, weaving a mysterious spell of blood and suffering. The heroes must endure the barrage of hardships just long enough to thwart the Baron''s work.', 'Quest', 'Act 1', 'All', '86,87', 'xp,1;specialrelic,5', 'goldhero,25', NULL, 'road,water,forest,plains', '5,10,7,open', 'wilderness,building,cursed', '1,open,open,open', 'civilized,building,cave', NULL, NULL, NULL, NULL, 29),
(90, 'Archive of Arrizon', 'A deserter called Arrizon has retreated deep into an ancient archive. Can the heroes defend him until hiis mission is complete, or will Eliza find what she is looking for?', 'Quest', 'Act 1', 'Unique1', '87', 'xp,1', 'goldhero,25', NULL, 'road,water,forest,plains,plains', '8,open,open', 'building,wilderness,mountain,hot', '5,8,11,open,open,open', 'mountain,cave,hot,building,dark', NULL, NULL, NULL, NULL, 29),
(91, 'Rise of Urthko', 'A captain of evil is rising, a barghest infused with corrupting enchantements. Even as the heroes assault its lair, the beast grows and mutates into something beyond their ability.', 'Quest', 'Act 1', 'Overlord', '88,89,90', 'xp,1', 'goldhero,25', NULL, 'road,water,forest', '4,8,open', 'cave,cursed,hot', '3,15,8,opensmall', 'cave,cursed,dark', NULL, NULL, NULL, NULL, 29),
(92, 'Caladen''s Crossing', 'The village burns, and the heroes must hurry to quench its fires. As the battle progresses, it becomes clear that the overlord must sacrifice one of his greatest allies in order to succeed.', 'Quest', 'Act 1', 'Heroes', '88,89,90', 'xp,1;special,1;specialmonster,select', 'goldhero,25', NULL, 'road,road', '7,open,open', 'wilderness,cursed,civilized', '2,6,1,open,open,open,open,open', 'cursed,building,wilderness,mountain', NULL, NULL, NULL, NULL, 29),
(93, 'From the Wreckage', 'The heroes hatch a desperate plan. They will draw Eliza out and seek to understand her plans or slay her. She is growing in power, however, and not so easy to overcome.', 'Quest', 'Interlude', 'All', NULL, NULL, NULL, 6, 'road,road,water', '4,5,7,13,open,open,open', 'cursed,mountain,wilderness', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(94, 'Saradyn in Flames', 'Alric pursues the few remaining survivors through the burning monastery. As its walls and floors give way, the heroes must scramble to aid as many as they can in their escape.', 'Quest', 'Interlude', 'All', NULL, 'xp,1;relic,6', 'goldall,100', NULL, 'road,forest,mountains,mountains', '5,3,9,10,open,open', 'building,hot,cursed', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(95, 'Army of Dal''Zunm', 'Cursed invaders rise again, ready to renew their assault on the valley. Only the stakes of blackwood can seal this rising army back into the graves from which they came.', 'Quest', 'Act 2', 'Heroes', '93,94', 'xp,1;specialrelic,2', 'goldhero,25;special,25', NULL, 'road,road,road', '2,6,1,10,8,open', 'wilderness,water,dark,cursed', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(96, 'Prison of Khinn', 'The lair of Eliza is guarded by watchful specters and endless patrols. With stealth and haste, the heroes must find the information they are looking for before the alarm is raised.', 'Quest', 'Act 2', 'Overlord', '93,94', 'xp,1;specialrelic,5', 'goldhero,25', NULL, 'road,water,road', '10,9,open', 'building,wilderness,cursed', '2,6,1,10,9,open,open,open', 'building,cave,cursed,dark', NULL, NULL, NULL, NULL, 29),
(97, 'Lord of Flame', 'Lord Merick Farrow has initiated negotiations with a primal force slightly beyond his power. As long as no one interferes, however, he is sure he can gain the support of these creatures.', 'Quest', 'Act 2', 'Heroes', '95', 'xp,1', 'blockmonster,12', NULL, 'road,water,road,mountains,mountains', '4,11,open', 'mountain,building,hot,cold', '4,12,open', 'cave,water,hot,cold', NULL, NULL, NULL, NULL, 29),
(98, 'Dead or Drowning', 'The stone wall between the refugees and the undying army offers little aid when the dead start rising from within the camp. If their assault is not soon stopped, only the dead will remain.', 'Quest', 'Act 2', 'Overlord', '95', 'xp,1', 'goldhero,25', NULL, 'road,road,road,plains', '10,9,open', 'mountain,building,water,wilderness', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(99, 'Rite of the Red Dawn', 'A ritual so evil it is never written down - who can foil such power? If the heroes can disrupt the dark lords and survive the primordial defenders, they may be able to save the child within.', 'Quest', 'Act 2', 'Heroes', '96', 'xp,1', 'goldhero,25', NULL, 'water,forest', '7,11,10,5,open,open,open,open', 'all', NULL, NULL, NULL, NULL, NULL, NULL, 29),
(100, 'Shadowfall Mountain', 'The dragons of Shadowfall have been recruited by Sir Alric. To break the treaty, the heroes must slay the dragon''s leader... but first they must break through the horde that guards his lair.', 'Quest', 'Act 2', 'Overlord', '96', 'xp,1', 'goldhero,25;blockmonster,14', NULL, 'road,water,road,mountains', '9,7,10,11,15', 'all', '12,8,13,14', 'all', NULL, NULL, NULL, NULL, 29),
(101, 'Edge of Dawn', 'The valley has descended into darkness and only the Dawnblade can break the curse. Sir Alric and Lord Merick are aware of this, however, and are ready to claim the sword themselves.', 'Quest', 'Act 2', 'All', '97,98,99,100', NULL, NULL, 1, 'water,plains', '3,9,7,open', 'building,wilderness,dark', '3,4,15,11,open,open', 'building,cursed,civilized,cave', NULL, NULL, NULL, NULL, 29),
(102, 'Piercing Darkness', 'Beneath the ground sleeps a guardian that could aid against Eliza''s army. However, Lord Merick has acquired the power to slay the ageless champion, and the heroes must hurry to raise him.', 'Quest', 'Act 2', 'All', '97,98,99,100', NULL, NULL, 1, 'road,road,water,forest', '15,8,7,open', 'building,wilderness,cave', '3,4,11,open,open', 'building,cursed,civilized', NULL, NULL, NULL, NULL, 29),
(103, 'Blood and Betrayal', 'The remnants of both armies have gathered and the final battle begins. The last defenders of Saradyn charge forward into the hordes of darkness. Deep underground, Eliza has begun her spell, ready to claim the power and authority of the lost kingdom of Saradyn.', 'Quest', 'Finale', 'All', NULL, NULL, NULL, NULL, 'road,water,forest,plains,plains', '1,6,2,10,12,open,open,open,open', 'building,wilderness,cursed', '4,3,5,9,open,open,open,open', 'cave,building,dark,cursed', '5,4,3,14,10,11,open,open,open,open;replace,14,100,999', 'cave,building,dark,cursed', NULL, NULL, 29),
