INSERT INTO `tbskills` (`skill_id`, `skill_name`, `skill_type`, `skill_class`, `skill_special`, `skill_text`, `skill_plot`, `skill_cost`, `skill_stamina_cost`, `skill_expansion`) VALUES
(1, 'Accurate', 'Scout', 'Wildlander', NULL, 'Each time you perform an attack with a Bow, you may reroll 1 power die (limit once per attack).', 0, 1, 0, '0'),
(2, 'Nimble', 'Scout', 'Wildlander', NULL, 'Each time a monster moves into a space adjacent to you, you may use this card to move 1 space; then the monster may continue its activation.', 0, 0, 1, '0'),
(10, 'Brute', 'Warrior', 'Berserker', 'health,4', 'You gain +4 Health.<br /><br />Whenever you stand up or are revived by another hero, you recover 2 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 0, '0'),
(11, 'Raise Dead', 'Mage', 'Necromancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Place your Reanimate familiar token in an empty space adjacent to you.<br /><br />You may only control 1 Reanimate at a time.<br />You may discard your Reanimate token at any time during your turn.', 0, 0, 1, '0'),
(13, 'Runic Knowledge', 'Mage', 'Runemaster', NULL, 'While you have a Magic or Rune weapon equipped, each of your attacks gains:<br :><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Suffer 1 Fatigue to gain +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 0, 0, '0'),
(14, 'Prayer of Healing', 'Healer', 'Disciple', NULL, 'Exhaust this card during your turn and choose yourself or an adjacent hero. Roll 1 red power die. The chosen hero recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 0, 0, 1, '0'),
(15, 'Armor of Faith', 'Healer', 'Disciple', NULL, 'Each time you use Prayer of Healing on a hero, that hero adds 1 additional brown die to his defense pool until the start of your next turn.<br /><br />Place a hero token belonging to that hero on this card as a reminder.', 0, 1, 0, '0'),
(16, 'Blessed Strike', 'Healer', 'Disciple', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Melee weapon. if you deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), you and 1 hero of your choice recover 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 1, '0'),
(17, 'Cleansing Touch', 'Healer', 'Disciple', NULL, 'Each time you use Prayer of Healing on a hero, that hero may also discard 1 of his Condition cards.', 0, 1, 0, '0'),
(18, 'Divine Fury', 'Healer', 'Disciple', NULL, 'Each time you use your Prayer of Healing on a hero, that hero adds 1 additional yellow power die to his attack pool on his next attack this round.<br /><br />Place a hero token belonging to that hero on this card as a reminder.', 0, 2, 0, '0'),
(19, 'Prayer of Peace', 'Healer', 'Disciple', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card.<br />While this card is exhausted, monsters cannot perform and attack while adjacent to you.', 0, 2, 2, '0'),
(20, 'Time of Need', 'Healer', 'Disciple', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: You receive 2 movement points and recover 2 Fatigue.', 0, 2, 0, '0'),
(21, 'Holy Power', 'Healer', 'Disciple', NULL, 'Your Prayer of Healing may now affect 2 different heroes. If you roll a <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> on the red power die when using Prayer of Healing, both heroes recover 1 Fatigue.', 0, 3, 0, '0'),
(22, 'Radiant Light', 'Healer', 'Disciple', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Roll 1 red power die.<br />Each hero in your line of sight (including yourself) recovers the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled. Each monster in your line of sight suffers the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 0, 3, 3, '0'),
(25, 'Danger Sense', 'Scout', 'Wildlander', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to force the overlord to discard 1 Overlord card from his hand at random.', 0, 1, 2, '0'),
(26, 'Eagle Eyes', 'Scout', 'Wildlander', NULL, 'When you perform an attack with a Bow, friendly figures do not block your line of sight.', 0, 1, 0, '0'),
(27, 'Bow Mastery', 'Scout', 'Wildlander', NULL, 'When you attack with a Bow, you may exhaust this card to add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 0, 2, 0, '0'),
(28, 'First Strike', 'Scout', 'Wildlander', NULL, 'During the overlord''s turn, immediately after he chooses a monster to active, you may exhaust this card to perform an attack targeting that monster with a Bow. After this attack is resolved, if the monster was not defeated, it may continue its activation.', 0, 2, 2, '0'),
(29, 'Fleet of Foot', 'Scout', 'Wildlander', NULL, 'Each time you suffer 1 Fatigue to gain 1 movement point, you instead receive 2 movement points.<br /><br />Each time you use Nimble, you may move 2 spaces instead of 1.', 0, 2, 0, '0'),
(30, 'Black Arrow', 'Scout', 'Wildlander', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Bow. This attack gains +2 range.<br /><br />If you deal less than 3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), deal 3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead (unless this attack misses).', 0, 3, 1, '0'),
(31, 'Running Shot', 'Scout', 'Wildlander', NULL, 'Each time you perform an attack with a Bow, you receive 2 movement points before or after the attack.<br /><br />If you have Heavy Armor equipped, you receive only 1 movement point before of after the attack.', 0, 3, 0, '0'),
(32, 'Counter Attack', 'Warrior', 'Berserker', NULL, 'After an adjacent monster resolves an attack that affects you, exhaust this card to perform an attack with a Melee against the attacking monster. After this attack is resolved, if the monster was not defeated, it may continue its activation.', 0, 1, 1, '0'),
(33, 'Rage', 'Warrior', 'Berserker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Melee weapon.<br /> This attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 0, 1, '0'),
(35, 'Cripple', 'Warrior', 'Berserker', NULL, 'Exhaust this card during your turn to choose a monster adjacent to you and test Might. If you pass, the monster is Immobilized.', 0, 1, 2, '0'),
(36, 'Charge', 'Warrior', 'Berserker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Move up to your Speed and then perform an attack with a Melee weapon.', 0, 2, 2, '0'),
(37, 'Weapon Mastery', 'Warrior', 'Berserker', NULL, 'Each time you perform an attack with either 1 Melee weapon with 2 hand icons or 2 Melee weapons with 1 hand icon each, you may exhaust this card to add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 0, 2, 0, '0'),
(38, 'Whirlwind', 'Warrior', 'Berserker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Melee weapon targeting all adjacent monsters. You make 1 attack roll and each monster rolls its defense dice separately.', 0, 2, 1, '0'),
(39, 'Death Rage', 'Warrior', 'Berserker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Melee weapon.<br />This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for every 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on your Hero sheet', 0, 3, 2, '0'),
(40, 'Execute', 'Warrior', 'Berserker', NULL, 'When performing an attack with a Melee weapon, after the dice are rolled, exhaust this card to gain +X <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, where X is the amount of Fatigue suffered to use this skill.', 0, 3, 10, '0'),
(43, 'Corpse Blast', 'Mage', 'Necromancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack targeting your Reanimate''s space with a Magic weapon. This attack gains Blast. You do not need line of sight to the space. After the attack is resolved, the Reanimate is defeated.', 0, 1, 1, '0'),
(44, 'Fury of Undeath', 'Mage', 'Necromancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to activate your Reanimate.<br />Your Reanimate still activates this turn as normal.', 0, 1, 1, '0'),
(45, 'Deathly Haste', 'Mage', 'Necromancer', NULL, 'Each time you suffer 1 Fatigue to gain 1 movement point, you mayyou may move your Reanimate 1 space.', 0, 1, 0, '0'),
(46, 'Dark Pact', 'Mage', 'Necromancer', NULL, 'Your Reanimate adds 1 additional brown die to its defense pool.<br /><br />Each time you suffer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, you may choose to have your Reanimate suffer all of the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead. Each time your Reanimate suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, you may choose to suffer all of the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead.', 0, 2, 0, '0'),
(47, 'Vampiric Blood', 'Mage', 'Necromancer', NULL, 'Your Reanimate adds 1 additional yellow power die to its attack pool.<br /><br />Each time you or your Reanimate defeats a monster, you recover 1 Fatigue.', 0, 2, 0, '0'),
(48, 'Undead Might', 'Mage', 'Necromancer', NULL, 'Your Reanimate gains +2 Health, even when this card is exhausted.<br /><br />Exhaust this card when your Reanimate attacks a monster. This attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 1, '0'),
(49, 'Army of Death', 'Mage', 'Necromancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with your Reanimate.<br />This attack affects each monster in your line of sight, ignoring range; your Reanimate does not need line of sight to the affected monsters but does need to be on the map.', 0, 3, 2, '0'),
(50, 'Dying Command', 'Mage', 'Necromancer', NULL, 'When you or your Reanimate defeats a monster, exhaust this card to test Knowledge. If you fail, recover 1 Fatigue. If you pass, return that monster to the map. Then move the monster up to its Speed and perform an attack with it. Then remove the monster from the map.', 0, 3, 2, '0'),
(51, 'Soothing Insight', 'Healer', 'Prophet', NULL, 'Exhaust this card during your turn. You or 1 hero of your choice gains the insight token.<br /><br />When a hero gains the insight token, he recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue. A hero with the insight token may discard it during his turn to recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 0, 1, '0'),
(52, 'Battle Vision', 'Healer', 'Prophet', 'awareness,1', 'You gain +1 Awareness up to a maximum of 6.<br /><br />Each hero within 2 spaces of the hero with the insight token may suffer 2 Fatigue to reroll 1 attack die once on each attack.', 0, 1, 0, '0'),
(53, 'Forewarning', 'Healer', 'Prophet', NULL, 'Exhaust this card when a monster attacks a hero with the insight token, after rolling dice. Discard the insight token to add 2 Shields to his results.', 0, 1, 1, '0'),
(54, 'Grim Fate', 'Healer', 'Prophet', NULL, 'A hero with the insight token may suffer 2 Fatigue and exhaust this card during his turn to force the overlord to reveal the top card of the Overlord deck.<br /><br />That hero forces the overlord to place the revealed card either on the top or the bottom of the Overlord deck.', 0, 1, 0, '0'),
(55, 'All-Seeing', 'Healer', 'Prophet', NULL, 'Exhaust this card when the insight token is discarded. Another hero of your choice gains the insight token.', 0, 2, 1, '0'),
(56, 'Lifeline', 'Healer', 'Prophet', NULL, 'Exhaust this card when a hero with the insight token would be defeated.<br />Discard the insight token for that hero to immediately recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 2, '0'),
(57, 'Victory Foretold', 'Healer', 'Prophet', NULL, 'Exhaust this card when a hero with the insight token attacks a monster, before rolling dice.<br />Discard the insight token for that hero to roll an additional green power die on the attack<br /><br />If the monster is defeated the hero recovers 3 <span class=''glyphicon glyphicon-heartt'' aria-hidden=''true''></span>.', 0, 2, 2, '0'),
(58, 'Focused Insights', 'Healer', 'Prophet', 'health,2', 'You gain +2 Health.<br /><br />When a hero gains the insight token, each hero adjacent to that hero recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 0, 3, 0, '0'),
(59, 'Omniscience', 'Healer', 'Prophet', NULL, 'Exhaust this card when a monster declares a hero with the insight token as the target of an attack, before rolling dice.<br />Discard the insight token to cause the attack to automatically miss.', 0, 3, 3, '0'),
(60, 'Brew Elixir', 'Healer', 'Apothecary', NULL, 'Exhaust this card during your turn. Choose yourself or an adjacent hero to gain 1 elixir token.<br /><br />Once during his turn, a hero may discard 1 elixir token to roll 1 red power die and recover <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 0, 0, 1, '2'),
(61, 'Concoction', 'Healer', 'Apothecary', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack. If you have at least 1 elixir token, add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results. This attack gains:<br />Pierce 1<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 1, 1, '2'),
(62, 'Herbal Lore', 'Healer', 'Apothecary', NULL, 'Exhaust this card when a hero discards 1 elixir token. In addition to any other effect from the discarded elixir token, the hero may also discard 1 of his Condition cards.', 0, 1, 0, '2'),
(63, 'Inky Substance', 'Healer', 'Apothecary', NULL, 'Exhaust this card to choose 1 monster within 3 spaces of you and place an elixir token on it.<br /><br :>A hero targeting that monster with an attack may discard the elixir token, before his attack roll, to add 1 additional green power die to his attack pool.', 0, 1, 1, '2'),
(64, 'Bottled Courage', 'Healer', 'Apothecary', NULL, 'Exhaust this card during your turn to perform an attack. This attack does not require an action. If you deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), choose yourself or an adjacent hero to gain 1 elixir token.', 0, 2, 2, '2'),
(65, 'Protective Tonic', 'Healer', 'Apothecary', NULL, 'Exhaust this card immediately after a hero discards an elixir token to place 1 of his hero tokens on this card.<br /><br />A hero may discard 1 of his hero tokens from this card, before rolling defense dice, to add 1 gray die to his defense pool.', 0, 2, 1, '2'),
(66, 'Secret Formula', 'Healer', 'Apothecary', 'health,2', 'You gain +2 Health, even while this card is exhausted.<br /><br />Exhaust this card when a hero with an elixir token declares the target for an attack. he may add 1 additional green die to his attack pool and the attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 2, 1, '2'),
(67, 'Hidden Stash', 'Healer', 'Apothecary', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card. You and each adjacent hero gain 1 elixir token.', 0, 3, 2, '2'),
(68, 'Potent Remedies', 'Healer', 'Apothecary', NULL, 'When a hero discards an elixir token, he may roll 1 additional green power die and recover Fatigue equal to the <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> rolled, in addition to any <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> recovered (even if this card is exhausted).<br /><br />You may exhaust this card to revive an adjacent hero withour using an action.', 0, 3, 0, '2'),
(69, 'Stoneskin', 'Healer', 'Spiritspeaker', NULL, 'When you or a hero adjacent to you is attacked, before dice are rolled, exhaust this card to add 1 additional gray dice to that hero''s defense pool.', 0, 0, 1, '0'),
(70, 'Drain Spirit', 'Healer', 'Spiritspeaker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack. If you deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), each hero within 3 spaces of you (including yourself) recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 1, 1, '0'),
(71, 'Healing Rain', 'Healer', 'Spiritspeaker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Roll 1 red power die. Each hero within 3 spaces of you (including yourself) recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 0, 1, 2, '0'),
(72, 'Shared Pain', 'Healer', 'Spiritspeaker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack. If you deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), each other figure in the target''s monster group suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 1, 1, '0'),
(73, 'Cloud of Mist', 'Healer', 'Spiritspeaker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>Exhaust this card.<br />While this card is exhausted, each attack that targets a space within 3 spaces of you misses unless the attacker spends 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.', 0, 2, 1, '0'),
(74, 'Nature''s Bounty', 'Healer', 'Spiritspeaker', NULL, 'Each time you recover Fatigue by resting, you also recover <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the amount of Fatigue recovered.', 0, 2, 0, '0'),
(75, 'Tempest', 'Healer', 'Spiritspeaker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card and test Willpower. if you fail, recover 1 Fatigue. If you pass, each monster within 3 spaces of you suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and each hero within 3 spaces of you recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 2, '0'),
(76, 'Ancestor Spirits', 'Healer', 'Spiritspeaker', NULL, 'When a monster suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> due to 1 of your class skills, exhaust this card; That monster is Poisoned.<br /><br />When a hero recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or Fatigue due to 1 of your class skills, exhaust this card to allow that hero to recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 0, 3, 1, '0'),
(77, 'Vigor', 'Healer', 'Spiritspeaker', NULL, 'Each of your attacks gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Each hero recovers 1 Fatigue', 0, 3, 0, '0'),
(79, 'Terracall', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to place a Summoned Stone in an empty space within 3 spaces of you.<br /><br />While this card is exhausted, 1 of your Summoned Stones may perform an attack during its activation (using 1 of your equiped Magic weapons).', 0, 0, 1, '1'),
(80, 'Earthen Anguish', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to perform an attack with a Magic weapon targeting a space containing a Summoned Stone (ignoring range and line of sight). This attack gains Blast. After the attack is resolved, the Summoned Stone is defeated.', 0, 1, 1, '1'),
(81, 'Quaking Word', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon.<br />This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Each figure within 2 spaces of a Summoned Stone tests Awareness. Each figure that fails is Stunned.', 0, 1, 2, '1'),
(82, 'Stone Tongue', 'Mage', 'Geomancer', NULL, 'You may have 1 additional Summoned Stone on the map at a time.<br /><br />Your Summoned Stones now have a Speed of 3.<br /><br />In addition, each of your Summoned Stones adds 1 additional gray die to its defense pool.', 0, 1, 0, '1'),
(83, 'Ley Line', 'Mage', 'Geomancer', NULL, 'You may have 1 additional Summoned Stone on the map at a time.<br /><br />While you are within 3 spaces of any 2 Summoned Stones on the map, you may exhaust this card before any dice are rolled to either add 1 Shield to your defense results or 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to your attack results.', 0, 2, 0, '1'),
(84, 'Molten Fury', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon, measuring line of sight from a space containing a Summoned Stone. This attack gains:<br /><br />Burn<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Blast', 0, 2, 2, '1'),
(85, 'Ways of Stone', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to remove your figure from the map and place it in an empty space adjacent to a Summoned Stone.<br /><br />While this card is exhausted, each of your Summoned Stones may add 1 additional grey die to its defense pool.', 0, 2, 2, '1'),
(86, 'Gravity Spike', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to choose a monster group. Move each figure of that group up to 2 spaces toward a Summoned Stone. Each figure that ends this movement adjacent to a Summoned Stone suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 3, 2, '1'),
(87, 'Cataclysm', 'Mage', 'Geomancer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card. For each Summoned Stone on the map, perform 1 attack with a Magic weapon, measuring line of sight from a space containing a Summoned Stone. After the attack is resolved, the Summoned Stone is defeated.', 0, 3, 2, '1'),
(88, 'Enfeebling Hex', 'Mage', 'Hexer', NULL, 'While you have a Magic weapon equipped, each of your attacks gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Hex 1 monster within 3 spaces of your target<br /><br :>When performing an attack targeting a hexed monster, a hero may discard any number of hex tokens before spending <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.<br />The attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each hex token discarded.', 0, 0, 0, '2'),
(89, 'Affliction', 'Mage', 'Hexer', NULL, 'Exhaust this card when a hexed monster declares a move action and discard 1 hex token from that monster. That monster immediately suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. In addition, that monster suffers 1 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each space it moves during its activation.', 0, 1, 1, '2'),
(90, 'Plague Spasm', 'Mage', 'Hexer', NULL, 'Exhaust this card when a hexed monster declares an attack, before dice are rolled, and discard 1 hex token from that monster.<br />The target of its attack may add 1 black die to his defense pool.', 0, 1, 1, '2'),
(91, 'Viral Hex', 'Mage', 'Hexer', NULL, 'Exhaust this card during your turn to take a number of hex tokens equal to the number of hexed monsters within 3 spaces of you. You may place each hex token on a monster of your choice within 3 spaces of you.', 0, 1, 1, '2'),
(92, 'Crippling Curse', 'Mage', 'Hexer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to choose any number of hexed monsters. For each monster chosen, test Knowledge. For each test you pass, you may choose 1 condition for the corresponding monster to suffer.', 0, 2, 2, '2'),
(93, 'Fel Command', 'Mage', 'Hexer', NULL, 'Exhaust this card when the hero chooses a hexed monster to activate.<br />Discard 1 hex token from that monster to immediately perform an attack with it. You make all choices during the attack. After the attack is resolved, the monster activates as normal.', 0, 2, 2, '2'),
(94, 'Internal Rot', 'Mage', 'Hexer', NULL, 'Each time a monster becomes hexed, you may place 1 additional hex token on that monster.<br /><br />Each of your attacks with a Magic weapon targeting a hexed monster gains Pierce 2.', 0, 2, 0, '2'),
(95, 'Accursed Arms', 'Mage', 'Hexer', NULL, 'Exhaust this card during your turn to choose 1 hero adjacent to a hexed monster. The chosen hero may immediately perform 1 attack targeting a hexed monster.', 0, 3, 2, '2'),
(96, 'Plague Cloud', 'Mage', 'Hexer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon. This attack targets each hexed monster in your line of sight and ignores range. Each figure rolls defense dice seperately. Before rolling dice for the attack, each monster adjacent to a target monster is hexed.', 0, 3, 3, '2'),
(98, 'Exploding Rune', 'Mage', 'Runemaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Rune weapon.<br :>The attack gains Blast.', 0, 1, 1, '0'),
(99, 'Ghost Armor', 'Mage', 'Runemaster', NULL, 'After you roll defense dice when attacked, use this card to add 1 Shield to the results.', 0, 1, 1, '0'),
(100, 'Inscribe Rune', 'Mage', 'Runemaster', NULL, 'Any weapon you equip gains the Rune trait while equipped.', 0, 1, 0, '0'),
(101, 'Iron Will', 'Mage', 'Runemaster', 'stamina,1', 'You gain +1 Stamina.<br /><br />Each time you spend 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> during an attack to recover 1 Fatigue , you instead recover 2 Fatigue.', 0, 2, 0, '0'),
(102, 'Rune Mastery', 'Mage', 'Runemaster', NULL, 'When you attack with a Rune weapon, you may exhaust this card to add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 0, 2, 0, '0'),
(103, 'Runic Sorcery', 'Mage', 'Runemaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Rune weapon.<br />If this attack deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dive), choose 1 condition. The target suffers the chosen condition.', 0, 2, 1, '0'),
(104, 'Break the Rune', 'Mage', 'Runemaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Rune weapon. This attack ignores range and targets each monster and hero figure within 3 spaces of you in your line of sight. Each figure rolls defense dice separately.<br /><br />This attack cannot be affected by Blast.', 0, 3, 4, '0'),
(105, 'Quick Casting', 'Mage', 'Runemaster', NULL, 'After you perform an attack with a Rune weapon, exhaust this card to immediately perform an additional attack.', 0, 3, 2, '0'),
(106, 'Exploit', 'Scout', 'Stalker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack.<br />If this attack targets a monster within 3 spaces of a trap token, add 1 additional green power die to your attack pool.<br /><br />This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: The target is Weakened (even if you didn''t deal any <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>)', 0, 1, 1, '3'),
(107, 'Hunter''s Mark', 'Scout', 'Stalker', NULL, 'Exhaust this card during your turn to choose a monster within 3 spaces of a trap token and place 1 of your hero tokens on that monsters base, indicating that it is marked.<br /><br />The next hero to attack a marked monster adds 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to his attack results.', 0, 1, 1, '3'),
(108, 'Makeshift Trap', 'Scout', 'Stalker', NULL, 'Exhaust this card immediately after performing a search action to place 1 trap token in an empty space adjacent to you.<br /><br />While this card is exhausted, each hero adjacent to a trap token recovers 1 Fatigue at the start of his turn.', 0, 1, 0, '3'),
(109, 'Easy Prey', 'Scout', 'Stalker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to perform an attack.<br />Before rolling dice, place 1 trap token in the closest empty space adjacent to the target. While this card is exhausted, each attack targeting a monster adjacent to a trap token gains Pierce 1.', 0, 2, 1, '3'),
(110, 'Lay of the Land', 'Scout', 'Stalker', NULL, 'Any hero adjacent to a search token and within 3 spaces of a trap token during their turn may suffer 1 Fatigue to exhaust this card and search the search token without using an action.', 0, 2, 0, '3'),
(111, 'Poison Barbs', 'Scout', 'Stalker', NULL, 'Exhaust this card during your turn to choose a trap token on the map.<br /><br />Roll the blue attack die for each monster within 3 spaces of the chosen trap token. Each time you do not roll an X, the monster is Poisoned.<br /><br />Then, discard the trap token.', 0, 2, 2, '3'),
(112, 'Ambush', 'Scout', 'Stalker', NULL, 'Exhaust this card when a monster enters an empty space within 3 spaces of a trap token to immediately perform an attack targeting that monster.<br /><br />After the attack is resolved, if the monster was not defeated, it may continue its activation.', 0, 3, 1, '3'),
(113, 'Upper Hand', 'Scout', 'Stalker', 'health,2;stamina,1', 'You gain +1 Stamina and +2 Health.<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack.<br />Before rolling dice, you may discard any number of trap tokens from the map. For each trap token discarded from the map, this attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 3, 2, '3'),
(115, 'Set Trap', 'Scout', 'Stalker', NULL, 'Exhaust this card to place 1 trap token in an empty space adjacent to you.<br /><br />While you are adjacent to a trap token, each of your attacks gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br />If a monster enters a space adjacent to a trap token, discard the trap token from the map and that monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 0, 1, '3'),
(116, 'Greedy', 'Scout', 'Thief', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Search a search token within 3 spaces of you.', 0, 0, 1, '0'),
(117, 'Appraisal', 'Scout', 'Thief', NULL, 'After you draw a Search card, you may discard it to draw a new Search card.<br :>You must keep the second card.', 0, 1, 0, '0'),
(118, 'Dirty Tricks', 'Scout', 'Thief', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Melee or Blade weapon. If the attack deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), the target is Stunned.', 0, 1, 1, '0'),
(119, 'Sneaky', 'Scout', 'Thief', NULL, 'You gain +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on attacks against monsters that did not have line of sight of you at the start of your turn (even if this card is exhausted).<br :><br />You may exhaust this card to perform an open or close a door action without using an action.', 0, 1, 0, '0'),
(120, 'Caltrops', 'Scout', 'Thief', NULL, 'When a monster moves into an empty space adjacent to you, exhaust this card to test Awareness. If you pass, the monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and is Immobilized.', 0, 2, 1, '0'),
(121, 'Tumble', 'Scout', 'Thief', NULL, 'Exhaust this card during your turn. While this card is exhausted, you may move through enemy figures.', 0, 2, 1, '0'),
(122, 'Unseen', 'Scout', 'Thief', NULL, 'Exhaust this card during your turn. While this card is exhausted, each attack that targets you misses unless the attacker spends 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.', 0, 2, 2, '0'),
(123, 'Bushwhack', 'Scout', 'Thief', NULL, 'Exhaust this card during your turn to attack a monster that is the only monster in your line of sight. This attack does not require an action.', 0, 3, 1, '0'),
(124, 'Lurk', 'Scout', 'Thief', NULL, 'Exhaust this card during your turn to perform a search action; this does not require an action. While this card is exhausted, add 1 additional brown die to your defense pool.', 0, 3, 1, '0'),
(125, 'Delver', 'Scout', 'Treasure Hunter', NULL, 'If you are not adjacent to any other hero, each of your attacks gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Each time you would draw a Seach card, instead draw 2 and choose 1 to keep. Then place the other Search card either on top or bottom of the Search deck.', 0, 0, 0, '2'),
(126, 'Dungeoneer', 'Scout', 'Treasure Hunter', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to perform a search action. While this card is exhausted, you may perform 1 attack during your turn without using an action.', 0, 1, 1, '2'),
(127, 'Gold Rush', 'Scout', 'Treasure Hunter', NULL, 'Exhaust this card during your turn immediately after performing a search action to gain movement points equal to the number of Search cards you have (facedown or faceup), up to a maximum of 5.<br /><br />While this card is exhausted, you may move through enemy figures.', 0, 1, 0, '2'),
(128, 'Survey', 'Scout', 'Treasure Hunter', 'stamina,1', 'You gain +1 Stamina, even while this card is exhausted.<br /><br />Exhaust this card during your turn to look at the top 3 cards of the Search deck. You may return the cards to the top of the search deck in any order you choose.', 0, 1, 1, '2'),
(129, 'Guard the Spoils', 'Scout', 'Treasure Hunter', NULL, 'Exhaust this card when you are targeted by an attack, before dice are rolled. Add the following dice to your defense pool, depending on how many Search cards you have:<br /><br/>0-1 Search cards: 1 brown<br /><br />2 Search cards: 1 gray<br /><br />3+Search cards: 1 black', 0, 2, 1, '2'),
(130, 'Lure of Fortune', 'Scout', 'Treasure Hunter', NULL, 'Each time you perform a search action, you recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue. <br /><br />Additionally, each time you defeat a monster you may move the top card of the Search deck to the bottom of the deck without looking at it.', 0, 2, 0, '2'),
(131, 'Sleight of Hand', 'Scout', 'Treasure Hunter', NULL, 'While you have an Exotic or Bow weapon equiped, each of your attacks gains Pierce 2 (even while this card is exhausted).<br /><br />When another hero draws a Search card, exhaust this card to allow him to immediately give the Search card to you.', 0, 2, 0, '2'),
(132, 'Finder''s Keepers', 'Scout', 'Treasure Hunter', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with an Exotic weapon, adding 1 additional green power die to your attack pool. This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each Search card you have (facedown or faceup), up to a maximum of +4 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 3, 1, '2'),
(133, 'Trail of Riches', 'Scout', 'Treasure Hunter', NULL, 'If you have 2 or more Search cards in front of you (facedown or faceup), you may exhaust this card to search a search token within 3 spaces of you without using an action.', 0, 3, 1, '2'),
(135, 'Bound by the Hunt', 'Warrior', 'Beastmaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Place your Wolf familiar token in an empty space adjacent to you.<br /><br />You may control 1 Wolf at a time. You may discard your Wolf familiar token at any time during your turn.', 0, 0, 1, '2'),
(136, 'Bestial Rage', 'Warrior', 'Beastmaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack. If you are adjacent to your Wolf, you may reroll 1 attack die.<br /><br />This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Roll 1 red power die and add the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled to your attack results', 0, 1, 2, '2'),
(137, 'Stalker', 'Warrior', 'Beastmaster', NULL, 'Immediately after declaring the target of your attack, you may move your Wolf 1 space.<br /><br />Additionally, a monster cannot declare your Wolf as the target of an attack if it could legally target a hero figure instead.', 0, 1, 0, '2'),
(138, 'Survivalist', 'Warrior', 'Beastmaster', 'health,2', 'You gain +2 Health.<br /><br :>Each hero adjacent to your Wolf adds 1 additional brown die to his defence pool.<br :><br />While your Wolf is adjacent to a hero, your Wolf adds 1 additional brown die to its defense pool.', 0, 1, 0, '2'),
(139, 'Feral Frenzy', 'Warrior', 'Beastmaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to perform an attack. After resolving the attack, your Wolf may immediately perform an attack.<br /><br />While this card is exhausted, each hero attacking a monster adjacent to you or your Wolf may add 1 green power die to his attack pool.', 0, 2, 2, '2'),
(140, 'Savagery', 'Warrior', 'Beastmaster', NULL, 'Each time a hero performs an attack that targets a monster adjacent to your Wolf, he may add 1 additional green power die to his attack pool. Each time your Wolf performs an attack that targets a monster adjacent to a hero figure, your Wolf may add 1 additional green power die to its attack pool.', 0, 2, 0, '2'),
(141, 'Shadow Hunter', 'Warrior', 'Beastmaster', NULL, 'Your Wolf adds 1 additional gray die to its defense pool.<br /><br />Before activating your Wolf, perform and attack with it, rolling the dice shown below. Then your Wolf is defeated.<br /><br />Melee attack with 2 red, 2 green power dice', 0, 2, 0, '2'),
(142, 'Changing Skins', 'Warrior', 'Beastmaster', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to perform an attack as if you occupied your Wolf''s space.<br /><br />While this card is exhausted, each attack you or your Wolf performs gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Pierce 2<br/><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +5 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 3, 0, '2'),
(143, 'Predator', 'Warrior', 'Beastmaster', 'health,4', 'You and your Wolf each gain +4 Health.<br /><br />Whenever you stand up or are revived by another hero, you recover 2 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Your Wolf''s attacks gain:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span><br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: You recover 1 Fatigue', 0, 3, 0, '2'),
(144, 'Valor of Heroes', 'Warrior', 'Champion', NULL, 'Each time you defeat a monster with an attack using a Melee weapon, gain 1 valor.<br /><br />Before rolling his attack dice, a hero may spend 1 valor to add 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to his attack results (limit once per attack).', 0, 0, 0, '1'),
(145, 'A Living Legend', 'Warrior', 'Champion', NULL, 'Exhaust this card when you would suffer any amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (from any source). you may spend up to 3 valor to reduce the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> suffered by 1 for each valor spent.', 0, 1, 1, '1'),
(146, 'Glory of Battle', 'Warrior', 'Champion', NULL, 'Each time you defeat a monster, each other hero within 3 spaces of you gains 1 valor.<br /><br />Before rolling his defense dive, a hero may spend 1 valor to add 1 Shield to his defense results (limit once per defense roll).', 0, 1, 0, '1'),
(147, 'Inspiring Presence', 'Warrior', 'Champion', NULL, 'You may spend 1 valor to allow a hero within 3 spaces of you to reroll a failed Willpower test (once per Willpower test).<br /><br />Each time a hero within 3 spaces of you (including yourself) performs an attack, his attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Gain 1 valor', 0, 1, 0, '1'),
(148, 'Motivating Charge', 'Warrior', 'Champion', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to move up to your Speed and perfrom an attack with a Melee weapon.<br /><br />If this attack defeats a monster, each hero within 3 spaces of you (including yourself) may either gain 1 valor or recover 1 Fatigue.', 0, 2, 2, '1'),
(149, 'No Mercy', 'Warrior', 'Champion', NULL, 'After the overlord completes a monster group''s activation, a hero within 3 spaces of you (including yourself) may spend 2 valor to exhaust this card and immediately perform an attack.', 0, 2, 0, '1'),
(150, 'Stoic Resolve', 'Warrior', 'Champion', NULL, 'Each time you or a hero within 3 spaces of you spends any number of valor, you or 1 hero adjacent to you may recover 1 Fatigue.', 0, 2, 0, '1'),
(151, 'For the Cause', 'Warrior', 'Champion', 'defense,B', 'Add 1 brown die to your defense pool (even if this card is exhausted).<br /><br />Exhaust this card when a monster declares an attack targeting you or a hero adjacent to you and spend any number of valor. For each valor spent, add 1 gray die to the target hero''s defense pool.', 0, 3, 1, '1'),
(152, 'Valorous Strike', 'Warrior', 'Champion', NULL, 'Each time you gain valor, you may instead place a damage token on this card.<br /><br />After one of your attacks with a Melee weapon deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after rolling defense dice), you may exhaust this card to deal +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each damage token on this card.<br /><br :>Then, discard all damage tokens from this card.', 0, 3, 0, '1'),
(153, 'Oath of Honor', 'Warrior', 'Knight', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Choose another hero within 3 spaces of you who has a monster adjacent to him. Place your figure in the closest empty space adjacent to the monster and perfrom an attack with a Melee weapon against that monster.', 0, 0, 1, '0'),
(154, 'Advance', 'Warrior', 'Knight', NULL, 'After defeating a monster with an attack using a Melee weapon, exhaust this card to move up to your Speed and perform an additional attack.', 0, 1, 1, '0'),
(155, 'Challenge', 'Warrior', 'Knight', NULL, 'Exhaust this card to choose a monster in your line of sight and place your hero token on it. While this card is exhausted, each attack performed by you or the monster, when targeting each other gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 0, 1, 0, '0'),
(156, 'Defend', 'Warrior', 'Knight', NULL, 'When a hero adjacent to you is targetted by an attack, use this card to instead declare yourself as the target of the attack. Range and line of sight are still measured to the targetted hero''s space.', 0, 1, 1, '0'),
(157, 'Defense Training', 'Warrior', 'Knight', 'defshield,B', 'As long as you have a Shield equipped, add 1 additional brown die to your defense pool (even if this card is exhausted).<br /><br />When you would exhaust your equipped Shield (such as to use the Shield''s ability), you may exhaust this card instead.', 0, 2, 0, '0'),
(158, 'Guard', 'Warrior', 'Knight', NULL, 'When a monster moves into an empty space adjacent to you, exhaust this card to interrupt that monster''s activation and perform an attack with a Melee weapon. After this attack is resolved, iif the monster was not defeated, it may continue it''s activation.', 0, 2, 2, '0'),
(159, 'Shield Slam', 'Warrior', 'Knight', NULL, 'While you have a Shield equipped (even if exhausted), each of your attacks with a Melee weapon gain:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Choose a monster adjacent to you. That monster is Stunned', 0, 2, 0, '0'),
(160, 'Inspiration', 'Warrior', 'Knight', NULL, 'At the start of your turn, if you are adjacent to at least one other hero, you and each other hero adjacent to you recover 1 Fatigue.', 0, 3, 0, '0'),
(161, 'Stalwart', 'Warrior', 'Knight', 'health,2', 'You gain +2 Health.<br /><br />When you are defeated, you may immediately move up to your Speed and perform an attack with a Melee weapon.<br />After the attack is resolved, you are knocked out.', 0, 3, 0, '0'),
(162, 'Bloodlust', 'Overlord', 'Warlord', NULL, 'Play htis card when a hero is knocked out. Draw 2 Overlord cards. This is in addition to your normal 1 Overlord card drawn for defeating a hero.', 0, 2, 0, '0'),
(163, 'Blood Rage', 'Overlord', 'Warlord', NULL, 'Play this card at the end of your turn and choose a monster. That monster immediately performs 2 attack actions and is then defeated.', 0, 1, 0, '0'),
(164, 'Outbreak', 'Overlord', 'Infector', NULL, 'Play this card at the start of an infected hero''s turn. Each hero within 3 spaces of that hero must test Might. Each hero that fails gains 1 infection token and then suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the number of infection tokens in his play area.', 0, 2, 0, '3'),
(165, 'Virulent Infection', 'Overlord', 'Infector', NULL, 'Play this card at the start of your turn. During this turn, each time a hero gains an infection token, he gains 1 additional infection token.', 0, 1, 0, '3'),
(166, 'Adaptive Contagion', 'Overlord', 'Infector', NULL, 'Play this card during your turn and keep it in your play area. During this quest, when a hero would be Poisoned or Diseased, you may instead place 1 infection token in his play area.<br /><br />Additionally, when an infected hero performs an attribute test, you may discard 1 infection token from that hero before rolling dice to add 1 Shield to his results.', 0, 1, 0, '3'),
(167, 'Airborne', 'Overlord', 'Infector', NULL, 'Play this card during your turn and keep it in your play area. During this quest, each time a monster missed or deal no <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on an attack, the targetted hero gains 1 infection token.<br /><br />Additionally, when an infected hero performs an attack, you may discard 1 infection token from that hero after rolling dice to add 1 Shield to the defense results.', 0, 1, 0, '3'),
(168, 'Contaminated', 'Overlord', 'Infector', NULL, 'Play this card during your turn and keep it in your play area. During this quest, each of your monsters gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Infect your target<br /><br />Additionally, each time a monster performs an attack targeting an infected hero, you may discard 1 infection token from that hero after rolling dice to gain +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on the attack.', 0, 1, 0, '3'),
(169, 'Dark Host', 'Overlord', 'Infector', NULL, 'Play this card at the start of your turn and discard 3 infection tokens from 1 infected hero. During this turn, you may perform 1 move action and 1 attack action with this hero, treating him as a monster in his own group.', 0, 3, 0, '3'),
(170, 'Tainted Blow', 'Overlord', 'Infector', NULL, 'Play this card when a monster attacks a hero, before rolling dice.<br /><br />This attack gains 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> and +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Discard 2 infection tokens from the target hero to return this card to your hand.', 0, 2, 0, '3');
INSERT INTO `tbskills` (`skill_id`, `skill_name`, `skill_type`, `skill_class`, `skill_special`, `skill_text`, `skill_plot`, `skill_cost`, `skill_stamina_cost`, `skill_expansion`) VALUES
(171, 'Diabolic Power', 'Overlord', 'Magus', NULL, 'Play this card during your turn. Search your deck and discard pile for the card of your choice and place it in your hand, then shuffle your deck.<br /><br />If the chosen card is an Event, every hero tests Willpower. If it is a Trap, every hero tests Awareness. If it is Magic, every hero tests Knowledge. Each hero who fails suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 3, 0, '0'),
(172, 'Rise Again', 'Overlord', 'Magus', NULL, 'Play this card when a minion or master monster is defeated to place a fatigue token on the map in that monster''s space. At the start of your next turn, place that monster on the map within 5 spaces of where it was defeated. At the end of your next turn, remove that monster (and the token) from the map.', 0, 2, 0, '0'),
(173, 'Unholy Ritual', 'Overlord', 'Magus', NULL, 'Play this card at the start of your turn. Choose one of your monster groups and draw Overlord cards equal to the number of figures from that group on the map. Choose and keep 2 cards and discard the rest. Each monster in that group performs 1 less action during this turn.', 0, 1, 0, '0'),
(174, 'Word of Despair', 'Overlord', 'Magus', NULL, 'Play this card at the end of your turn. Each hero tests Willpower. Each hero who fails suffers 1 Fatigue each time he performs an action during his next turn. This fatigue is suffered after the hero completely resolves the action. (He may perform actions even if his Fatigue equals his Stamina; excess Fatigue is converted to <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> as usual.)', 0, 2, 0, '0'),
(175, 'Word of Pain', 'Overlord', 'Magus', NULL, 'Play this card at the end of your turn. Each hero tests Might. Each hero who fails suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 0, '0'),
(176, 'Toxic Reprisal', 'Overlord', 'Overlord Reward', NULL, 'Play this card when a monster is defeated. A hero of your choice within 3 spaces of that monster is Diseased and Weakened.', 98, 0, 0, '3'),
(177, 'Secrets of Flesh', 'Overlord', 'Overlord Reward', NULL, 'Play this card at the start of your turn and roll 1 red power diie. Each of your monsters recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 98, 0, 0, '3'),
(178, 'Offertory Affliction', 'Overlord', 'Overlord Reward', NULL, 'Play this card when activating a monster with a condition token during your turn. Choose a hero adjacent to that monster. Discard the condition token from the monster, and the chosen hero gains the corresponding Condition card.', 98, 0, 0, '3'),
(179, 'Trading Pains', 'Overlord', 'Punisher', NULL, 'Play this card on a hero when he would recover any amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. In response to this card, the hero may choose to reduce the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> he recovers.<br /><br />Another hero of your choice within 3 spaces of that hero suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to half (rounded up) the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> recovered.', 0, 1, 0, '1'),
(180, 'Blood Bargaining', 'Overlord', 'Punisher', NULL, 'Play this card at the start of a hero''s turn. Take 1 hero token from each hero and choose an equal number of monsters in play. Assign 1 token to each chosen monster. until the end of this round, each time a monster suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, the hero whose token is assigned to that monster suffers an equal amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 3, 0, '1'),
(181, 'Exploit Weakness', 'Overlord', 'Punisher', NULL, 'Play this card after a hero ends his turn with an amount of Fatigue on his Hero sheet equal to his Stamina.<br /><br />Immediately move a monster up to it''s speed toward that hero. Then perform an attack with that monster against that hero, if able. ', 0, 2, 0, '1'),
(182, 'No Rest for the Wicked', 'Overlord', 'Punisher', NULL, 'Play this card when a hero suffers 1 Fatigue to gain an additional movement point. Choose 1 monster to move 1 space immediately after the hero spends that movement point.<br /><br />Until the start of your turn, you may trigger this ability each time a hero suffers 1 Fatigue to gain an additional movement point.', 0, 1, 0, '1'),
(183, 'Price of Prevention', 'Overlord', 'Punisher', NULL, 'Play this card on a hero at the start of your turn. The hero may suffer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> eaqual to an attribute of his choice to test that attribute. if he passes, discard this card.<br /><br />If he fails or chooses not to test an attribute, you may search your discard pile for 1 Event of Trap card and add it to your hand.', 0, 2, 0, '1'),
(184, 'Splig''s Revenge', 'Overlord', 'Quest Reward', NULL, 'Return this card to the game box at the start of your turn. Replace a figure with goblin in its name with Splig. Splig cannot wield a relic.<br /><br />At the end of this quest, if Splig was not defeated, regain this card from the game box.', 98, 0, 0, '2'),
(185, 'Twin Souls', 'Overlord', 'Quest Reward', NULL, 'Play this card when activating Lord Merick Farrow. Immediately remove Lord Merick Farrow from the map and replace him with Sir Alric Farrow.<br :><br :>Sir Alric Farrow cannot wield a relic.', 98, 0, 0, '2'),
(186, 'The Wyrm Queen''s Favor', 'Overlord', 'Rumor Reward', NULL, 'Play this card at the start of your turn. Each hero tests Awareness. If all heroes pass, shuffle this card back into your deck. If a hero fails, choose 1 hero that failed his test and place 1 master hybrid sentinel within 3 spaces of that hero, respecting group limits. You may place this card even when hybrid sentinels are not 1 of your monster groups.', 98, 0, 0, '1'),
(187, 'Explosive Runes', 'Overlord', 'Saboteur', NULL, 'Play this card after a hero opens a door or searches.<br />That hero, and each hero within 2 spaces of him tests Awareness. Each hero who fails suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each Shield rolled in excess of his Awareness.', 0, 1, 0, '0'),
(188, 'Uthuk Demon Trap', 'Overlord', 'Saboteur', NULL, 'Play this card after a hero opens a door or searches. he tests Awareness or Might (his choice). If he passes, he suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the attribute tested. If he fails, he is defeated.', 0, 3, 0, '0'),
(189, 'Web Trap', 'Overlord', 'Saboteur', NULL, 'Play this card when a hero enters an empty space. That hero and each hero adjacent to him tests Might. Each hero who fails is Immobilized.', 0, 1, 0, '0'),
(190, 'Wicked Laughter', 'Overlord', 'Saboteur', NULL, 'Play this card when a hero passes an attribute test. The hero must take the test again, this time treating his attribute as if it were 1 lower. If the hero passes this new attribute test, draw 1 Overlord card.', 0, 2, 0, '0'),
(191, 'Curse of the Monkey God', 'Overlord', 'Saboteur', NULL, 'Play this card after a hero searches. that hero tests Knowledge. If he passes, draw 1 Overlord card. if he fails, he becomes a monkey until the end of his next turn. Take 1 of his hero tokens as a reminder.<br /><br />Monkeys cannot roll defense dice (except to test an attribute), have a Speed of 5, and cannot attack for any reason.', 0, 2, 0, '0'),
(192, 'Dark Remedy', 'Overlord', 'Universal', NULL, 'Play this card on a monster group during your turn and choose 1 condition. Each monster in that group may discard 1 token corresponding to the chosen condition.', 0, 1, 0, '2'),
(193, 'Dark Resilience', 'Overlord', 'Universal', NULL, 'Play this card on a monster during your turn. Roll 2 red dice. The monster recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 0, 1, 0, '0'),
(194, 'Plan Ahead', 'Overlord', 'Universal', NULL, 'Play this card on your turn. Look at the top 5 cards of the Overlord deck and place them on top of the deck in the order of your choice.', 0, 1, 0, '0'),
(195, 'Schemes', 'Overlord', 'Universal', NULL, 'Play this card on your turn. Choose Event, Magic, or Trap. Reveal cards from the top of your deck until you find a card with the chosen trait or until you run out of cards in your deck. Add the card with the chosen trait (if possible) to your hand and discard all other cards revealed.', 0, 1, 0, '0'),
(197, 'Dark Fortitude', 'Overlord', 'Warlord', NULL, 'Play this card after rolling defense dice. Add 2 Shields to the results.', 0, 1, 0, '0'),
(198, 'Expert Blow', 'Overlord', 'Warlord', NULL, 'Play this card when a monster attacks a hero, before rolling dice.<br /><br />This attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Return this card to your hand.', 0, 2, 0, '0'),
(199, 'Reinforce', 'Overlord', 'Warlord', NULL, 'Play htis card at the end of your turn and choose a master monster on the map. Place minion monsters of that monster''s group in empty spaces adjacent to that monster up to the group limit. These monsters may not be placed within 3 spaces of any hero, but may otherwise be placed in any empty space.', 0, 3, 0, '0'),
(201, 'Dual Training', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card when you target a monster with the ''Frenzy'' Overlord card. During this turn, each monster in the target monster''s group gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on each attack.<br /><br />Exhaust this card when you  target a monster with the ''Dash'' Overlord card. Each monster in the target monster''s group may immediately move 1 space.', 1, 0, 0, '10'),
(202, 'Fight With Honor', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card and discard a Trap Overlord card before triggering the ability of another Plot card. Reduce the Plot card''s trigger cost by 1 (to a minimum of 0).', 1, 2, 0, '10'),
(203, 'Cut a Deal', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card at the end of a quest to add the following Rewards to that quest:<br /><br />If the heroes win, the overlord gains 1 threat token and the heroes receive 25 gold.<br /><br />If the overlord wins, he gains 2 threat tokens and the heroes receive 25 gold.\n', 1, 2, 0, '10'),
(204, 'Show of Force', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card when you knock out a hero, before drawing an overlord card or gaining a threat token for knocking out that hero. While this card is exhausted, each time you gain a threat token, you may draw an Overlord card.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest. ', 1, 2, 0, '10'),
(205, 'Make Our Own Luck', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card after resolving a ''Dark Fortune'' Overlord card to change the rerolled die to a result of your choice.', 1, 2, 0, '10'),
(206, 'End It!', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card when you play a ''Critical Blow'' Overlord card to add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the attack results.\n', 1, 2, 0, '10'),
(207, 'Bribery', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card after resolving the effects of a ''Dark Charm'' Overlord card to return that card to your hand. Immediately play it, targeting a different hero.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '10'),
(208, 'Resourceful', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card at the start of your turn instead of drawing an Overlord card. Choose a basic Overlord card in your discard pile and place it at the top of your Overlord deck.', 1, 3, 0, '10'),
(209, 'Hazard Pay', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card when placing reinforcements. You may spend threat tokens to place 1 additional monster from one of your monster groups that you can reinforce, respecting group limits. Spend threat tokens as follows:<br /><br />SMALL monsters cost 1 threat token;<br />MEDIUM monsters cost 2 threat tokens;<br />HUGE monsters cost 3 threat tokens; and<br />MASSIVE monsters cost 4 threat tokens.', 1, 4, 0, '10'),
(210, 'Summon Belthir', 'Overlord', 'Hybrid Loyalty', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 1 minion monster in the chosen group with the Belthir agent.<br /><br />If the Belthir agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Belthir lieutenant.', 1, 3, 0, '10'),
(211, 'Bloodline', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card during your turn to choose two monsters. One monster suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and the other monster recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. If both monsters have the Dark monster trait, the monster suffering <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> suffers 1 fewer <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 0, 0, '11'),
(212, 'Bad Dreams', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card at the end of the Travel step of the Campaign phase. Each hero tests Willpower. Each hero who fails suffers 2 Fatigue.', 1, 1, 0, '11'),
(213, 'Night''s Embrace', 'Overlord', 'Endless Thirst', NULL, 'Use this card after setup of an encounter to choose one of your monster groups. During this encounter, that monster group gains the Dark monster trait.<br /><br />Place a threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 0, '11'),
(214, 'Fangs in the Dark', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card when a monster deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> from an attack. That monster recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />If that monster has the Dark monster trait, it recovers an additional 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 2, 0, '11'),
(215, 'The Power of Blood', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card when a SMALL monster declares a move action. move that monster 1 space.<br /><br />While this card is exhausted, if that monster has the Dark monster trait, it gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on each attack.', 1, 2, 0, '11'),
(216, 'Nighttime Hunt', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card when a monster with the Dark monster trait performs an attack, before dice are rolled, to add 1 additional yellow power die to its attack pool.<br /><br />Exhaust this card when a monster with the Dark trait is attacked, before dice are rolled, to add 1 additional black die to its defense pool.', 1, 3, 0, '11'),
(217, 'Scent of Blood', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card when a monster attacks a hero that has 6 or more damage tokens on his Hero sheet, before dice are rolled. This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span><br /><br />If the monster has the Dark monster trait, you may reroll the attack die once during this attack.', 1, 3, 0, '11'),
(218, 'The Taste of Suffering', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card when a monster knocks out a hero. Mark that monster by placing 1 threat token from the supply on its base. If it has the Dark monster trait, you may immediately move it up to its Speed.<br /><br />Each marked monster applies +1 to its Health per hero.', 1, 3, 0, '11'),
(219, 'The Lady''s Care', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card during your turn to choose a monster and roll 1 red power die. The chosen monster recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.<br /><br />If the chosen monster has the Dark monster trait, each other monster in its group recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 3, 0, '11'),
(220, 'Summon Eliza', 'Overlord', 'Endless Thirst', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master monster in that group with the Lady Eliza Farrow agent.<br /><br />If the Lady Eliza Farrow agent is defeated, return the card to your plot deck.<br /><br />You cannot use this card in any quest that uses the Lady Eliza Farrow lieutenant.', 1, 3, 0, '11'),
(221, 'Armor of Darkness', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card when a monster is attacked, after dice are rolled, to add 2 Shields to the results.', 1, 0, 0, '12'),
(222, 'Trial of Knighthood', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card when a master monster performs an attack, before dice are rolled. If this attack defeats a hero that has at least 4 Might, gain 2 threat tokens.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '12'),
(223, 'Veteran Council', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card after setup of an encounter. At the end of this encounter, gain 1 threat token for each master monster remaining on the map (to a maximum of 3 threat tokens).<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 2, 0, '12'),
(224, 'Fight in Formation', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card when a monster is attacked, before dice are rolled. Add 1 Shield to the results for each monster in the monster''s group that is adjacent to it (to a maximum of 3 Shields).<br /><br />If the defending monster does not suffer at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> from this attack, gain 1 threat token.', 1, 2, 0, '12'),
(225, 'Unkillable', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card when a master monster is defeated. Replace the master monster with a minion monster from the same monster group, respecting group limits.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 0, '12'),
(226, 'Knight Training', 'Overlord', 'The Fallen Elite', NULL, 'After setup of an encounter, choose a monster group of SMALL monsters and place this card next to the chosen group''s Monster card.<br /><br />Exhaust this card when a monster of the chosen group is attacked, after dice are rolled, to reroll 1 defense die. While this card is exhausted, each time a monster of that group is attacked, after dice are rolled, you may reroll 1 defense die.', 1, 3, 0, '12'),
(227, 'Dark Champions', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card after the setup of an encounter. While this card is exhausted, each master monsters gains +2 Health and adds 1 additional brown die to its defense pool. Each of its attacks gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span><br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '12'),
(228, 'Vengeful Resolve', 'Overlord', 'The Fallen Elite', NULL, 'After setup of each encounter, choose a monster group of SMALL monsters and place this card next to the chosen group''s Monster card.<br /><br />Exhaust this card at the end of your turn. While this card is exhausted, each time a hero performs an attack that deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to a monster of that group, that hero suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 3, 0, '12'),
(229, 'Refuse to Die', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card at the start of your turn to choose a monster. Place a threat token on that monster''s base as a reminder. While this card is exhausted, that monster applies +2 to its Health. The monster also recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> at the start of each overlord turn.<br /><br />This card does not refresh as normal. It refreshes when the chosen monster is defeated or at the end of the encounter.', 1, 4, 0, '12'),
(230, 'Summon Alric', 'Overlord', 'The Fallen Elite', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 1 minion monster in the chosen group with the Sir Alric Farrow agent.<br /><br />If the Sir Alric Farrow agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Sir Alric Farrow lieutenant.', 1, 3, 0, '12'),
(231, 'Dark Pact', 'Overlord', 'Cursed By Power', NULL, 'After setup of the first encounter of each quest, the hero players choose a hero and place that hero''s hero token on this card.<br /><br />When the chosen hero suffers any amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, he may exhaust this card to reduce the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> suffered by up to 2. If he does, you gain 1 threat token.<br /><br />At the end of each quest, discard the hero token from this card.', 1, 0, 0, '13'),
(232, 'Greater Power', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card when a monster performs an attack, after dice are rolled, to discard the top card from your Overlord deck. This attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. If the discarded card was a Magic Overlord card, this attack gains +3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead.', 1, 2, 0, '13'),
(233, 'The Dark Mark', 'Overlord', 'Cursed By Power', NULL, 'After setup of the first encounter of each quest, the hero players choose a hero and place that hero''s hero token on this card.<br /><br />Exhaust this card when a hero suffers at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. That hero suffers no <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and the hero whose hero token is on this card suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead.<br /><br />At the end of each quest, discard the hero token from this card.', 1, 2, 0, '13'),
(234, 'The Grasping Grave', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card when a hero performs a stand-up action or is revived by another hero. That hero rolls 1 red power die instead of 2.', 1, 2, 0, '13'),
(235, 'Masques', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card when a hero performs an attack, before dice are rolled. If you do, the attack is a miss.<br /><br />The card does not refresh as normal. Refresh the card at the end of each quest.', 1, 2, 0, '13'),
(236, 'Mystic Might', 'Overlord', 'Cursed By Power', NULL, 'Use this card after you play a Magic Overlord card. Place 1 fatigue token on this card.<br /><br />You may discard 1 fatigue token from this card, after dice are rolled, to either gain +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for an attack or add 2 Shields to a defense result.<br /><br />At the end of each quest, discard all fatigue tokens on this card.', 1, 3, 0, '13'),
(237, 'Thaumaturgy', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card at the end of your turn and discard a Magic Overlord card from your hand to search your discard pile for a Magic Overlord card of your choice. Reveal that card an place it in your hand.', 1, 3, 0, '13'),
(238, 'Bolt From the Blue', 'Overlord', 'Cursed By Power', NULL, 'Use this card during your turn to choose a hero. Perform an attack targeting the chosen hero using the following dice:<br /><br />Ranged, Blue, Yellow<br /><br />If the total range of this attack is less than 4, it is a miss. This attack gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +2 Range<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 1, 3, 0, '13'),
(239, 'Cabal', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card after setup of an encounter to choose a monster group an place this card near that group''s Monster card. Each master monster in that group gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> Overseer: This monster deals +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each other monster in its group within 3 spaces of the target, (to a maximum of +4 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>).', 1, 4, 0, '13'),
(240, 'Summon Merick', 'Overlord', 'Cursed By Power', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master monster in that group with the Lord Merick Farrow agent.<br /><br />If the Lord Merick Farrow agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Lord Merick Farrow lieutenant.', 1, 3, 0, '13'),
(241, 'Sole Purpose', 'Overlord', 'Seeds of Betrayal', NULL, 'Use this card when removing Overlord cards from your deck before a quest to remove additional Overlord cards, creating an Overlord deck with a minimum of 13 Overlord cards instead of 15.', 1, 0, 0, '14'),
(242, 'Scrying and Plotting', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card during quest setup. Instead of drawing your starting hand as normal, search your Overlord deck and choose a number of Overlord cards equal to the number of heroes. These cards are your starting hand.<br /><br />Then, shuffle your Overlord deck.', 1, 1, 0, '14'),
(243, 'Rush of Power', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card at the start of your turn. At then end of this turn, draw 2 Overlord cards.', 1, 2, 0, '14'),
(244, 'Two-Pronged Gambit', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card during setup of the first encounter. Then, place a threat token form the supply beneath this card with either the threat token or fortune token side faceup. No hero player can know which side is faceup.<br /><br />Reveal the token at the end of the quest. if the threat side is faceup and the overlord won, gain 3 threat. If the fortune side is faceup and the heroes won, gain 3 threat.', 1, 2, 0, '14'),
(245, 'Nefarius Power', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card when a hero performs an attribute test, after dice are rolled, to add 1 Shield to his results.', 1, 2, 0, '14'),
(246, 'Always Prepared', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card at the start of your turn and discard up to 2 Overlord cards from your hand. Then, draw Overlord cards equal to the number of discarded cards.', 1, 2, 0, '14'),
(247, 'False Friends', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card during setup of the first encounter. While this card is exhausted, reveal 2 fewer Shop item cards during the next Shopping phase of the Campaign phase.<br /><br />This card does not refresh as normal. Refresh this card after the next Shopping step.', 1, 3, 0, '14'),
(248, 'Trouble on the Road', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card after the Travel step of the Campaign phase. Each hero tests one attribute of your choice.<br /><br />Each hero that tests Might or Knowledge and fails is Stunned.<br />Each hero that tests Awareness and fails is Diseased.<br /><br />Each hero that tests Willpower and fails is Poisoned.', 1, 3, 0, '14'),
(249, 'Meticulous Planning', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card after a hero draws (and chooses to keep) a Search card to force that hero to place that Search card on the bottom of the deck and draw a new one.', 1, 4, 0, '14'),
(250, 'Summon Zachareth', 'Overlord', 'Seeds of Betrayal', NULL, 'Exhaust this card after setup of each encounter to choose an open monster group; Replace 1 master and 1 minion monster in the chosen group with the Baron Zachareth agent.<br /><br />If the Baron Zachareth agent is defeated, return this card to your Plot deck.<br />You cannot use this card in ''The Shadow Rune'' campaign.', 1, 3, 0, '14'),
(251, 'Spirited Retreat', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card when a SMALL monster with the Wilderness monster trait declares a move action. Move that monster 1 space.<br /><br />If that monster ends its move action within 3 spaces of a hero, it may move 1 additional space.', 1, 0, 0, '15'),
(252, 'Feral Instincts', 'Overlord', 'Goblin Uprising', NULL, 'Use this card after setup of an encounter to choose one of your monster groups. During this encounter, that group gains the Wilderness monster trait.<br /><br />Place a threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 0, '15'),
(253, 'Overfed', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card after setup of an encounter. While this card is exhausted, each monster with the Wilderness monster trait applies +2 to its Health and -1 to its Speed.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '15'),
(254, 'Meat Shield', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card when a monster suffers any amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Choose a monster adjacent to that monster to suffer all of the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead.', 1, 2, 0, '15'),
(255, 'Emergency Rations', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card during your turn to choose a monster and roll 1 red power die. The chosen monster recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.<br /><br />If that monster has the Wilderness monster trait, it recovers 1 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 2, 0, '15'),
(256, 'Dive into Cover', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card after a hero resolves an attack affecting a monster. If that monster was not defeated, it may immediately move 3 spaces.<br /><br />If that monster has the Wilderness monster trait, it adds 1 additional black die to its defense pool until the start of your next turn.<br /><br />Place a threat token from the supply on that monster''s base as a reminder.', 1, 3, 0, '15'),
(257, 'Goblin Ambush', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card when a hero enters an empty space. Perform an attack targeting that hero as if from a master goblin archer. If the total range of this attack is less than 4, it is a miss.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 0, '15'),
(258, 'Raided Armory', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card at the start of your turn and choose a monster group. Place this card near that group''s Monster card. While this card is exhausted, each monster in that group adds 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to each of his attack results and 1 Shield to each of his defense results.<br /><br />If that group has the Wilderness monster trait, each monster in that groups gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on each attack.\n', 1, 4, 0, '15'),
(259, 'Scavenge', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each of your monsters gains:<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: If this monster is in a space containing or adjacent to a knocked-out hero, place 1 threat token from the supply on this card.<br /><br />No more than 6 threat can be on this card at any time. At the end of the quest, gain all threat tokens on this card.', 1, 4, 0, '15'),
(260, 'Summon Splig', 'Overlord', 'Goblin Uprising', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master monster in the chosen group with the Splig agent.<br /><br />If the Splig agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Splig lieutenant.', 1, 3, 0, '15'),
(261, 'Mine All Mine', 'Overlord', 'Dragon''s Greed', NULL, 'At the end of each encounter, place a number of threat okens on this card equal to the number of search tokens remaining on the map.<br /><br />You may return this card to the game box at the end of any quest to gain all threat tokens on this card. If you do not do this, discard all threat tokens on this card.', 1, 0, 0, '16'),
(262, 'Terrifying Presence', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each hero within 3 spaces of a HUGE or MASSIVE monster applies -1 to his Might, Willpower, Knowledge, Awareness, (to a minimum of 1).', 1, 2, 0, '16'),
(263, 'Iron-Hard Scales', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card when a monster is attacked, before dice are rolled, to add 2 Shields to the results. If you roll one or more blanks, add an additional 1 Shield to the results.', 1, 2, 0, '16'),
(264, 'Jealous Rage', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card when a hero declares a search action to choose a monster within 5 spaces of that hero. Remove that monster from the map and place it in an empty space adjacent to that hero. Then, that monster immediately performs an attack targeting that hero. After resolving this attack, if the hero was not defeated, he may continue his turn.', 1, 3, 0, '16'),
(265, 'Massive Bulk', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card when a HUGE or MASSIVE monster ends or interrupts its movement. You can place that monster''s base in spaces occupied by heroes. Move each hero in the occupied spaces to the closest empty space. The HUGE or MASSIVE monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each hero it moves.', 1, 3, 0, '16'),
(266, 'Punish the Weak', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each of your monsters gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> Crush: This monster deals +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each space its base occupies that exceeds the target hero''s Might', 1, 3, 0, '16'),
(267, 'Aurium Plating', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card after setup of an encounter to choose a HUGE or MASSIVE monster group. Place this card near that group''s Monster card.<br /><br />Each monster in that group applies +2 to its Health and is immune to Pierce.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 0, '16'),
(268, 'Valyndra''s Shadow', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card at the end of your turn to choose a hero. Mark him with a threat token from the supply. At the start of your next turn, perform an attack targeting the marked hero as if from the Valyndra agent.<br /><br />You cannot use this card in any quest that uses the Valyndra lieutenant or the Valyndra agent.<br /><br />This card does not refresh as normal. Refreh this card at the end of each quest.', 1, 4, 0, '16'),
(269, 'Guardians of the Hoard', 'Overlord', 'Dragon''s Greed', NULL, 'Use this card after setup of an encounter to place any number of your threat tokens on this card. Threat tokens on this card cannot be spent during this encounter. Return all threat tokens from this card to your play area at the end of each encounter.<br /><br />If there are more threat tokens on this card than there are HUGE and MASSIVE monsters on the map, each HUGE and MASSIVE monster gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> on each attack.', 1, 4, 0, '16'),
(270, 'Summon Valyndra', 'Overlord', 'Dragon''s Greed', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 2 minion monsters in the chosen group with the Valyndra agent.<br /><br />If the Valyndra agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Valyndra lieutenant.', 1, 3, 0, '16'),
(271, 'Misdirection', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card when a monster performs an attack that is a miss. Reroll the attack die.<br /><br />If that monster has the Cursed monster trait, you may also reroll 1 power die.<br /><br />If that attack deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after the defense roll), the monster that performed the attack may move 1 space.', 1, 0, 0, '17'),
(272, 'Tainted Blood', 'Overlord', 'Dark Illusions', NULL, 'Use this card after setup of an encounter to choose one of your monster groups. During this encounter, that monster group gains the Cursed monster trait. <br /><br />Place 1 threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 0, '17'),
(273, 'Intricate Schemes', 'Overlord', 'Dark Illusions', NULL, 'During the Choose Next Quest step of the Campaign Phase, each time you would choose the next quest to be played, you may force the heroes to choose which quest will be played next. If you do, gain 3 threat tokens.', 1, 1, 0, '17'),
(274, 'Malediction', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card at the end of your turn. While this card is exhausted, each attack that targets a monster with the Cursed monster trait gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. After resolving each of these attacks, the attacking hero suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 1, 2, 0, '17'),
(275, 'Mirage', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card when a hero resolves an attack that does not deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after the defense roll). Remove 1 monster affected by this attack from the map and place it in an empty space within 3 spaces of its original space.<br /><br />If that monster has the Cursed monster trait, the attacking hero suffers 1 Fatigue.', 1, 2, 0, '17'),
(276, 'Enthrall', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card at the start of your turn to choose 1 monster. Each hero in that monster''s line of sight tests Willpower. If that monster has the Cursed monster trait, add 1 Shield to the results of each test. You may move each hero who fails 2 spaces.', 1, 2, 0, '17'),
(277, 'Phantasm', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card when a hero attacks a master monster with the Cursed monster trait, before dice are rolled. While this card is exhausted, each attack that targets that monster must roll 3 range in addition to any other range requirements, or the attack is a miss.', 1, 3, 0, '17'),
(278, 'Darkness Falls', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card at the start of your turn. Until the start of your next turn, line of sight for Ranged attacks can only be measured up to a range of 2. Monsters with the Cursed monster trait, lieutenants, and agents are not affected by this card.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 0, '17'),
(279, 'The Ritual Continues', 'Overlord', 'Dark Illusions', NULL, 'At the start of each encounter, place fatigue tokens on this card equal to the number of heroes. Each of your master monsters gains:<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Discard 1 fatigue token from ''The Ritual Continues.''<br />br />At the end of each encounter, if there are no fatigue tokens on this card, gain 2 threat tokens. Then, discard all tokens from this card.', 1, 4, 0, '17'),
(280, 'Summon Ariad', 'Overlord', 'Dark Illusions', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 1 minion monster in that group with the Ariad agent.<br /><br />if the Ariad agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Ariad or Queen Ariad lieutenant.', 1, 3, 0, '17'),
(281, 'Natural Camouflage', 'Overlord', 'Tangled Web', NULL, 'At the start of an encounter, exhaust this card. While this card is exhausted, each time a monster with the Wilderness monster trait rolls at least 1 blank when rolling defense dice, add 1 Shield to the results for each blank rolled.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 0, 0, '18'),
(282, 'Feral Instincts', 'Overlord', 'Tangled Web', NULL, 'Use this card after setup of an encounter to choose one of your monster groups. During this encounter, that group gains the Wilderness monster trait.<br /><br />Place a threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 0, '18'),
(283, 'Web of Deception', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card when a hero gains a Condition card. Replace that card with a different Condition card of your choice.', 1, 2, 0, '18'),
(284, 'Entangling Weave', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card at the end of your turn to choose a monster group and place this card near thatr monster group''s Monster card. While this card is exhausted, each hero must spend 1 additional movement point to enter a space adjacent to at least 1 monster group in that group.', 1, 2, 0, '18'),
(285, 'Unsafe Passage', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card after resolving a Trap card to return that card to your hand.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '18'),
(286, 'Hidden Predator', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card after setup of an encounter. While this card is exhausted, each monster with the Wilderness monster trait gains:<br /><br />Ambush: Each time this monster performs an attack that targets a hero that did not have line of sight to this monster at the start of its activation, that attack gains Pierce 2.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '18'),
(287, 'Embrace Darkness', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card during your turn. Gain 1 threat token for each knocked out hero.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 0, '18'),
(288, 'Solitary Prey', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card when a monster performs an attack that targets a hero who is not adjacent to any other hero, before dice are rolled. This attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Additionally, if the monster has the Wilderness monster trait, this attack gains Pierce 1.', 1, 3, 0, '18'),
(289, 'Salvage Exploitation', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card when you resolve a Trap card played on a hero during his turn. Choose 1 monster with the Wilderness monster trait. That monster may immediately perform an attack targeting that hero. After this attack is resolved, the active player resumes his turn.', 1, 4, 0, '18'),
(290, 'Summon Queen Ariad', 'Overlord', 'Tangled Web', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace that group with the Queen Ariad agent.<br /><br />If the Queen Ariad agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in the ''Labyrinth of Ruin'' campaign.', 1, 3, 0, '18'),
(291, 'Petty Theft', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each of your monsters gains the following abilities:<br /><br />This monster may spend 2 movement points to reveal 1 adjacent search token. If it is not a unique search token, place it on this monster''s base. While a search token is on this monster''s base, the token cannot be searched by any hero.<br /><br />If he is defeated or leaves the map for any reason, place any search tokens on its base in the space last occupied by the monster.', 1, 0, 0, '19'),
(292, 'Concealment', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when you activate a monster with at least 1 search token on its base. Look at the top 2 cards of the Search deck. Place 1 card on the top of the Search deck and 1 card on the bottom.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest, or spend 1 threat token at the start of your turn to refresh it.', 1, 2, 0, '19'),
(293, 'Slippery', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when you activate a monster. That monster may move into spaces occupied by enemy figures at a cost of 1 additional movement point per space. The monster must end its movement in an empty space following normal movement rules.<br /><br />If that monster has at least 1 search token on its base, refresh this card at the end of that monster''s activation.', 1, 2, 0, '19'),
(294, 'Distraction', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when a hero declares an attack targeting a monster with at least 1 search token on its base. Remove 1 search token form that monster''s base and place it in a space adjacent to the hero performing the attack. That hero immediately searches that search token instead of performing the attack. Then he is Stunned, and you may move the monster up to 2 spaces.', 1, 2, 0, '19'),
(295, 'Foiled Again', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card after a hero draws (and chooses to keep) a Search card. Set that Search card aside and that hero draws another Search card. Then, return the Search card that was set aside to the top of the Search deck.', 1, 2, 0, '19'),
(296, 'Covetous', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when a hero draws a Search card. While this card is exhausted, add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results of each attack that targets a hero with at least 1 faceup Search card in his play area.<br /><br />This card does not refresh as normal. Refresh this card at the end of your turn.', 1, 2, 0, '19'),
(297, 'Guarded Treasure', 'Overlord', 'Skulduggery', NULL, 'Each monster with at least 1 search token on its base adds 1 Shield to its defense results.<br /><br />At the end of each encounter, if there is at least 1 monster with a search token on its base, gain 1 threat token.', 1, 3, 0, '19'),
(298, 'Cursed Treasure', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when a hero within 3 spaces of a monster searches a search token. You may place 1 threat token on this card.<br /><br />This card cannot hold more than 4 threat tokens at any time. At the end of each quest, gain all threat tokens on this card.', 1, 3, 0, '19'),
(299, 'Bait and Switch', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card when a hero enters an empty space adjacent to a search token. Choose 1 SMALL monster within 5 spaces of that search token. The chosen monster and that search token trade spaces. Then, that monster may immediately perform an attack targeting that hero. After this attack is resolved, the active player resumes their turn.', 1, 3, 0, '19'),
(300, 'Summon Raythen', 'Overlord', 'Skulduggery', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master monster in that group with the Raythen agent.<br /><br />If the Raythen agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Raythen lieutenant, ally, or hero.', 1, 3, 0, '19'),
(301, 'Brethren', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card when you activate a monster with the Civilized monster trait. Choose 2 monsters in that group. The first monster performs 1 less action this turn, and the second monster may perform 1 additional action this turn.', 1, 0, 0, '20'),
(302, 'Diplomatic', 'Overlord', 'Silent Protector', NULL, 'Use this card after setup of an encounter to choose one of your monster groups. During this encounter, that group gains the Civilized monster trait.<br /><br />Place 1 threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 0, '20'),
(303, 'Curative Spirit', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each master monster with the Civilized monster trait gains:<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack. If this attack deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after the defense roll), this monster and 1 monster within 3 spaces of this monster each recover 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 2, 0, '20');
INSERT INTO `tbskills` (`skill_id`, `skill_name`, `skill_type`, `skill_class`, `skill_special`, `skill_text`, `skill_plot`, `skill_cost`, `skill_stamina_cost`, `skill_expansion`) VALUES
(304, 'Traveler''s Rest', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card at the end of your turn. While this card is exhausted, heroes cannot suffer Fatigue to gain movement points.', 1, 3, 0, '20'),
(305, 'Pity the Weak', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card when a hero performs an attack targeting a monster that has at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> token, before dice are rolled. The hero suffers 1 Fatigue and tests Willpower. If he fails, he removes 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> from the attack results.<br /><br />After the attack is resolved, if that monster has the civilized trait and was not defeated, the monster may move 2 spaces.', 1, 2, 0, '20'),
(306, 'Pacify', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card when a monster performs an attack that targets a hero, before dice are rolled.<br /><br />If that attack is not a miss, that hero is Stunned.', 1, 2, 0, '20'),
(307, 'Shared Burdens', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card when a monster suffers at least 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to reduce the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> that monster suffers to a minimum of 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Then, all monsters in that monster''s group suffer an amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the amount by which you reduced the first monster''s <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, divided any way you choose between those monsters.', 1, 3, 0, '20'),
(308, 'Power in Mourning', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card when a master monster is defeated. You may place 2 threat tokens on this card.<br /><br />This card cannot hold more than 8 threat tokens at any time. At the end of the quest, gain all threat tokens on this card.', 1, 3, 0, '20'),
(309, 'Oath of Silence', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card after setup of an encounter to choose a monster. While this card is exhausted, that monster cannot perform any actions except for move actions. At the end of each of your turns, each monster within 3 spaces of that monster recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Place 1 threat token from the supply on that monster''s base as a reminder.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 0, '20'),
(310, 'Summon Serena', 'Overlord', 'Silent Protector', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master monster in that group with the Serena agent.<br /><br />If the Serena agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Serena lieutenant, ally, or hero.', 1, 3, 0, '20'),
(311, 'Dark Charm', 'Overlord', 'Basic', NULL, 'Play this card on a hero at the start of your turn. The hero tests Willpower. If he passes, draw 1 Overlord card. If he fails, you may perform a move or attack action with that hero as if he were one of your monsters this turn. You cannot force him to suffer Fatigue or use a Potion, but you may force him to attack himself.', 99, 0, 0, '0'),
(312, 'Dark Fortune', 'Overlord', 'Basic', NULL, 'Play this card after you roll dice. You may reroll 1 die.', 99, 0, 0, '0'),
(313, 'Dark Fortune', 'Overlord', 'Basic', NULL, 'Play this card after you roll dice. You may reroll 1 die.', 99, 0, 0, '0'),
(314, 'Dark Might', 'Overlord', 'Basic', NULL, 'Play this card after you roll dice for an attack. Add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 99, 0, 0, '0'),
(315, 'Dark Might', 'Overlord', 'Basic', NULL, 'Play this card after you roll dice for an attack. Add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 99, 0, 0, '0'),
(316, 'Frenzy', 'Overlord', 'Basic', NULL, 'Play this card when activating a monster during your turn. That monster may perform an additional attack this turn in addition to its normal 2 actions.', 99, 0, 0, '0'),
(317, 'Frenzy', 'Overlord', 'Basic', NULL, 'Play this card when activating a monster during your turn. That monster may perform an additional attack this turn in addition to its normal 2 actions.', 99, 0, 0, '0'),
(318, 'Pit Trap', 'Overlord', 'Basic', NULL, 'Play this card when a hero enters an empty space. He tests Awareness. if he fails, he suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and loses 1 movement point. If he has no movement points to lose, such as if he suffered fatigue to move), he is Stunned.', 99, 0, 0, '0'),
(319, 'Poison Dart', 'Overlord', 'Basic', NULL, 'Play this card when a hero opens a door or searches. He tests Awareness or Might (your choice). If he passes, draw 1 Overlord card. If he fails, he suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, 1 Fatigue and he is Poisoned.', 99, 0, 0, '0'),
(320, 'Tripwire', 'Overlord', 'Basic', NULL, 'Play this card when a hero enters an empty space during a move action. He tests Awareness. If he fails, he must end his move action (he can still suffer Fatigue to move further, or perform a second move action if this was his first action).', 99, 0, 0, '0'),
(321, 'Tripwire', 'Overlord', 'Basic', NULL, 'Play this card when a hero enters an empty space during a move action. He tests Awareness. If he fails, he must end his move action (he can still suffer Fatigue to move further, or perform a second move action if this was his first action).', 99, 0, 0, '0'),
(322, 'Critical Blow', 'Overlord', 'Basic', NULL, 'Play this card when a monster attacks a hero, after rolling dice.<br /><br />This attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: +3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>', 99, 0, 0, '0'),
(323, 'Word of Misery', 'Overlord', 'Basic', NULL, 'Play this card at the start of your turn, each time a hero suffers any <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, he also suffers 1 Fatigue in addition to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> suffered.', 99, 0, 0, '0'),
(324, 'Dash', 'Overlord', 'Basic', NULL, 'Play this card when activating a monster during your turn. That monster may perform an additional move action this turn in addition to its normal 2 actions.', 99, 0, 0, '0'),
(325, 'Dash', 'Overlord', 'Basic', NULL, 'Play this card when activating a monster during your turn. That monster may perform an additional move action this turn in addition to its normal 2 actions.', 99, 0, 0, '0'),
(326, 'Befuddle', 'Overlord', 'Basic II', NULL, 'Play this card immediately after a hero passes an attribute test. The hero must reroll the test and add 1 Shield to the results.<br /><br />Scout: The hero also suffers 1 Fatigue.', 99, 0, 0, '2'),
(327, 'Befuddle', 'Overlord', 'Basic II', NULL, 'Play this card immediately after a hero passes an attribute test. The hero must reroll the test and add 1 Shield to the results.<br /><br />Scout: The hero also suffers 1 Fatigue.', 99, 0, 0, '2'),
(328, 'Blinding Speed', 'Overlord', 'Basic II', NULL, 'Play this card when activating a monster. Choose a hero to test both Knowledge and Awareness. If he passes both tests, draw 1 Overlord card. If he fails at least one test, the monster gains 2 movement points.<br /><br />Warrior: If he fails both tests, the monster gains <i>an additional</i> 4 movement points.', 99, 0, 0, '2'),
(329, 'Blinding Speed', 'Overlord', 'Basic II', NULL, 'Play this card when activating a monster. Choose a hero to test both Knowledge and Awareness. If he passes both tests, draw 1 Overlord card. If he fails at least one test, the monster gains 2 movement points.<br /><br />Warrior: If he fails both tests, the monster gains <i>an additional</i> 4 movement points.', 99, 0, 0, '2'),
(330, 'Dirty Fighting', 'Overlord', 'Basic II', NULL, 'Play this card when a monster attacks a hero, after rolling dice. Add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.<br /><br />Healer: This attack gains Pierce 1.', 99, 0, 0, '2'),
(331, 'Dirty Fighting', 'Overlord', 'Basic II', NULL, 'Play this card when a monster attacks a hero, after rolling dice. Add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.<br /><br />Healer: This attack gains Pierce 1.', 99, 0, 0, '2'),
(332, 'Flurry', 'Overlord', 'Basic II', NULL, 'Play this card when a monster attacks a hero, after rolling dice.<br /><br />This attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Perform an additional attack after resolving this attack. Add 1 additional green power die to the monster''s attack pool.', 99, 0, 0, '2'),
(333, 'Grease Trap', 'Overlord', 'Basic II', NULL, 'Play this card when a hero enters an empty space from an adjacent space. He tests Awareness. if he passes, he suffers 1 Fatigue.<br />If he fails, move the hero 3 spaces in a straight line in the same direction he last moved. For each space he cannot move, he suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or 1 Fatigue (your choice).<br /><br />Mage: If he fails, the hero is also Stunned.', 99, 0, 0, '2'),
(334, 'Mental Error', 'Overlord', 'Basic II', NULL, 'Play this card when a monster attacks a hero, after rolling dice. The hero tests Knowledge. If he passes, the hero suffers 1 Fatigue. If he fails, the attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Warrior: If he fails, the attack also gains 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.', 99, 0, 0, '2'),
(335, 'Mimic', 'Overlord', 'Basic II', NULL, 'Play this card when a hero searches, before revealing the search token. Place a fatigue token on the search token. The search token is now treated as a minion Volucrix Reaver. Once defeated, the search token is immediately revealed and is considered searched by the closest hero.<br />Scout: The Volucrix Reaver may perform an immediate Skirmish action.', 99, 0, 0, '2'),
(336, 'Overwhelm', 'Overlord', 'Basic II', NULL, 'Play this card during your turn on a hero adjacent to 4 or more monsters. He tests Willpower. If he passes, immediately perform an attack with 1 adjacent monster of your choice. If he fails, the hero is Stunned and Immobilized.', 99, 0, 0, '2'),
(337, 'Reflective Ward', 'Overlord', 'Basic II', NULL, 'Play this card when a hero attacks a monster, before rolling dice.<br /><br />The attacking hero may choose to suffer 2 Fatigue. If he cannot suffer the Fatigue, or chooses not to, he will be dealt <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> dealt to the monster.', 99, 0, 0, '2'),
(338, 'Sign of Weakness', 'Overlord', 'Basic II', NULL, 'Play this card when a hero performs a rest action. He tests Awareness. If he passes, draw 1 Overlord card. If he fails, each monster in that line of sight may move 1 space.<br /><br />Healer: If he fails, the hero is also Cursed.', 99, 0, 0, '2'),
(339, 'Uncontrolled Power', 'Overlord', 'Basic II', NULL, 'Play this card when a hero attacks a monster, after rolling dice. He tests Willpower. If he fails, you choose how he spends his <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results. You must spend as many <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results as possible and the attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Suffer 1 Fatigue.<br /><br />Mage: If he fails, the attack also gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Suffer 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 99, 0, 0, '2'),
(340, 'Uncontrolled Power', 'Overlord', 'Basic II', NULL, 'Play this card when a hero attacks a monster, after rolling dice. He tests Willpower. If he fails, you choose how he spends his <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results. You must spend as many <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results as possible and the attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Suffer 1 Fatigue.<br /><br />Mage: If he fails, the attack also gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Suffer 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 99, 0, 0, '2'),
(341, 'Retribution', 'Warrior', 'Marshal', NULL, 'Exhaust this card after a monster within 2 spaces of you resolves an attack that affects another hero. That monster suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 0, 1, '5'),
(342, 'Zealous Fire', 'Warrior', 'Marshal', NULL, 'Exhaust this card when the overlord plays an Overlord card. Recover 1 Fatigue.<br /><br />When you refresh this card, choose 1 monster within 2 spaces of you. That monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 0, '5'),
(343, 'Shockwave', 'Warrior', 'Marshal', NULL, 'Exhaust this card when you perform an attack with a Melee weapon with two hand icons, before dice are rolled. If that attack deals 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after the defense roll), each monster adjacent to your target suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 1, '5'),
(344, 'Just Reward', 'Warrior', 'Marshal', NULL, 'Exhaust this card when the overlord activates a monster group. While this card is exhausted, each time a monster that is in your line of sight and in that group resolves an attack that targets another hero within 3 spaces of you, you may force the overlord to discard 1 Overlord card from his hand at random after the attack.', 0, 1, 2, '5'),
(345, 'Vigilant Watch', 'Warrior', 'Marshal', NULL, 'Exhaust this card when a monster enters a space adjacent to you. While this card is exhausted, each time a monster moves out of a space within 2 spaces of you, that monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 1, '5'),
(346, 'I am the Law', 'Warrior', 'Marshal', NULL, 'Exhaust this card after a monster within 2 spaces of you resolves an attack that affects you. Perform an attack that targets that monster. Then, you may test Knowledge. if you pass, suffer 1 Fatigue, and that monster gains 1 condiition of your choice.', 0, 2, 0, '5'),
(347, 'By the Book', 'Warrior', 'Marshal', NULL, 'Exhaust this card when the overlord plays an Overlord card. Test Knowledge. Add Shields to the result equal to the experience cost of the Overlord card. If you pass, the overlord places that card facedown on the top of his Overlord deck without resolving its effect. If you fail, suffer 1 Fatigue.', 0, 2, 1, '5'),
(348, 'Last Stand', 'Warrior', 'Marshal', NULL, 'Exhaust this cardwhen a hero within 5 spaces of you is knocked out. Remove your figure from the map and place it in that hero''s space. Then, you may perform an attack.<br /><br />When this card refreshes, you may revive 1 knocked out hero in your space.', 0, 3, 2, '5'),
(349, 'Crushing Blow', 'Warrior', 'Marshal', NULL, 'Exhaust this card when a monster within 2 spaces of you and in your line of sight performs an attack that deals no <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Perform and attack with a Melee weapon with 2 hand icons that targets that monster. If you do, remove all defense dice from the target monster''s defense pool during this attack.', 0, 3, 0, '5'),
(350, 'Chosen Target', 'Scout', 'Bounty Hunter', NULL, 'Exhaust this card at the start of your turn to track a monster in your line of sight.<br /><br />Each time you perform an attack that targets a tracked monster, that attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (even while this card is exhausted).', 0, 0, 1, '5'),
(351, 'Lie in Wait', 'Scout', 'Bounty Hunter', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card<br />When this card is exhausted, you cannot perform actions, and you cannot move or be moved.<br /><br />When you refresh this card, perform an attack. This is in addition to your 2 normal actions. Add 1 additional yellow power die to your attack pool during this attack. ', 0, 1, 0, '5'),
(352, 'Not so Fast', 'Scout', 'Bounty Hunter', NULL, 'Use this card when a tracked monster in your line of sight performs a move action.<br /><br />Reduce that monster''s movement points by 1 (to a minimum of 1). You may immediately move 2 spaces.', 0, 1, 1, '5'),
(353, 'Longshot', 'Scout', 'Bounty Hunter', NULL, 'Exhaust this card when you perform an attack with a Bow weapon, before dice are rolled. If the target is 5 or more spaces away from you, that attack gains +3 Range and +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 1, '5'),
(354, 'Evil Eye', 'Scout', 'Bounty Hunter', NULL, 'Exhaust this card at the end of your turn and choose 1 tracked monster. <br />That monster is Doomed.<br /><br />Exhaust this card at the end of your turn and choose 1 Doomed monster that is tracked. That monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 0, '5'),
(355, 'Undercover', 'Scout', 'Bounty Hunter', NULL, 'Exhaust this card at the end of your turn if you did not perform an attack that turn. While this card is exhausted add 1 additional grey die to your defense pool. <br /><br />When you refresh this card, gain 3 movement points.', 0, 2, 0, '5'),
(356, 'Dark Iron Chains', 'Scout', 'Bounty Hunter', NULL, 'Use this card when a tracked monster in your line of sight performs an attack, after dice are rolled; X is equal to the number of <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> results. Then, test Awareness. If you pass, that monster cannot spend <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> during that attack.', 0, 2, 10, '5'),
(357, 'Payday', 'Scout', 'Bounty Hunter', NULL, 'Exhaust this card after you defeat a master monster.<br />The overlord must choose 1 search token on the map. Search that search token. Place 1 hero token on that monster''s card as a reminder.<br /><br />This card cannot be used on the same monster group twice during the same encounter.', 0, 3, 0, '5'),
(358, 'Rapid Fire', 'Scout', 'Bounty Hunter', NULL, 'Use this card after you use a Bow weapon to defeat a tracked monster to move up to 2 spaces. Then, choose 1 monster in your line of sight. Perform an additional attack that targets that monster. Then, if you do not defeat that monster, track that monster.', 0, 3, 1, '5'),
(359, 'Unbroken', 'Overlord', 'Overlord Reward', NULL, 'Play this card on 1 monster at the end of your turn. Until the start of your next turn, each time that monster suffers 3 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, it suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> instead.', 98, 0, 0, '5'),
(360, 'Down and Out', 'Overlord', 'Overlord Reward', NULL, 'Play this card when a hero performs a revive action, before dice are rolled. That hero or the knocked-out hero immediately tests Might, the heroes'' choice. if the chosen hero fails, the knocked out hero does not recover any <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and remains knocked-out. If the chosen hero passes, draw 1 Overlord card.', 98, 0, 0, '5'),
(361, 'Endless Supply', 'Overlord', 'Overlord Reward', NULL, 'Play this card at the start of your turn. if you startd this quest with 20 or more cards in your Overlord deck, draw 4 Overlord cards.', 98, 0, 0, '5'),
(362, 'Unseen Wings', 'Overlord', 'Overlord Reward', NULL, 'Play this card during your turn and choose 1 monster group. Move up to 3 monsters in that group up to 3 spaces.', 98, 0, 0, '7'),
(363, 'Forgotten Sorcery', 'Overlord', 'Overlord Reward', NULL, 'Play this card when you activate a monster group with the Ranged attack type. Until the end of the round, each monster in that group gains:<br /><br />Sorcery 2: After making an attack roll, this monster may convert up to 2 range to <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, or up to 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to range.', 98, 0, 0, '6'),
(364, 'Power in Numbers', 'Overlord', 'Overlord Reward', NULL, 'Play this card during your turn and choose a map tile. If there are more monsters on that map tile than heroes, each hero on that tile suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 2 Fatigue, and each monster on that tile recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 98, 0, 0, '9'),
(365, 'Fire Gems', 'Overlord', 'Overlord Reward', NULL, 'Play this card when a hero enters an empty space.<br />He tests Awareness. If he fails, roll 1 red power die. That hero and each figure adjacent to him suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> rolled.', 98, 0, 0, '8'),
(366, 'Healing Aura', 'Ally', 'Serena', 'health,4', 'This ally gains +4 Health<br /><br />Soothing spirit now affects all heroes within 3 spaces of this ally.', 97, 0, 0, '2'),
(367, 'Aura of Might', 'Ally', 'Serena', 'defense,G', 'This ally adds 1 additional gray die to her defense pool.<br /><br />After using Soothing Spirit, each monster within 3 spaces of this ally is dealt 3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Each monster rolls defense dice seperately. This is not considered an attack.', 97, 0, 0, '2'),
(368, 'Holy Hammer', 'Ally', 'Serena', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: This ally performs a Ranged attack rolling the dice shown below.<br /><br />This attack affects a second monster within 3 spaces of the target. This ally must have line of sight to the second monster.<br /><br />Ranged, Blue, Red, Green', 97, 0, 0, '2'),
(369, 'Sharp Eyes', 'Ally', 'Raythen', 'speed,1;defense,B', 'This ally gains +1 Speed and adds 1 additional brown defense die to his defense pool.<br /><br />This ally may now use Investigate while within 3 spaces of a space containing a search token.', 97, 0, 0, '2'),
(370, 'Back Strike', 'Ally', 'Raythen', 'health,4', 'This ally gains +4 Health.<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: This ally performs an attack. This attack must target a monster adjacent to another hero and the attack gains +3 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 97, 0, 0, '2'),
(371, 'Night Prowler', 'Ally', 'Raythen', NULL, 'Exhaust this card when activating this ally. This ally may only perform move actions or the Investigate action during this activation.<br /><br />While this card is exhausted, this ally cannot be targeted by monster attacks or Overlord cards unless he is adjacent to 3 or more monsters.', 97, 0, 0, '2'),
(372, 'Song of Mending', 'Healer', 'Bard', NULL, 'Use this card during your turn to place a song token on this card.<br /><br />Melody: At the end of your turn, each hero within 3 spaces of you recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Harmony: At the end of your turn, each other hero within 3 spaces of you recovers 1 Fatigue.', 0, 0, 2, '4'),
(373, 'Dissonance', 'Healer', 'Bard', NULL, 'Use this card during your turn to place a song token on this card.<br /><br />Melody: If a hero starts his turn within 3 spaces of you, he gains 1 movement point.<br /><br />Harmony: If a monster within 3 spaces of you is activated, it suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 2, '4'),
(374, 'Understudy', 'Healer', 'Bard', NULL, 'Use this card during your turn to place a song token on this card.<br /><br />Melody: Each time a hero within 3 spaces of you recovers 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, he recovers 1 additional 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Harmony: Each time a hero within 3 spaces of you recovers 1 or more Fatigue, he recovers 1 additional Fatigue.', 0, 1, 1, '4'),
(375, 'Peaceful Rest', 'Healer', 'Bard', NULL, 'If a hero within 3 spaces of you recovers Fatigue as the result of a rest action, he recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> in addition to the Fatigue.', 0, 1, 0, '4'),
(376, 'Aria of War', 'Healer', 'Bard', NULL, 'Use this card during your turn to place a song token on this card.<br /><br />Melody: If a hero within 3 spaces of you is attacked, he adds 1 Shield to his defense results.<br /><br />Harmony: If a hero within 3 spaces of you performs an attack, his attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 2, '4'),
(377, 'Rehearsal', 'Healer', 'Bard', NULL, 'Use this card during your turn to place a song token on this card.<br /><br />Melody: At the end of your turn, choose 1 hero within 3 spaces of you. he may discard 1 Condition card.<br /><br />Harmony: Each hero within 3 spaces of you may reroll 1 die once per round.', 0, 2, 1, '4'),
(378, 'Concentration', 'Healer', 'Bard', NULL, 'At the start of your turn, if both of your song tokens are on different Class cards, you recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.<br /><br />Exhaust this card when a hero within 3 spaces of you recovers 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br />That hero recovers 2 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 1, '4'),
(379, 'Cacophony', 'Healer', 'Bard', 'stamina,1', 'Apply +1 to your Stamina (even while this card is exhausted).<br /><br />Exhaust this card and choose 1 of your Class cards. While this card is exhausted, the Melody and Harmony effects of the chosen card trigger.', 0, 3, 3, '4'),
(380, 'Wayfarer', 'Healer', 'Bard', 'health,2', 'Apply +2 to your Health.<br /><br />All of your Melody and Harmony effects apply within 5 spaces instead of 3 spaces.<br /><br />Each time you place a song token on one of your Class cards, you may move 1 space.', 0, 3, 0, '4'),
(381, 'Mirror Image', 'Mage', 'Conjurer', NULL, 'Use this card and suffer Fatigue equal to the number of image tokens on the map. Then, place 1 image token in an empty space within 2 spaces of your figure.<br /><br />An image token is treated as a hero figure with your attributes and a grey defense die. If an image token suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> or Fatigue, it is discarded, and you suffer 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 0, 0, 0, '4'),
(382, 'Channeling', 'Mage', 'Conjurer', NULL, 'You may discard any number of image tokens at any time during your turn.<br /><br />You may spend 1 movement point during your turn to move an image token 1 space.<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon. Measure range and line of sight from one of your image tokens.', 0, 0, 0, '4'),
(383, 'Many Friends', 'Mage', 'Conjurer', NULL, 'If you are adjacent to 1 or more image tokens, add 1 additional brown die to your defense pool. <br /><br />If there are 3 or more image tokens on the map, add 1 additional green power die to your attack pool.', 0, 1, 0, '4'),
(384, 'Refraction', 'Mage', 'Conjurer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to place 1 image token in an empty space within 3 spaces of another image token.<br />Then, you may perform an attack with a Magic weapon.<br />If you do, measure range and line of sight from one of those image tokens.', 0, 1, 2, '4'),
(385, 'Illusory Path', 'Mage', 'Conjurer', NULL, 'Monsters must spend 1 additional movement point to enter a space adjacent to an image token.<br /><br />Each time you suffer 1 Fatigue to gain 1 movement point you may move an image token 1 space.', 0, 1, 0, '4'),
(386, 'Sleight of Mind', 'Mage', 'Conjurer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Choose 1 image token within 5 spaces of your figure and remove your figure from the map.<br />Replace the chosen image token with your figure and discard the token. Then, each monster adjacent to your figure is Stunned.', 0, 2, 2, '4'),
(387, 'Focus Fire', 'Mage', 'Conjurer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack with a Magic weapon. This attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each image token within 3 spaces of the target.', 0, 2, 2, '4'),
(388, 'Blinding Light', 'Mage', 'Conjurer', NULL, 'Exhaust this card when you are attacked, before dice are rolled, to add 2 Shields to your defense results. After the attack resolves, place an image token in an empty space adjacent to your figure. If this attack did not deal at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> (after the defense roll), you may move up to 2 spaces.', 0, 2, 2, '4'),
(389, 'Vortex', 'Mage', 'Conjurer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card and choose an image token on the map. Move each monster within 3 spaces of that image token up to 2 spaces. Each monster must end its movement within 3 spaces of the image token. Each of those monsters suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 3, 2, '4'),
(390, 'Prismatic Assualt', 'Mage', 'Conjurer', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card.<br />For each image token on the map, you may either move move the image token up to your Speed or perform an attack with a Magic weapon. If you perform an attack, measure range and line of sight from the image token.', 0, 3, 3, '4'),
(391, 'Dual Strike', 'Warrior', 'Skirmisher', NULL, 'Exhaust this card when you perform an attack, before dice are rolled. If you have 2 Melee weapons with 1 hand icon each equipped, add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results. You may use the <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> abilities on both weapons during the attack.', 0, 0, 2, '4'),
(392, 'Deep Wounds', 'Warrior', 'Skirmisher', NULL, 'Exhaust this card when you resolve an attack that deals at least 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> to a monster (after the defense roll). That monster suffers 1 additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and is Bleeding.', 0, 1, 1, '4'),
(393, 'Back in Action', 'Warrior', 'Skirmisher', 'health,2', 'Apply +2 to your Health.<br /><br />Each time you stand up or are revived by another hero, you may immediately move up to your Speed.', 0, 1, 0, '4'),
(394, 'Keen Edge', 'Warrior', 'Skirmisher', NULL, 'Each attack you perform with a Blade or Axe weapon gains Pierce 1.', 0, 1, 0, '4'),
(395, 'Born in Battle', 'Warrior', 'Skirmisher', NULL, 'Each time you defeat a monster with an attack using a Melee weapon with 1 hand icon, you recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.', 0, 2, 0, '4'),
(396, 'Unrelenting', 'Warrior', 'Skirmisher', NULL, 'Exhaust this card after resolving an attack with a Melee weapon with 1 hand icon. Perform an attack that targets one of the monsters with a different Melee weapon with 1 hand icon.', 0, 2, 1, '4'),
(397, 'Ever in Motion', 'Warrior', 'Skirmisher', NULL, 'When you are knocked out, you may place your hero token in an empty space within 3 spaces of your hero figure (even while this card is exhausted).<br /><br />Exhaust this card at the start of your turn to discard a Stunned or Immobilized Condition card.', 0, 2, 1, '4'),
(398, 'Carve a Path', 'Warrior', 'Skirmisher', 'speed,1', 'Apply +1 to your speed.<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Move up to your Speed, then perform an attack. During this movement, you may move through spaces containing enemy figures. This attack affects each monster you moved through during this action.', 0, 3, 3, '4'),
(399, 'Unstoppable', 'Warrior', 'Skirmisher', 'stamina,1', 'Apply +1 to your stamina.<br /><br />Each time you perform an attack with a Melee weapon, after dice are rolled, you may change each X result to another result of your choice.', 0, 3, 0, '4'),
(400, 'Soul Bound', 'Scout', 'Shadow Walker', NULL, 'Use this card when you perform an attack that is not a miss.<br />Place a Shadow Soul in any space adjacent to the target.<br />Only 1 Shadow Soul can be on the map at any time.', 0, 0, 1, '4'),
(401, 'Dark Servant', 'Scout', 'Shadow Walker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to search a search token within 3 spaces of a Shadow Soul. Then, discard that Shadow Soul.', 0, 1, 0, '4'),
(402, 'Faithful Friend', 'Scout', 'Shadow Walker', NULL, 'Exhaust this card at the start of your turn to place a Shadow Soul in a space within 3 spaces of you.', 0, 1, 0, '4'),
(403, 'Through the Veil', 'Scout', 'Shadow Walker', NULL, 'Exhaust this card when you perform an attack that targets a monster in a space containing or adjacent to a Shadow Soul, before dice are rolled. Add 1 additional green power die to you attack pool.', 0, 1, 1, '4'),
(404, 'Endless Void', 'Scout', 'Shadow Walker', NULL, 'Each time a Shadow Soul is discarded due to your class skills, you recover 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and 1 Fatigue.<br /><br />If a hero figure in a space containing a Shadow Soul is the target of an attack, that attack is a miss unless the attacker spends 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.', 0, 2, 0, '4'),
(405, 'Dark Shift', 'Scout', 'Shadow Walker', 'stamina,1', 'Apply +1 to your Stamina.<br /><br />Each time a hero enters a space containing a Shadow Soul, that hero gains 1 movement point.', 0, 2, 0, '4'),
(406, 'Otherwordly', 'Scout', 'Shadow Walker', NULL, 'Each attack that target a monster in a space containing or adjacent to a Shadow Soul gains Pierce 1.<br /><br />Each time you spend 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to recover 1 Fatigue, your attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 0, '4'),
(407, 'Shadow Puppet', 'Scout', 'Shadow Walker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to choose a monster within 3 spaces of a Shadow Soul. Perform an attack with that Shadow Soul, using the attack type, dice, and surge abilities of that monster.', 0, 3, 3, '4'),
(408, 'Shadow Step', 'Scout', 'Shadow Walker', NULL, '<span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Exhaust this card to place your hero figure in a space that contains a Shadow Soul. Then, you may discard that Shadow Soul to perform an attack. if you do, add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the results.', 0, 3, 1, '4'),
(409, 'Placebo', 'Overlord', 'Universal', NULL, 'Play this card at the start of any turn and choose a faceup Search card in a hero''s play area. Flip that Search card facedown.', 0, 1, 0, '4'),
(410, 'Upgrade', 'Overlord', 'Universal', NULL, 'Play this card during your turn and discard any 1 card from your hand. Search your Overlord deck for 1 card of your choice with the same trait (Event, Magic, Trap) as the discarded card. Reveal the chosen card and place it in your hand. Then shuffle your Overlord deck.', 0, 1, 0, '4'),
(411, 'Diverse Means', 'Overlord', 'Universal', NULL, 'Play this card when a monster is attacked, defense dice are rolled. Reveal any number of Overlord cards from your hand. That monster recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and adds 1 Shield to his defense results for each non-Basic Overlord card you reveal.', 0, 2, 0, '4'),
(412, 'Solidarity', 'Overlord', 'Universal', NULL, 'Play this card at the start of your turn and choose 1 Hero sheet. Until the start of your turn, each time any hero tests an attribute, he must use the attribute value on that hero sheet.', 0, 1, 0, '4'),
(413, 'Refresh', 'Overlord', 'Universal', NULL, 'Play this card during your turn to shuffle the Overlord discard pile into the Overlord deck. Then, draw 1 Overlord card.', 0, 1, 0, '4'),
(414, 'Out of Darkness', 'Overlord', 'Shadowmancer', NULL, 'Play this card when a hero is revived. Immediately perform an attack with that hero as if he were one of your monsters. This attack must target another hero.', 0, 1, 0, '4'),
(415, 'Mistrust', 'Overlord', 'Shadowmancer', NULL, 'Play this card at the end of your turn. Until the start of your next turn, each time a hero enters a space adjacent to another hero, the first hero suffers 1 Fatigue.', 0, 1, 0, '4'),
(416, 'Imploding Rift', 'Overlord', 'Shadowmancer', NULL, 'Play this card when a hero enters an empty space. That hero and each hero adjacent to him tests Willpower. Each hero who fails suffers Fatigue up to his Stamina.', 0, 1, 0, '4'),
(417, 'Shadow of Doubt', 'Overlord', 'Shadowmancer', NULL, 'Play htis card at the end of your turn and choose 1 hero. Next round, that hero takes his turn after all other heroes have taken their turns.', 0, 1, 0, '4'),
(418, 'Shadow Walk', 'Overlord', 'Shadowmancer', NULL, 'Play this card when you activate a monster. During this activation, that monster gains:<br /><br />Fly: This figure may ignore enemy figures and the effects of terrain while moving. It must end its movement in an empty space following normal movement rules.', 0, 2, 0, '4'),
(419, 'Black Out', 'Overlord', 'Shadowmancer', NULL, 'Play this card at the end of your turn. Until the start of your next turn, monsters cannot be targeted by an attack unless the attacking hero is within 2 spaces of them.', 0, 2, 0, '4'),
(420, 'Treacherous Shadows', 'Overlord', 'Shadowmancer', NULL, 'Play this card at the start of your turn. Each hero tests Willpower. For each hero who fails, you may perform an attack with that hero as if he were one of your monsters. You can force him to attack himself.', 0, 3, 0, '4'),
(421, 'The Hero', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +2 to its Health per hero and adds 1 additional black die to its defense pool. The master changeling also gains:<br /><br />Corruption: When this monster performs an attack, choose a hero in it''s line of sight. Then, choose 1 of that hero''s weapons. The monster may perform the attack using the attack type, dice, and abilities of that weapon.', 4, 0, 0, '4'),
(422, 'The Scoundrel', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +1 to its Health per hero, adds 1 additional brown defense die to its defense pool, and gains 3 movement points each time it activates. The master changeling also gains:<br /><br />Ravage: Both of this monster''s actions on a turn may be attack actions.', 4, 0, 0, '4'),
(423, 'The Guardsman', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +2 to its Health per hero and adds 1 additional black die to its defense pool. The master changeling also gains:<br /><br />Shambling: This monster may not perform more than 1 move action during a single turn.', 4, 0, 0, '4'),
(424, 'The Siren', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +2 to its Health per hero and gains the Ranged icon. The master changeling also gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> Call: Each monster within 3 spaces of this monster recovers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, and each hero within 3 spaces of this monster suffers 1 Fatigue.', 4, 0, 0, '4'),
(425, 'The Scholar', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />Each minion changeling within 5 spaces of the master changeling adds 1 additional gray die to its defense, and each of tis attacks gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. The master changeling gains:<br /><br />Hidden: Each time this monster is the target of an attack, the attack is a miss unless the attacker spends 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>.', 4, 0, 0, '4'),
(426, 'The Magistrate', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +1 to its Health per hero and adds 1 additional gray die to its defense pool.<br /><br />THe master changeling''s Hideous Laughter ability affects heroes within 5 spaces instead of 3 spaces.', 4, 0, 0, '4'),
(427, 'The Mage', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +1 to its Health per hero, gains the Ranged icon, and adds 1 additional die to its attack pool. The master changeling also gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> Blast: This attack affects all figures adjacent to the target space.', 4, 0, 0, '4'),
(428, 'The Executioner', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +2 to its Health per hero. The master changeling gains:<br /><br />Coup De Grace: This attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each condition or token in the target''s play area.', 4, 0, 0, '4'),
(429, 'The Civilian', 'Overlord', 'Corrupt Citizen', NULL, 'Play this card when a master changeling is placed on the map.<br /><br />The master changeling applies +2 to its Health per hero and adds 1 additional brown die to its defense pool.', 4, 0, 0, '4'),
(430, 'Friend or Foe', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card at the end of your turn and choose 1 monster. Until the start of your next turn, a hero cannot declare that monster as the target of an attack if there is another monster within 3 spaces of that monster.<br /><br />Place 1 threat token from the supply on that monster''s base as a reminder.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 0, 1, '22'),
(431, 'Thieves'' Guild', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card after setup of an encounter to look at the top 3 cards of the Search deck. Place 2 of those cards on top of the search deck in the order of your choice and place the remaining card on the bottom of the Search deck.', 1, 2, 1, '22'),
(432, 'Merchants'' Guild', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card during the Shopping step of the Campaign phase, after revealing the Shop Item cards, and discard 1 threat token to choose 1 Shop Item card. That card costs an additional 50 gold to purchase.', 1, 2, 0, '22'),
(433, 'Shadow Council', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card after setup of the first encounter of each quest and place up to 3 Overlord cards from your hand facedown under this card. Gain 1 threat token for each card placed under this card. While this card is exhausted, you cannot use cards under this card. When you refresh this card, discard all cards under this card.<br /><br />This card does not refresh as normal. Refresh this card at the end of the first encounter.', 1, 2, 1, '22'),
(434, 'Traiterous Friend', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card when a hero starts his turn. That hero tests Willpower. if he fails, he suffers Fatigue equal to his Willpower. If he passes, gain 2 threat tokens.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 1, '22'),
(435, 'False Information', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card at the end of the Travel step of the Campaign phase. The heroes choose 1 hero to test Awareness. If he fails the heroes return to the location in which they started this Travel step and perform a second Travel step.', 1, 3, 0, '22'),
(436, 'Deceitful Scribe', 'Overlord', 'Inner Corruption', NULL, 'Use this card during the Spend Experience Points step of the Campaign phase. You receive 1 XP. Then, return this card to the game box.', 1, 3, 0, '22'),
(437, 'Mages'' Guild', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card when a hero tests Willpower and fails. Immediately move that hero up to his Speed. The, perform an attack with that hero as if he were 1 of your monsters.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 4, 1, '22'),
(438, 'One of Us', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card at the end of your turn. Each hero tests Knowledge. Each hero who fails suffers 1 Fatigue. If 2 or more heroes fail, draw 1 Overlord card. If 3 or more heroes fail, 1 of those heroes is Stunned, your choice. if 4 or more heroes fail, gain 1 threat token.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 2, '22'),
(439, 'Summon Rylan Olliven', 'Overlord', 'Inner Corruption', NULL, 'Exhaust this card after setup of an encounter and choose 1 open monster group. Replace 1 master and 1 minion monster in that group with the Rylan Olliven agent. If the Rylan Olliven agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in the ''Shadow of Nerekhall'' campaign.', 1, 3, 2, '22'),
(440, 'Wild Energy', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card when a master monster performs an attack, before dice are rolled, to add 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> to the attack results. When you exhaust this card, you may discard 1 threat token.<br /><br />After resolving that attack, if you did not discard 1 threat token and that attack did not deal 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, discard 1 threat token and the monster that attacked is defeated.', 1, 0, 0, '23'),
(441, 'Pariah', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card during your turn and choose 1 monster group. Place this card near that group''s Monster card. While this card is exhausted, you may activate 1 master monster of the chosen group during any other monster group''s activation instead of the chosen group''s activation.', 1, 2, 0, '23'),
(442, 'Explosive Fall', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card when a monster is defeated. Each figure within 3 spaces of that monster suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 2, 1, '23'),
(443, 'Mortal Coil', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card when a master monster is defeated to place 1 fatigue token in its space. At the start of your next turn, replace the fatigue token with a master monster in the same group as the defeated monster, respecting group limits.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 2, 2, '23'),
(444, 'Power and Sacrifice', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card when a master monster performs an attack, before dice are rolled. That monster may suffer up to 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. If it does, that attack deals additional <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> suffered. That monster cannot do this if suffering the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> would defeat it.', 1, 3, 0, '23'),
(445, 'Descend to Madness', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card at the end of your turn. Each hero tests Knowledge or Willpower, your choice, in an order of your choice. Each time a hero fails, gain 1 threat token. If a hero passes, all heroes after that hero do not test.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 1, '23');
INSERT INTO `tbskills` (`skill_id`, `skill_name`, `skill_type`, `skill_class`, `skill_special`, `skill_text`, `skill_plot`, `skill_cost`, `skill_stamina_cost`, `skill_expansion`) VALUES
(446, 'Love of Chaos', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card during your turn and choose 1 master monster on the map. That monster is immediately defeated, and you gain 2 threat tokens. If that monster is a large monster, you gain 1 additional threat token.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 3, 1, '23'),
(447, 'Onslaught', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card at the start of your turn and choose 1 monster group. Place this card near the chosen group''s Monster card. While this card is exhausted, each monster in the chosen group gains:<br /><br />Ravage: Both of this monster''s actions on a turn may be attack actions.', 1, 3, 2, '23'),
(448, 'Soul Ensnare', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card at the end of your turn. While this card is exhausted, each time a knocked-out hero recovers 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, each hero within 3 spaces of that hero suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 3, 1, '23'),
(449, 'Summon Tristayne Olliven', 'Overlord', 'Unstable Forces', NULL, 'Exhaust this card after setup of an encounter and choose 1 open monster group. Replace 1 master and 1 minion in that group with the Tristayne Olliven agent.<br /><br />If the Tristayne Olliven agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in the ''Shadow of Nerekhall'' campaign.', 1, 3, 2, '23'),
(450, 'Mouths to Feed', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card when a monster with 4 or less health defeats a hero. Gain 1 threat token.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.<br /><br />After transitioning to Act II, Plot cards that require monsters with 4 or less Health require monsters with 6 Health instead (even while this card is exhausted).', 1, 0, 0, '24'),
(451, 'Infestation', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card when you place a monster as a reinforcement. Place 1 minion monster with 4 or less Health from the same monster group in an empty space adjacent to that monster, respecting group limits.', 1, 2, 1, '24'),
(452, 'In Every Shadow', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card and discard 1 Trap Overlord card from your hand when a hero declares an open door or search action. That hero tests Awareness. If he fails, perform an attack that targets that hero with 1 monster with 4 or less Health that is on the map, ignoring range and line of sight.', 1, 2, 0, '24'),
(453, 'Envious Swarm', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each monster with 4 or less Health gains:<br /><br /><span class=''glyphicon glyphicon-share-alt'' aria-hidden=''true''></span>: Perform an attack that targets 1 hero with 1 or more Relic cards equipped. This attack gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 1, 2, 1, '24'),
(454, 'Flee the Light', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card at the end of your turn. Until the start of your next turn, each monster with 4 or less Health gains:<br /><br />Skittish: Each time a hero within 3 spaces of this monster suffers 1 Fatigue to gain 1 movement point, this monster may immediately move 1 space.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 1, '24'),
(455, 'Ignoble Sacrifice', 'Overlord', 'Unseen Legions', NULL, 'Use this card when more than 1 monster in a monster group is affected by an attack. Before damage is dealt, choose 1 monster affected by that attack. That monster suffers all damage all other monsters in its group would suffer from that attack.', 1, 2, 1, '24'),
(456, 'Initiation', 'Overlord', 'Unseen Legions', NULL, 'Use this card when a minion monster with 4 or less health knocks out a hero. Until that monster is defeated, it uses the characteristics, abilities, and dice of the master monster (not including an agent) in its group. Place 1 threat token on that monster''s base as a reminder.', 1, 3, 1, '24'),
(457, 'Into the Shadows', 'Overlord', 'Unseen Legions', NULL, 'Use this card when you activate a monster with 4 or less Health. Instead of performing actions, remove that monster from the map and place it on this card. Each monster on this card still counts toward the group limit of its monster group.<br /><br />When a hero declares a rest action, you must place each monster on this card in an empty space adjacent to that hero. Then, each of those monsters may perform an attack that targets that hero.', 1, 3, 1, '24'),
(458, 'Always Watching', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card at the start of an encounter. While this card is exhausted, at the start of each overlord turn, you may look at the top card of the Overlord deck. Then, place that card on the top or bottom of the Overlord deck.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 4, 1, '24'),
(459, 'Summon Verminous', 'Overlord', 'Unseen Legions', NULL, 'Exhaust this card after setup of an encounter and choose 1 open monster group. Replace 1 master monster in that group with the Verminous agent.<br /><br />If the Verminous agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in any quest that uses the Verminous lieutenant.', 1, 3, 2, '24'),
(460, 'Inferno', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card when a monster performs an attack, before dice are rolled. That attack affects all figures adjacent to the target.<br /><br />After that attack resolves, if that monster has the Hot monster trait, it recovers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to the number of figures affected by the attack.', 1, 0, 2, '25'),
(461, 'Enkindle', 'Overlord', 'Burning Ambition', NULL, 'Use this card after setup of an encounter and choose 1 monster group. During this encounter, that group gains the Hot monster trait.<br /><br />Place 1 threat token from the supply on that group''s Monster card as a reminder.', 1, 1, 1, '25'),
(462, 'Taste of the Forbidden', 'Overlord', 'Burning Ambition', NULL, 'A hero may exhaust this card when he performs an attack, before dice are rolled. if he does, that attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>, and you gain 1 threat token.', 1, 2, 0, '25'),
(463, 'Scorching Presence', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card after setup of an encounter. While this card is exhausted, each time a hero enters a space adjacent to at least 1 monster with the Hot monster trait, that hero suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 1, '25'),
(464, 'Shifting Earth', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card at the start of your turn and choose a space on the map. Each hero within 3 spaces of the chosen space tests Might or Awareness, your choice. Move each hero that fails 2 spaces.', 1, 2, 1, '25'),
(465, 'Ynfernael Bonds', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card when a monster performs an attack. You may measure range and line of sight from one of the other monsters in that monster''s group for that attack.', 1, 2, 1, '25'),
(466, 'Demon''s Bargain', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card at the end of your turn and choose 1 knocked-out hero and an amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and Fatigue. That hero may choose to immediately recover that amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and Fatigue. if he does, you gain 3 threat tokens.<br /><br />This card does not refresh as normal. Refresh this card if the hero chooses not to recover the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and Fatigue or at the end of each quest.', 1, 3, 0, '25'),
(467, 'Blazing Rage', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card when you activate a monster. That monster may perform 1 additional attack action this turn in addition to its normal 2 actions. At the end of the monster''s activation, it suffers 2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each attack it performed this turn.<br /><br />If that monster has the Hot monster trait, you may reroll 1 die during each attack the monster performs this turn.', 1, 3, 1, '25'),
(468, 'Crushing Exhaustion', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card at the end of your turn. Each hero tests Might or Willpower, your choice. Place 1 threat token from the supply on the Hero sheet of each hero who fails. A hero with a threat token on his Hero sheet suffers Fatigue equal to his Stamina at the end of his turn. Each time a hero performs a rest action, he may test Might or Willpower, his choice. He discards his threat token if he passes that test, or if he is defeated.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 3, 2, '25'),
(469, 'Summon Gargan Mirklace', 'Overlord', 'Burning Ambition', NULL, 'Exhaust this card after setup of an encounter and choose 1 open monster group. Replace that group with the Gargan Mirklace agent.<br /><br />If the Gargan Mirklace agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in the ''Shadow of Nerekhall'' campaign.', 1, 3, 2, '25'),
(470, 'Plague Release', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card when a hero who is Poisoned or Diseased is defeated.<br /><br />If that hero was Poisoned, each hero within 3 spaces tests Might. Each hero who fails is Poisoned.<br /><br />If that hero was Diseased, each hero within 3 spaces tests Willpower. Each hero who fails is Diseased.', 1, 0, 1, '21'),
(471, 'Infected', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card after setup of an encounter to choose one of your monster groups, and place this card near that group''s Monster card. While this card is exhausted, each master monster in that group gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Disease<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 1, 1, '21'),
(472, 'Envenom', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card after setup of an encounter to choose one of your monster groups, and place this card near that group''s Monster card. While this card is exhausted, each master monster in that group gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Poison<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 1, 1, '21'),
(473, 'Mass Mutation', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card at the start of your turn. Each hero discards all Condition cards from his play area. For each Condition card discarded, gain 1 threat token (to a maximum of 4).<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 2, 1, '21'),
(474, 'Affliction Aura', 'Overlord', 'Raging Infection', NULL, 'Use this card after setup of an encounter to choose a monster. Each hero that starts his turn within 5 spaces of that monster is Diseased.<br /><br />Place a threat token on the monster''s base as a reminder.', 1, 2, 2, '21'),
(475, 'Fetid Stench', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card when a hero passes an attribute test from a Poisoned or Diseased Condition card. That hero fails the test instead.', 1, 2, 1, '21'),
(476, 'Weakness Within', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card after setup of an encounter. While this card is exhausted, each time a hero fails an attribute test while Poisoned or Diseased, that hero suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> in addition to any other effects.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 2, 2, '21'),
(477, 'Weakened Spirit', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card when a hero is defeated to mark that hero with a threat token from the supply. Each marked hero applies -1 to his Willpower (to a minimum of 1) while he is Diseased and -1 to his Might (to a minimum of 1) while he is Poisoned.<br /><br />Discard all threat tokens on heroes at the end of the quest.', 1, 3, 1, '21'),
(478, 'Virulent Cloud', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card during your turn. Each hero with the Poisoned condition suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> and each hero with the Diseased condition suffers 1 Fatigue.<br /><br />This card does not refresh as normal. Refresh this card at the end of each encounter.', 1, 4, 1, '21'),
(479, 'Summon Bol''Goreth', 'Overlord', 'Raging Infection', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 2 minion monsters in the chosen group with the Bol''Goreth agent. If the Bol''Goreth agent is defeated, return this card to the Plot deck. You cannot use this card in a quest that uses the Bol''Goreth lieutenant.', 1, 3, 2, '21'),
(480, 'What Doesn''t Kill', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card when a monster suffers 1 or more <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. If that monster was not defeated, it recovers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. Mark that monster with a threat token from the supply. Each marked monster adds 1 brown die to its defense pool.', 1, 0, 1, '26'),
(481, 'Possessive Nature', 'Overlord', 'Twisted Soul', NULL, 'Use this card when you exhaust the ''Summon Skarn'' Plot card. Gain threat tokens equal to the number of relics in the play areas of the heroes and overlord. Then, return this card to the game box.', 1, 1, 0, '26'),
(482, 'Bitter Rage', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each time a monster marked with a threat token performs an attack, that attack gains +2 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 2, 1, '26'),
(483, 'Desolation', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each time a hero suffers 1 or more Fatigue, that hero suffers 1 additional Fatigue.<br /><br />This card does not refresh as normal. Refresh this card at the end of your turn.', 1, 2, 2, '26'),
(484, 'Thick Scars', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card at the start of your turn. While this card is exhausted, each monster marked with a threat token applies +2 to its Health.<br /><br />This card does not refresh as normal. Refresh this card at the end of each quest.', 1, 2, 1, '26'),
(485, 'Thunderous Fall', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card when a HUGE or MASSIVE monster suffers damage equal to its Health and is defeated. Each hero adjacent to that monster is Stunned.', 1, 2, 1, '26'),
(486, 'Delusional Path', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card when a hero enters an empty space that is 5 or more spaces away from each other hero. That hero tests Willpower. If he fails, you may immediately move him up to his Speed. Then, the active player continues his turn.', 1, 3, 1, '26'),
(487, 'Unknown Origin', 'Overlord', 'Twisted Soul', NULL, 'Use this card when you exhaust the ''Summon Skarn'' Plot card. Each hero tests Knowledge. For each hero who fails, you gain 1 threat token.', 1, 3, 0, '26'),
(488, 'Faithful Guardian', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card when the Skarn agent is defeated. Gain 3 threat tokens.', 1, 4, 0, '26'),
(489, 'Summon Skarn', 'Overlord', 'Twisted Soul', NULL, 'Exhaust this card after setup of an encounter to choose an open monster group. Replace 1 master and 2 minion monsters in that group with the Skarn agent.<br /><br />If the Skarn agent is defeated, return this card to your Plot deck.<br /><br />You cannot use this card in a quest that uses the Skarn lieutenant.', 1, 3, 2, '26'),
(490, 'Call of the Ravens', 'Overlord', 'Unkindness', NULL, 'When purchased, place this card in your play area. This card cannot be discarded or shuffled back into your deck.<br /><br />Exhaust this card at the sart of your turn and choose 1 monster. Place 1 Raven Flock Servant token in a space adjacent to that monster. Then, that monster suffers 4 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 0, '5'),
(491, 'Feast', 'Overlord', 'Unkindness', NULL, 'Play this card when a hero is defeated within 5 spaces of a servant and keep this card in your play area. That servant recovers all <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />That servant applies +3 to its Health while this card is in your play area.<br /><br />Discard this card if that servant is defeated.', 0, 1, 0, '5'),
(492, 'Ill Omen', 'Overlord', 'Unkindness', NULL, 'Play this card on 1 servant at the end of your turn and keep this card in your play area. This servant gains:<br /><br />Ominous: Each time a hero starts his turn within 3 spaces of this figure, he tests Willpower. If he fails, he is Doomed.<br /><br />Discard this card if this servant is defeated.', 0, 1, 0, '5'),
(493, 'Beneath the Shadow', 'Overlord', 'Unkindness', NULL, 'Play this card on 1 servant at the end of your turn and keep this card in your play area. This servant gains:<br /><br />Shadow: A hero adjacent to this monster that declares an attack must spend 1 <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> or that attack is a miss<br /><br />Discard this card if this servant is defeated.', 0, 1, 0, '5'),
(494, 'Beware', 'Overlord', 'Unkindness', NULL, 'Play this card on 1 servant at the end of your turn and keep this card in your play area. This servant gains:<br :><br />Skittish: Each time a hero within 3 spaces of this figure suffers 1 Fatigue to gain 1 movement point, this monster may move 1 space.<br /><br />Discard this card if this servant is defeated.', 0, 1, 0, '5'),
(495, 'Sudden Flurry', 'Overlord', 'Unkindness', NULL, 'Play this card when you activate a servant during your turn. Perform 1 additional attack with that servant. This attack affects each hero within 2 spaces of the servant.', 0, 2, 0, '5'),
(496, 'Imitation', 'Overlord', 'Unkindness', NULL, 'Play this card on 1 servant when a hero declares an attack that targets that servant. Immediately perform an attack that targets that hero, using the same attack type, special abilities, and dice of the weapon the hero declared for his attack.<br /><br />After this attack is resolved, if the hero was not defeated, he continues his attack.', 0, 2, 0, '5'),
(497, 'Envelop', 'Overlord', 'Unkindness', NULL, 'Play this card when 1 servant resolves an attack that defeats a hero. Remove his hero token from the map and place it on this card. If the servant is defeated (or if it is removed from the map for any reason), place the hero token in its space and discard this card. The hero cannot recover <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for any reason until thiis card is discarded.', 0, 3, 0, '5'),
(498, 'Dragonbone Pendant', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Each attack performed by a monster in this group gains +1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Discard this card if a monster in this group defeats a hero.', 0, 1, 0, '5'),
(499, 'Elixir of Stone', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Each time a monster in this group is attacked, add 1 Shield to the results.<br /><br />Each attack that targets a monster in this group gains:<br /><br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Discard ''Elixir of Stone.''', 0, 1, 0, '5'),
(500, 'Wristlet of Wind', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />After a monster in this group performs an attack, it may move 1 space.<br /><br />Discard this card if a monster in this group does not move 1 or more spaces during it''s activation.', 0, 1, 0, '5'),
(501, 'Rings of Zhol''alam', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Each time a monster in this group is defeated, each hero within 2 spaces of that monster suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.<br /><br />Discard this card if there are no monsters in this group on the map.', 0, 1, 0, '5'),
(502, 'Rune of the Phoenix', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Discard this card when a monster in this group suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to its Health. That monster immediately recovers 5 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 2, 0, '5'),
(503, 'Ward of Peace', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Discard all conditions from this monster group. Each monster in this group is immune to all conditions.<br /><br />Discard this card if a monster in this group spends a <span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span> result during an attack.', 0, 2, 0, '5'),
(504, 'Sign of the Last Zenith', 'Overlord', 'Enchanter', NULL, 'Play this card on 1 monster group during your turn and keep it in your play area.<br /><br />Each time an Enchanter Overlord card is discarded from another monster group, play that card on this monster group and keep it in your play area. Then draw an Overlord card.', 0, 3, 0, '5'),
(505, 'Blood Rage', 'Overlord', 'Warlord', NULL, 'Play this card at the end of your turn and choose a monster. That monster immediately performs 2 attack actions and is then defeated.', 0, 1, 0, '0'),
(506, 'Dark Fortitude', 'Overlord', 'Warlord', NULL, 'Play this card after rolling defense dice. Add 2 Shields to the results.', 0, 1, 0, '0'),
(507, 'No Rest for the Wicked', 'Overlord', 'Punisher', NULL, 'Play this card when a hero suffers 1 Fatigue to gain an additional movement point. Choose 1 monster to move 1 space immediately after the hero spends that movement point.<br /><br />Until the start of your turn, you may trigger this ability each time a hero suffers 1 Fatigue to gain an additional movement point.', 0, 1, 0, '1'),
(508, 'Trading Pains', 'Overlord', 'Punisher', NULL, 'Play this card on a hero when he would recover any amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>. In response to this card, the hero may choose to reduce the amount of <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> he recovers.<br /><br />Another hero of your choice within 3 spaces of that hero suffers <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> equal to half (rounded up) the <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> recovered.', 0, 1, 0, '1'),
(509, 'Word of Pain', 'Overlord', 'Magus', NULL, 'Play this card at the end of your turn. Each hero tests Might. Each hero who fails suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span>.', 0, 1, 0, '0'),
(510, 'Unholy Ritual', 'Overlord', 'Magus', NULL, 'Play this card at the start of your turn. Choose one of your monster groups and draw Overlord cards equal to the number of figures from that group on the map. Choose and keep 2 cards and discard the rest. Each monster in that group performs 1 less action during this turn.', 0, 1, 0, '0'),
(511, 'Explosive Runes', 'Overlord', 'Saboteur', NULL, 'Play this card after a hero opens a door or searches.<br />That hero, and each hero within 2 spaces of him tests Awareness. Each hero who fails suffers 1 <span class=''glyphicon glyphicon-heart'' aria-hidden=''true''></span> for each Shield rolled in excess of his Awareness.', 0, 1, 0, '0'),
(512, 'Web Trap', 'Overlord', 'Saboteur', NULL, 'Play this card when a hero enters an empty space. That hero and each hero adjacent to him tests Might. Each hero who fails is Immobilized.', 0, 1, 0, '0'),
(513, 'Hard Knocks', 'Overlord', 'Overlord Reward', NULL, 'Play this card when a monster attacks a hero, after rolling dice.<br /><br />This attack gains:<br /><span class=''glyphicon glyphicon-flash'' aria-hidden=''true''></span>: Remove the target from the map, then place him on any empty space within 3 spaces of his original space. He counts as entering that space and is Stunned.', 98, 0, 0, '27'),
(514, 'Plan Ahead', 'Overlord', 'Universal', NULL, 'Play this card on your turn. Look at the top 5 cards of the Overlord deck and place them on top of the deck in the order of your choice.', 0, 1, 0, '0'),
(515, 'Dark Remedy', 'Overlord', 'Universal', NULL, 'Play this card on a monster group during your turn and choose 1 condition. Each monster in that group may discard 1 token corresponding to the chosen condition.', 0, 1, 0, '2'),
(516, 'Hunk of Junk', 'Overlord', 'Overlord Reward', NULL, 'Play this card when a hero uses a Potion or Item Search card, before its effect is resolved. That hero tests Knowledge. If he passes, draw 1 Overlord card. If he fails, flip that Search card facedown without resolving its effect.', 98, 0, 0, '28'),
