INSERT INTO `tbtravel` (`travel_id`, `travel_type`, `travel_name`, `travel_card`, `travel_event`, `travel_result`, `travel_special`, `travel_exp_id`) VALUES
(0, 'all', 'No Event', 0, 'No Event', 'No Event', NULL, 0),
(1, 'plains', 'Moss-covered Standing Stones', 1, 'You come across a collection of mosscovered standing stones.', 'Each hero tests Willpower and suffers 1 fatigue if he fails. If all heroes pass, each hero draws 1 Search Card.', NULL, 0),
(2, 'forest', 'Dense Thicket', 1, 'You hear weeping at the center of a dense thicket.', 'If you choose to investigate, each hero suffers 1 Damage and the overlord discards 1 random Overlord card.', NULL, 0),
(3, 'mountains', 'Unforgiving Slopes', 1, 'You''re caught on the unforgiving slopes during a fierce storm.', 'Each hero suffers 1 Damage and 1 Fatigue.', NULL, 0),
(4, 'road', 'Traveling Merchant', 2, 'You come across a traveling merchant.', 'Each hero tests Knowledge and draws 1 Search card if he passes.', NULL, 0),
(5, 'plains', 'Band of Refugees', 2, 'You come across a band of refugees.', 'If you stop and help them, the overlord draws 1 Overlord card. if you refuse them, each hero suffers 1 Damage', NULL, 0),
(6, 'forest', 'Lost', 2, 'You become lost.', 'Hero players choose one hero to test Willpower. If he fails, each hero suffers 1 Fatigue.', NULL, 0),
(7, 'plains', 'Smoke Smudging the Horizon', 3, 'You see smoke smudging the horizon in the distance.', 'The overlord draws 1 Overlord card.', NULL, 0),
(8, 'forest', 'Peaceful Glade', 3, 'Unexpectedly, you find a beautiful and peaceful glade in the woods.', 'Each hero recovers all Damage and Fatigue.', NULL, 0),
(9, 'mountains', 'An Ettin Appears', 3, 'An ettin appears from the mountains and attacks the heroes!', 'Each hero tests Might and suffers 1 Damage if he fails. If all heroes fail, each hero suffers 1 additional Damage.', NULL, 0),
(10, 'plains', 'Lawless Brigands', 4, 'Lawless brigands accost you.', 'Hero players choose one hero to test Might to scare them off. If he fails, each hero suffers 1 Damage in the battle.', NULL, 0),
(11, 'forest', 'Webs Hang Everywhere!', 4, 'Webs hang everywhere!', 'Each hero tests Awareness. Each hero who fails is ambushed by a spider and is Poisoned. If all heroes fail, each hero suffers 1 Damage.', NULL, 0),
(12, 'water', 'Something Glimmers', 4, 'Something glimmers at the bottom of the pool!', 'Hero players choose one hero to test Awareness to dive in after it. If he passes, draw 1 Search card.', NULL, 0),
(13, 'forest', 'Latari Elves', 5, 'A band of Latari Elves is beset by minions of the overlord.', 'Heroes may choose to leap to their defense, and each suffer 1 Damage. If they do not, the overlord draws 2 Overlord cards.', NULL, 0),
(14, 'mountains', 'Dwarf of Dunwarr', 5, 'A dwarf of Dunwarr is burying his brother. He warns you of dangers ahead.', 'Do not draw a Travel Event card for the next travel icon you stop at this phase.', 'skip', 0),
(15, 'water', 'Fat Bloated Corpses', 5, 'Fat, bloated corpses float in the water. As you approach, they moan and rise!', 'Each hero tests Willpower. Each hero who fails is overcome by zombies and is Diseased.', NULL, 0),
(16, 'road', 'Hidden Path', 6, 'You find a hidden path and make excellent time!', 'Do not draw a Travel event card for the next travel icon you stop at this phase.', 'skip', 0),
(17, 'mountains', 'Minions Emerge!', 6, 'The overlord''s minions emerge!', 'The overlord chooses 1 attribute. Each hero must test the chose attribute. Each hero that fails suffers 1 Damage and 1 Fatigue.', NULL, 0),
(18, 'forest', 'Minions Emerge!', 6, 'The overlord''s minions emerge!', 'The overlord chooses 1 attribute. Each hero must test the chose attribute. Each hero that fails suffers 1 Damage and 1 Fatigue.', NULL, 0),
(19, 'road', 'Traveling Sage', 7, 'A traveling sage gives you access to his library.', 'Hero players choose one hero to test Knowledge. If he passes, he may look at the overlord''s hand of cards and choose 1 to discard.', NULL, 0),
(20, 'forest', 'Spiders!', 7, 'Spiders! Gods be good, spiders!', 'The hero with the lowest Awareness (overlord''s choice in the case of a tie) is Poisoned.', NULL, 0),
(21, 'water', 'Pestilential Miasma', 7, 'A pestilential miasma seems to rise from the water.', 'The hero with the lowest Might (overlord''s choice in the case of a tie) is Diseased.', NULL, 0),
(22, 'plains', 'Burning Farm', 8, 'You find a farm already burning and stop to give the farmers a proper burial.', 'The overlord draws 1 Overlord card.', NULL, 0),
(23, 'mountains', 'Mysterious Cave', 8, 'A mysterious cave mouth looms ahead.', 'If the heroes choose to enter, draw 1 search card and the overlord draws 1 Overlord card.', NULL, 0),
(24, 'water', 'Mysterious Robed Figure', 8, 'A mysterious robed figure offers you a ride on his pole-bardge.', 'If the heroes choose to ride, each hero recovers all Fatigue, but the overlord draws 1 Overlord card.', NULL, 0),
(25, 'road', 'The Overlord''s Spies', 9, 'The overlord''s spies are everywhere.', 'Each hero tests Knowledge. The overlord draws 1 Overlord card for each hero that fails.', NULL, 0),
(26, 'mountains', 'Landslide!', 9, 'Landslide!', 'Each hero tests Might. Each hero that fails suffers 2 Fatigue.', NULL, 0),
(27, 'water', 'Last Night''s Rain', 9, 'After last night''s rain, the rivers are running high and fast.', 'Each hero tests Knowledge. Each hero that fails suffers 2 Fatigue.', NULL, 0),
(28, 'plains', 'Tree with Golden Apples', 10, 'You pause briefly in an orchard, which you discover has a tree with golden apples.', 'Hero players choose one hero to test Willpower. If he passes, draw 1 Search Card.', NULL, 0),
(29, 'mountains', 'Arrows fly', 10, 'Arrows fly from behind the boulders ahead!', 'Each hero tests Awareness and suffers 1 Damage if he fails. If all heroes fail, each hero suffers 1 additional Damage', NULL, 0),
(30, 'water', 'Tentacles', 10, 'Tentacles burst from the water and attempt to pull the heroes in!', 'Each hero tests Might and suffers 1 fatigue if he fails. If all heroes fail, each hero suffers 1 Damage.', NULL, 0),
(32, 'road', 'Wrong turn', 11, 'You think you took a wrong turn...', 'Each hero tests Knowledge and suffers 1 Fatigue if he fails. If all heroes pass, do not draw an event for the next path you travel on this phase.', 'skipchk', 1),
(33, 'water', 'Ferryman', 11, 'You begin to tire after the long journey. A ferryman sympathizes and offers you a ride.', 'You must spend 25 gold or each hero suffers 1 Fatigue.', 'gold', 1),
(34, 'plains', 'Winged Minions', 11, 'Winged minions of the overlord descend to assault you from above.', 'One hero tests Awareness. if he fails, each hero suffers 1 Damage and 1 Fatigue.', NULL, 1),
(35, 'all', 'Mysterious Herald', 12, 'As you make your way towards your destination, you are approached by a mysterious herald.\r\n"Tread carefully, heroes," the cloaked strangers says. "There are minions of evil everywhere! A terrible plot is afoot, just nearby, and it must be stopped! Come!"', 'The heroes may force the overlord to immediately play a Rumor card featuring a quest of the current act.\r\nif the heroes choose not to do this, or if the overlord does not have any Rumor cards in his hand featuring a valid quest, treat this Travel Event cards as "No Event."\r\nAfter resolving this event, retun this card to the game box.', NULL, 1),
(36, 'plains', 'The Enemy''s Scouts', 13, 'You encounter the enemy''s scouts.', 'The hero with the highest Awareness may suffer 1 fatigue to look at 1 random card from the overlord''s hand, or suffer 2 Damage to force the overlord to discard 1 random card.', NULL, 1),
(37, 'forest', 'An Old Crone', 13, 'You encounter an old crone who whispers a curse before disappearing back into the mists.', 'Each hero must test Willpower. Each hero who fails succumbs to her spell and is Burning.', NULL, 1),
(38, 'mountains', 'Mysterious Jester', 13, 'A mysterious jester appears and presents an irresistible offer...', 'One hero tests each of his attributes (Willpower, Knowledge, Awareness, and Might). If he passes all tests, draw 1 card from the current Act''s Shop Item deck.', 'item', 1),
(39, 'water', 'Invigorated', 14, 'You feel invigorated.', 'The heroes choose a warrior and place this card in his play area. He may discard this card at the start of his turn. He does not suffer Fatigue to use skills this turn.', NULL, 2),
(40, 'plains', 'Wandering Mystic', 14, 'A wandering mystic blesses you.', 'The heroes choose a healer and place this card in his play area. He may discard this card when reviving a hero. The reviced hero recovers all Damage.', NULL, 2),
(41, 'forest', 'Heavy Fog', 14, 'You feel a heavy fog surround you. Suddenly you feel strangely tired.', 'Each hero tests Knowledge. Each hero who fails must place a hero token on his Hero sheet. That hero''s Speed is 2 during his first turn.', NULL, 2),
(42, 'road', 'Discarded Scroll', 15, 'You come across a discarded scroll.', 'The heroes choose a mage and place this card in his play area. He may discard this card after rolling defense dice to add a number of Shields to his results equal to his Knowledge.', NULL, 2),
(43, 'plains', 'Traveling Healer', 15, 'A traveling healer offers you a mysterious method of healing.', 'The heroes choose 1 hero to suffer 2 Damage. Another hero of their choice recovers all Damage and discards all of his Condition cards.', NULL, 2),
(44, 'forest', 'Bandits Occupy This Forest', 15, 'Bandits occupy this dark forest.', 'Each hero tests either Willpower or Knowledge. Each hero that fails suffers 1 Damage and 1 Fatigue. If all heroes pass they may choose one hero to draw and keep 1 Shop Item card.', 'item', 2),
(45, 'plains', 'Ambush', 16, 'You sense an ambush.', 'The overlord may choose up to 3 different heroes to suffer 1 Damage each. At the start of the quest, he must choose 1 monster to suffer the same amount of Damage', NULL, 2),
(46, 'forest', 'Lost Merchant', 16, 'A lost merchant asks for directions.', 'Each hero tests Knowledge. For each hero that passes, the heroes gain 25 gold. If all heroes pass, they may instead choose 1 hero to draw and keep 1 Shop Item card', 'golditem', 2),
(47, 'mountains', 'Wonder at the Riches', 16, 'As you hike up the mountain path, you wonder at the riches that await.', 'The overlord may look at the top 3 cards of the search deck and return them to the top of the deck in any order he chooses.', NULL, 2),
(48, 'mountains', 'Mountain Path', 17, 'You find the mountain path to be painfully exhausting.', 'The overlord chooses 1 hero to test Might. If he fails, place a hero token on his Hero sheet. He has -1 Speed until he performs a rest action.', NULL, 2),
(49, 'forest', 'Gold Key', 17, 'A strange man offers you a gold key.', 'The heroes choose a scout and place this card in his play area. He may discard this card this card during the shoping phase to draw 3 additional Shop Item cards.', NULL, 2),
(50, 'road', 'Lost Messenger', 17, 'A lost messenger is selling secrets.', 'The heroes may choose to spend 25 gold to look at the overlord''s hand of Overlord cards. They may force him to discard 1 card and draw a replacement.', 'gold', 2),
(51, 'forest', 'Wild Beast', 18, 'A wild beast ambushes your party and you drop your weapons. You must resort to your bare hands.', 'The overlord chooses one hero to test Might. If he fails, that hero suffers Damage equal to his Might.', NULL, 2),
(52, 'mountains', 'Chest Sealed with a Rune', 18, 'You find a chest sealed with a rune.', 'Each hero tests Knowledge. if at least 2 heroes pass, the heroes may search the Search deck for 1 Health Potion, take it, and then shuffle the Search Deck.', NULL, 2),
(53, 'water', 'Woman by the Edge', 18, 'A woman is sitting by the edge of the water whispering incoherently. As you get closer, her words begin to fill you with dread.', 'Each hero tests Knowledge. Each hero who fails is Cursed.', NULL, 2),
(54, 'plains', 'Cloaked Traveller', 19, 'A cloaked traveller offers a warning.', 'Reveal the top card of the Overlord deck. The heroes may each suffer 1 Damage to place the card on the bottom of the deck. Otherwise, place the card on top of the deck.', NULL, 2),
(55, 'mountains', 'Rocky Ground', 19, 'As you hike your way up the mountain trail, the rocky ground gives way beneath your feet.', 'Each hero tests Might. Each hero who fails is Stunned. If all heroes fail, each hero suffers 1 Damage.', NULL, 2),
(56, 'water', 'Dark Fog', 19, 'A dark fog has settled over the water.', 'If the overlord has a number of Overlord cards equal to or less than the number of heroes, he draws 1 Overlord card', NULL, 2),
(57, 'road', 'Tall Tree', 20, 'A tall tree offers a scouting vantage.', 'Hero players choose 1 hero to suffer 1 Fatigue and test Awareness. If he passes, he may look at the top 3 cards of of the Overlord deck and return them in any order he chooses.', NULL, 2),
(58, 'mountains', 'Catching a Spy', 20, 'Catching a spy does not prove easy.', 'The overlord may choose to reveal his hand of Overlord cards. If he does, each hero suffers 2 Fatigue.', NULL, 2),
(59, 'water', 'The Water Appears Dark', 20, 'The water appears dark and smells rather foul.', 'The overlord chooses 1 hero that does not have a Condition card to test an attribute of the overlord''s choice. if he fails, he is Cursed.', NULL, 2),
(60, 'plains', 'Barren Field', 21, 'As you cross through a barren field with no sign of life, your party is assailed by unseen dark energy.', 'Each hero tests Willpower. Each hero who fails is Cursed.', NULL, 2),
(61, 'mountains', 'Evil Minions', 21, 'Evil minions gain strength.', 'Place this card in the overlord''s play area. The overlord may discard this card when activating a monster. That monster gains 2 movement points.', NULL, 2),
(62, 'water', 'Haggling with a Merchant', 21, 'Haggling with a traveling merchant causes unfortunate delay.', 'The heroes may choose 1 hero to draw and keep 1 Shop Item card. If they do, the overlord draws 2 Overlord cards.', 'item', 2),
(63, 'tower', 'Supply Drop', 22, 'One of your contacts has left a supply drop for you in this area.', 'Each hero recovers all damage and fatigue.', NULL, 4),
(64, 'sewer', 'Rats!', 22, 'Rats! Rats everywhere! Run!', 'Each hero with a Speed of 3 or less is Diseased. Each other hero suffers 1 fatigue.', NULL, 4),
(65, 'hazard', 'Foul Creatures', 22, 'Foul creatures block the path ahead. You could turn back and find another way, but it will cost precious time.', 'The heroes may choose to suffer 2 damage each. If they do not, the Overlord draws 2 Overlord cards.', NULL, 4),
(66, 'hazard', 'Thick, Burning Vapor', 23, 'A thick, burning vapor seeps into the room through cracks in the ground, and you''re quickly enveloped.', 'The hero with the lowest awareness (the overlord chooses in the case of a tie) is Poisoned and Diseased.', NULL, 4),
(67, 'building', 'Gang of Thugs', 23, 'A gang of thugs has you cornered in a building. Find a way out!', 'The overlord chooses one attribute. Each hero tests the chosen attribute. Each hero who fails suffers 1 damage and 1 fatigue.', NULL, 4),
(68, 'street', 'Feral Dogs', 23, 'Feral dogs lunge at you from a nearby alley, their sharp fangs tearing into you.', 'Each hero tests Might. Each hero who fails is Bleeding.', NULL, 4),
(69, 'sewer', 'Crazed Old Man', 24, 'A crazed old man offers you a shortcut, if you answer his questions correctly.', 'Each hero tests Knowledge. If 2 or more heroes pass, do not draw a City Event card for the next travel icon the heroes stop at during this phase.', 'skipchk', 4),
(70, 'tower', 'Swarms of Rats', 24, 'Swarms of rats gather in the shadows around you. Their yellowed teeth nip at your heels as you make for the exit.', 'Each hero suffers 1 Damage or 1 hero suffers 3 Damage.', NULL, 4),
(71, 'building', 'Practitioner of Dark Runecraft', 24, 'A practitioner of dark runecraft is said to live in this place.', 'If the heroes choose to investigate, each hero suffers 1 fatigue, and the Overlord discards 1 Overlord card of his choice.', NULL, 4),
(72, 'street', 'Dark and Seedy District', 25, 'You become lost in a dark and seedy district. You feel eyes upon you...', 'The heroes choose one hero to test Awareness. If he fails, he suffers 2 Damage. Then draw another city event card for this travel icon.', 'double', 4),
(73, 'hazard', 'Stone Monolith', 25, 'Your route is blocked by a massive stone monolith. You''ll have to try moving it.', 'Each hero tests Might. if 2 or more heroes fail, each hero suffers 1 Damage and 1 Fatigue.', NULL, 4),
(74, 'building', 'Collapsed Ceiling', 25, 'Sections of the ceiling in this building have collapsed. You have to move carefully through it.', 'Each hero suffers 1 Fatigue.', NULL, 4),
(75, 'tower', 'Broken Pipe', 26, 'A broken pipe spills rotting sewage onto the ground in front of you. You must now wade through it.', 'Each hero tests Willpower. Each hero who fails is Diseased.', NULL, 4),
(76, 'street', 'Shady Street Vendor', 26, 'A shady street vendor offers you some enticing goods.', 'Each hero may test Knowledge. Each hero who passes draws 1 Search card. For each hero who fails the overlord draws 1 Overlord card.', NULL, 4),
(77, 'hazard', 'Demonic Trap', 26, 'You''ve sprung a demonic trap! A blast of searing flame scorches one of your party.', 'The hero with the highest health (Overlords choice in case of tie) suffers 2 Damage.', NULL, 4),
(78, 'sewer', 'Collapsed Tunnel', 27, 'A collapse in this tunnel requires you to spend time digging.', 'Each hero tests Might. Each hero who fails suffers 1 Fatigue. If 2 or more heroes fail, the Overlord draws 1 Overlord card.', NULL, 4),
(79, 'hazard', 'Tendrils of Shadow', 27, 'From the darkness, tendrils of shadow claw at stragglers in your party.', 'The hero with the lowest Awareness (the Overlord chooses in case of a tie) is Bleeding.', NULL, 4),
(80, 'tower', 'Dark Alley', 27, 'You think you hear something down in a dark alley. It could be nothing, but someone might need help.', 'Each hero tests Awareness. If 2 or more heroes fail, the Overlord draws 1 Overlord card.', NULL, 4),
(81, 'tower', 'Street Urchin', 28, 'A street urchin guides you through the dark alleys of the city.', 'Do not draw a City Event card for the next travel icon the heroes stop at during this phase.', 'skip', 4),
(82, 'street', 'Large Carriage', 28, 'A large carriage hurtles towards you with terrifying speed! Dive out of the way!', 'Each hero test Awareness, Each hero who fails suffers 1 Fatigue and 1 Damage.', NULL, 4),
(83, 'sewer', 'Shiny Trinket', 28, 'A shiny trinket sparkles, submerged in the deep, filthy water.', 'The heroes choose 1 hero to test Willpower. If he passes, he draws 1 Search card. If he fails, the Overlord draws 1 Overlord card.', NULL, 4),
(84, '', 'Busteling and Crowded Streets', 29, 'The streets are busteling and crowded, making them very difficult to navigate.', 'Each hero suffers 1 Fatigue.', NULL, 4),
(85, 'tower', 'Locked Box', 29, 'You find a locked box covered in etchings of a strange, foreign script.', 'The heroes choose 1 hero to test Knowledge. If he passes, he draws 1 Search card. If he fails, the Overlord draws 1 Overlord card.', NULL, 4),
(86, 'sewer', 'Rat Problem', 29, 'City officials have gone through great lenghts to eliminate the rat problem in this section of the city.', 'The Overlord places 1 Overlord card from his hand on top of the Overlord deck.', NULL, 4),
(87, 'hazard', 'Enraged Ynfernael Hulk', 30, 'An enraged Ynfernael Hulk charges, and the ensuing fight leaves you battered and bloody.', 'Each hero suffers 2 Damage.', NULL, 4),
(88, 'sewer', 'Canteen in the Sewer', 30, 'In desperate need of water, you come across a canteen floating in the sewer.', 'If the heroes choose to drink, they choose 1 hero to be poisoned. Otherwise, the Overlord draws 2 Overlord cards.', NULL, 4),
(89, 'building', 'Spy Following You', 30, 'The spy following you is very careful and avoids being spotted.', 'The Overlord draws 1 Overlord card.', NULL, 4),
(90, 'street', 'Escort of Guardsmen', 31, 'And escort of guardsmen joins you, guiding you through the city.', 'Do not draw a City card for the next travel icon the heroes stop at during this phase.', 'skip', 4),
(91, 'tower', 'Vicious Beasts', 31, 'You''ve been cornered by vicious beasts and are forced to fight your way out.', 'Roll 2 red power dice. The heroes must collectivly suffer Damage equal to the amount of Damage rolled. They may split the Damage in any way.', NULL, 4),
(92, 'building', 'Tavern Brawl', 31, 'A brawl has broken out in the local tavern.', 'If the heroes choose to break up the fight, each hero suffers 1 Damage. Otherwise, the Overlord draws 1 Overlord card.', NULL, 4),
(93, 'road', 'Shady Traveler', 32, 'A shady traveler offers you directions, for a price.', 'If the heroes choose to spend 25 gold, do not draw a Travel Event card for the next travel icon stopped at this phase.', 'goldskp', 3),
(94, 'forest', 'Goblin Scout', 32, 'A goblin scout is running to warn his comrades!', 'One hero with a Ranged weapon rolls that weapon''s dice. If the total range rolled is less than 4, each hero suffers 2 Damage.', NULL, 3),
(95, 'plains', 'Vicious Thunderstorm', 32, 'A vicious thunderstorm hinders your progress.', 'Each hero suffers 1 Fatigue. Draw another Travel Event card for this location.', 'double', 3),
(96, 'forest', 'Hideous Plague Worm', 33, 'A hideous plague worm attacks!', 'The overlord chooses one hero. That hero suffers 1 Damage and is Weakened', NULL, 3),
(97, 'water', 'Corrupted Waters', 33, 'Something foul has corrupted these waters.', 'Each hero tests Might. Each hero that fails gains an infection token or is Poisoned, overlord''s choice.', NULL, 3),
(98, 'mountains', 'Captured Spy', 33, 'A captured spy divulges many secrets.', 'The overlord reveals his hand. The hero players may force him to discard his entire hand of cards. The overlord draws Overlord cards equal to the number discarded.', NULL, 3),
(99, 'all', 'Lone Knight', 34, 'A lone knight in shining silver armor blocks your path, bellowing a challenge to your strongest warrior.', 'Draw cards from the current Act''s Shop Item Deck until a Melee weapon is revealed.\nOne hero may choose to perform an attack with a Melee weapon against a grey defense die. This hero is also targeted by an attack from the drawn Shop Item, using his normal defense pool.\nIf the hero deals more Damage than he suffers, he may take the drawn Shop Item. If he suffers more Damage than he deals, discard the drawn Shop Item. In either case, return this card to the box. If the heroes choose not to do this, treat this Travel Event as "No Event."', 'item', 3),
(100, 'water', 'Inviting Lagoon', 35, 'Among the darkened waters you see a deep but inviting lagoon.', 'Each hero may choose to suffer 2 Damage and recover 2 Fatigue or suffer 2 Fatigue and recover 2 Damage.', NULL, 30),
(101, 'plains', 'Wild Witch', 35, 'A wild witch offers a boon.', 'The heroes chose 1 hero to be Terrified. At the end of that hero''s first turn, each monster adjacent to that hero is Terrified.', NULL, 30),
(102, 'forest', 'A Strange Locket', 35, 'A strange locket glints in the dirt.', 'The heroes choose 1 hero to test Knowledge. If he fails, each hero suffers Fatigue equal to the Shields rolled in excess of that hero''s Knowledge. If he passes, the heroes receive 25 gold.', 'goldchk', 30),
(103, 'road', 'Tree Inscribed With Inspiring Words', 36, 'A large tree in your path is inscribed with inspiring words.', 'Each hero applies +1 to each of his attributes until the end of this Travel step.', NULL, 30),
(104, 'mountains', 'Unnatural Figures', 36, 'Unnatural figures haunt the edge of your campsites.', 'The heroes choose a hero to test Awareness. If he passes, he is Terrified. If he fails, each other hero is Terrified.', NULL, 30),
(105, 'forest', 'A Recent Rain', 36, 'A recent rain has left the forest a boggy mess.', 'Each hero tests Might. Each hero who fails reduces his Speed to 1 during his first turn.', NULL, 30),
(106, 'water', 'Festering Leeches', 37, 'The water teems with festering leeches.', 'Each hero tests Awareness. Each hero who fails is Diseased.', NULL, 30),
(107, 'mountains', 'The Reek of Burning Flesh', 37, 'The reek of burning flesh draws you to an abandoned funeral pyre.', 'The heroes may choose 1 hero to test Awareness. If he passes, that hero draws 1 search card and is Terrified.', NULL, 30),
(108, 'road', 'Turn Back', 37, '"TURN BACK" is scrawled in blood on an ancient road marker.', 'Each hero tests Willpower. If 2 or more heroes fail, the overlord draws another card and resolves the event icon of his choice', 'doublech', 30),
(109, 'all', 'Ancient Graveyard', 38, 'You stumble across an ancient graveyard. The statue of a hooded figure towers over the crumbling tombstones. In the statue''s hands, a black crystal emanates a foreboding glow.', 'The heroes may choose to harvest the power of the crystal. If they do, each hero tests Knowledge. Each hero who fails is Terrified or Diseased (overlord''s choice). If all heroes pass, place this card in the play area of the hero with the highest Knowledge. During his turn, that hero may return this card to the game box. If he does, each hero may discard 1 condition. If the heroes choose not to do this, treat this Travel Event as "No Event"', NULL, 30),
(110, 'all', 'The Remains of a Wagon', 39, 'You find the remains of a wagon. A chest with a bizarre lock sits unopened among the wreckage. A voice whispers in your mind, "By ogre and wraith, unleash that which waits."', 'The heroes may choose 2 heroes to test both Might and Willpower to open the chest. If both heroes pass both tests, 1 hero draws and receives 1 Shop Item card from the current Act''s Shop Item deck.\r\nEach hero who fails his Might test is Stunned. Each hero who fails his Willpower test is Terrified. If the heroes choose not to do this, treat this Travel Event card as "No Event." After resolving this event, return this card to the game box.', 'item', 30),
(666, 'item', 'Mapstone', 70, 'The Heroes used the Mapstone.', 'Once during each travel step, the heroes may use the Mapstone to skip a travel step.', NULL, 3),
(999, 'None', 'Skipped', 0, 'Travel skipped!', 'The overlord did not draw a travel card for this travel step.', NULL, 0);
